    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Khi m\u1ed9t \u0111\u01b0\u1eddng h\u1ea7m d\u1ecbch v\u1ee5 m\u1edbi \u0111\u01b0\u1ee3c t\u1ea1o ho\u1eb7c d\u1ecbch v\u1ee5 ch\u1ea1y l\u1ea7n \u0111\u1ea7u (v\u00ed d\u1ee5 nh\u01b0 m\u00e1y ch\u1ee7 web jetty m\u1eb7c \u0111\u1ecbnh, ti\u1ec7n \u00edch b\u1ed5 tr\u1ee3), m\u1ed9t ch\u00eca kh\u00f3a m\u00e3 h\u00f3a ri\u00eang s\u1ebd \u0111\u01b0\u1ee3c t\u1ea1o ra ki\u1ec3m so\u00e1t quy\u1ec1n s\u1edf h\u1eefu \u0111\u1ecba ch\u1ec9. T\u1eadp tin n\u00e0y th\u01b0\u1eddng c\u00f3 t\u00ean <code>&hellip;privKey.dat</code> ho\u1eb7c <code>eepPriv.dat</code>, m\u1eb7c d\u00f9 \u00fd t\u01b0\u1edfng t\u1ed1t l\u00e0 \u0111\u1ed5i t\u00ean \u0111\u1ec3 ch\u1ec9 ra d\u1ecbch v\u1ee5 m\u00e0 n\u00f3 thu\u1ed9c v\u1ec1 v\u00e0 sau \u0111\u00f3 kh\u00f4i ph\u1ee5c l\u1ea1i trong c\u00e0i \u0111\u1eb7t m\u00e1y ch\u1ee7 c\u1ee7a Qu\u1ea3n l\u00fd \u0110\u01b0\u1eddng h\u1ea7m. T\u1eadp tin .dat n\u00e0y c\u1ea7n \u0111\u01b0\u1ee3c sao l\u01b0u an to\u00e0n; n\u1ebfu m\u1ea5t n\u00f3 s\u1ebd d\u1eabn \u0111\u1ebfn m\u1ea5t quy\u1ec1n s\u1edf h\u1eefu v\u00e0 \u0111i\u1ec1u khi\u1ec3n t\u00ean mi\u1ec1n c\u1ee7a b\u1ea1n!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "C\u00e0i \u0111\u1eb7t n\u00e0y cho ph\u00e9p c\u1ea5u h\u00ecnh s\u1ed1 t\u1ec7p t\u1ed1i \u0111a m\u1ed7i torrent m\u00e0 I2PSnark s\u1ebd cho ph\u00e9p khi t\u1ea3i xu\u1ed1ng ho\u1eb7c t\u1ea1o torrent. L\u01b0u \u00fd r\u1eb1ng vi\u1ec7c t\u0103ng \u0111\u00e1ng k\u1ec3 gi\u00e1 tr\u1ecb n\u00e0y so v\u1edbi m\u1eb7c \u0111\u1ecbnh l\u00e0 2000 t\u1ec7p c\u00f3 th\u1ec3 y\u00eau c\u1ea7u c\u1ea5u h\u00ecnh b\u1ed5 sung tr\u00ean h\u1ec7 th\u1ed1ng m\u00e1y ch\u1ee7 \u0111\u1ec3 t\u0103ng s\u1ed1 t\u1ec7p m\u1edf t\u1ed1i \u0111a h\u1ec7 \u0111i\u1ec1u h\u00e0nh cho ph\u00e9p (v\u00ed d\u1ee5 <code>ulimit -n</code> tr\u00ean Linux). \u0110\u1ec3 thay \u0111\u1ed5i, h\u00e3y th\u00eam v\u00e0o t\u1ec7p c\u1ea5u h\u00ecnh <code>i2psnark.config</code> c\u1ee7a I2PSnark. [Y\u00eau c\u1ea7u kh\u1edfi \u0111\u1ed9ng l\u1ea1i I2PSnark ho\u1eb7c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn]";
    t[370] = "Configure router bandwidth allocation";
