    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "Ch\u1ecdn t\u00ean cho trang web c\u1ee7a b\u1ea1n (<i>t\u00ean m\u00e1y ch\u1ee7</i>.i2p), s\u1eed d\u1ee5ng ch\u1eef th\u01b0\u1eddng. \u0110\u1ec3 x\u00e1c minh r\u1eb1ng t\u00ean m\u00e1y ch\u1ee7 c\u00f3 s\u1eb5n, h\u00e3y ki\u1ec3m tra <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> ho\u1eb7c <a href=http://reg.i2p target=_blank>reg. i2p</a> tr\u01b0\u1edbc khi b\u1ea1n quy\u1ebft \u0111\u1ecbnh. Nh\u1eadp t\u00ean m\u1edbi cho trang web c\u1ee7a b\u1ea1n tr\u00ean <a href='/i2ptunnel/edit?tunnel=3'>trang C\u1ea5u h\u00ecnh Tr\u00ecnh qu\u1ea3n l\u00fd \u0110\u01b0\u1eddng h\u1ea7m</a> n\u01a1i ghi <i>T\u00ean trang web</i>, thay th\u1ebf <i m\u1eb7c \u0111\u1ecbnh ph\u1ea7n gi\u1eef ch\u1ed7 >mysite.i2p</i>. N\u1ebfu b\u1ea1n mu\u1ed1n trang web c\u1ee7a m\u00ecnh kh\u1ea3 d\u1ee5ng khi I2P kh\u1edfi \u0111\u1ed9ng, h\u00e3y b\u1eadt <i>T\u1ef1 \u0111\u1ed9ng b\u1eaft \u0111\u1ea7u</i> r\u1ed3i nh\u1ea5p v\u00e0o <i>L\u01b0u</i>.";
