    t[617] = "Ti\u1ec1n th\u01b0\u1edfng c\u00f3 th\u1ec3 t\u00edch c\u1ef1c ho\u1eb7c ti\u00eau c\u1ef1c v\u00e0 \u1ea3nh h\u01b0\u1edfng \u0111\u1ebfn vi\u1ec7c \u0111\u01b0a \u0111\u1ed3ng nghi\u1ec7p v\u00e0o c\u00e1c c\u1ea5p N\u0103ng l\u1ef1c nhanh v\u00e0 N\u0103ng l\u1ef1c cao. C\u00e1c \u0111\u1ed3ng nghi\u1ec7p nhanh \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng cho c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m kh\u00e1ch h\u00e0ng v\u00e0 c\u00e1c \u0111\u1ed3ng nghi\u1ec7p C\u00f4ng su\u1ea5t cao \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng cho m\u1ed9t s\u1ed1 \u0111\u01b0\u1eddng h\u1ea7m th\u0103m d\u00f2.";
    t[618] = "Yes";
    t[619] = "C\u00f3";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "M\u1eb7c d\u00f9 I2P s\u1ebd ho\u1ea1t \u0111\u1ed9ng t\u1ed1t trong c\u1ea5u h\u00ecnh n\u00e0y, nh\u01b0ng n\u1ebfu b\u1ea1n th\u1ef1c s\u1ef1 c\u00f3 b\u0103ng th\u00f4ng tr\u00ean 128KBps \u0111\u1ec3 chia s\u1ebb, th\u00ec vi\u1ec7c m\u1edf t\u01b0\u1eddng l\u1eeda s\u1ebd h\u1eefu \u00edch h\u01a1n nhi\u1ec1u cho m\u1ea1ng.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "M\u1ed9t \u1ee9ng d\u1ee5ng d\u00f2ng l\u1ec7nh \u0111\u01b0\u1ee3c cung c\u1ea5p c\u00f9ng v\u1edbi I2P \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng \u0111\u1ec3 y\u00eau c\u1ea7u t\u00e0i nguy\u00ean URL, t\u01b0\u01a1ng t\u1ef1 nh\u01b0 <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget </a> ho\u1eb7c <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget c\u0169ng \u0111\u01b0\u1ee3c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn s\u1eed d\u1ee5ng n\u1ed9i b\u1ed9, ch\u1eb3ng h\u1ea1n nh\u01b0 \u0111\u1ec3 kh\u1edfi t\u1ea1o l\u1ea1i t\u1eeb c\u00e1c m\u00e1y ch\u1ee7 t\u1eeb xa. Theo m\u1eb7c \u0111\u1ecbnh, eepget s\u1eed d\u1ee5ng proxy HTTP tr\u00ean <code>127.0.0.1:4444</code>.";
    t[630] = "Mobile console option saved.";
