    t[722] = "Javadocs";
    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "M\u1ed9t eepsite l\u00e0 m\u1ed9t trang web \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef m\u1ed9t c\u00e1ch v\u00f4 danh tr\u00ean m\u1ea1ng I2P - b\u1ea1n c\u00f3 th\u1ec3 truy c\u1eadp n\u00f3 b\u1eb1ng c\u00e1ch c\u1ea5u h\u00ecnh tr\u00ecnh duy\u1ec7t web c\u1ee7a m\u00ecnh s\u1eed d\u1ee5ng Proxy HTTP c\u1ee7a I2P (xem \u1edf tr\u00ean) v\u00e0 duy\u1ec7t \u0111\u1ebfn trang web c\u00f3 \u0111u\u00f4i <code>.i2p</code> (v\u00ed d\u1ee5 <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). \u0110\u1ea3m b\u1ea3o tr\u00ecnh duy\u1ec7t c\u1ee7a b\u1ea1n \u0111\u01b0\u1ee3c c\u1ea5u h\u00ecnh \u0111\u1ec3 gi\u1ea3i quy\u1ebft DNS t\u1eeb xa khi s\u1eed d\u1ee5ng proxy \u0111\u1ec3 tr\u00e1nh r\u00f2 r\u1ec9 DNS.";
    t[730] = "Updating UDP port to {0}";
