    t[737] = "T\u00ecm t\u1ec7p c\u1ea5u h\u00ecnh: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> trong th\u01b0 m\u1ee5c <code>clients.config.d</code> c\u1ee7a th\u01b0 m\u1ee5c c\u00e0i \u0111\u1eb7t I2P c\u1ee7a b\u1ea1n, sau \u0111\u00f3 ch\u1ec9nh s\u1eeda ph\u00f9 h\u1ee3p:";
