    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "S\u1ed1 \u0111\u1ea7u ti\u00ean l\u00e0 s\u1ed1 l\u01b0\u1ee3ng \u0111\u1ed3ng nghi\u1ec7p m\u00e0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n \u0111\u00e3 g\u1eedi ho\u1eb7c nh\u1eadn tin nh\u1eafn trong v\u00e0i ph\u00fat g\u1ea7n \u0111\u00e2y. S\u1ed1 l\u01b0\u1ee3ng n\u00e0y c\u00f3 th\u1ec3 t\u1eeb 8-10 \u0111\u1ebfn v\u00e0i tr\u0103m t\u00f9y thu\u1ed9c v\u00e0o b\u0103ng th\u00f4ng t\u1ed5ng th\u1ec3, b\u0103ng th\u00f4ng chia s\u1ebb v\u00e0 l\u01b0u l\u01b0\u1ee3ng \u0111\u1ecba ph\u01b0\u01a1ng. S\u1ed1 th\u1ee9 hai l\u00e0 s\u1ed1 l\u01b0\u1ee3ng \u0111\u1ed3ng nghi\u1ec7p nh\u00ecn th\u1ea5y trong kho\u1ea3ng 1 gi\u1edd g\u1ea7n \u0111\u00e2y. Kh\u00f4ng c\u1ea7n quan t\u00e2m n\u1ebfu c\u00e1c s\u1ed1 li\u1ec7u n\u00e0y thay \u0111\u1ed5i r\u1ed9ng r\u00e3i. <a href='/configstats#router.activePeers'>[K\u00edch ho\u1ea1t bi\u1ec3u \u0111\u1ed3]</a>.";
