    t[977] = "T\u00ean m\u00e1y ch\u1ee7 ho\u1eb7c \u0111\u1ecba ch\u1ec9 IP c\u00f3 th\u1ec3 truy c\u1eadp \u0111\u01b0\u1ee3c t\u1eeb b\u00ean ngo\u00e0i";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "M\u00e1y ch\u1ee7 web c\u1ee7a b\u1ea1n \u0111ang ch\u1ea1y m\u1eb7c \u0111\u1ecbnh t\u1ea1i <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, nh\u01b0ng kh\u00f4ng th\u1ec3 truy c\u1eadp \u0111\u01b0\u1ee3c b\u1edfi ng\u01b0\u1eddi kh\u00e1c cho \u0111\u1ebfn khi b\u1ea1n b\u1eaft \u0111\u1ea7u <i>\u0110\u01b0\u1eddng h\u1ea7m M\u00e1y ch\u1ee7 Web I2P</i>. Sau khi b\u1eaft \u0111\u1ea7u \u0111\u01b0\u1eddng h\u1ea7m, trang web c\u1ee7a b\u1ea1n s\u1ebd kh\u00f3 t\u00ecm th\u1ea5y b\u1edfi ng\u01b0\u1eddi kh\u00e1c. B\u1ea1n ch\u1ec9 c\u1ea7n n\u00f3i cho ng\u01b0\u1eddi kh\u00e1c bi\u1ebft \u0111\u00edch \u0111\u1ebfn ho\u1eb7c \u0111\u1ecba ch\u1ec9 Base32, may m\u1eafn thay I2P c\u00f3 s\u1ed5 \u0111\u1ecba ch\u1ec9 \u0111\u1ec3 l\u01b0u tr\u1eef t\u00ean mi\u1ec1n, v\u00e0 c\u00e1c d\u1ecbch v\u1ee5 n\u01a1i b\u1ea1n c\u00f3 th\u1ec3 <a href=/help/hostnameregistration>\u0111\u0103ng k\u00fd mi\u1ec1n .i2p m\u1edbi</a> mi\u1ec5n ph\u00ed.";
