    t[1062] = "When set to true, accessing the router console via http:// when https:// is enabled will automatically redirect to https. To configure router console access, edit the settings in your <code>clients.config</code> file in your profile directory (<i>not</i> the application installation directory). [Enabled by default]";
    t[1063] = "Khi \u0111\u01b0\u1ee3c \u0111\u1eb7t th\u00e0nh TRUE, truy c\u1eadp b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn qua http:// khi https:// \u0111\u01b0\u1ee3c b\u1eadt s\u1ebd t\u1ef1 \u0111\u1ed9ng chuy\u1ec3n h\u01b0\u1edbng sang https. \u0110\u1ec3 c\u1ea5u h\u00ecnh truy c\u1eadp b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn, ch\u1ec9nh s\u1eeda c\u00e1c thi\u1ebft l\u1eadp trong t\u1ec7p <code>clients.config</code> c\u1ee7a b\u1ea1n trong th\u01b0 m\u1ee5c h\u1ed3 s\u01a1 (<i>kh\u00f4ng</i> l\u00e0 th\u01b0 m\u1ee5c c\u00e0i \u0111\u1eb7t \u1ee9ng d\u1ee5ng). [\u0110\u01b0\u1ee3c b\u1eadt theo m\u1eb7c \u0111\u1ecbnh]";
