    t[1197] = "\u0110\u00e3 xu\u1ea5t b\u1ea3n";
    t[1202] = "Upload Speed";
    t[1203] = "T\u1ed1c \u0111\u1ed9 t\u1ea3i l\u00ean";
    t[1206] = "config service";
    t[1207] = "d\u1ecbch v\u1ee5 c\u1ea5u h\u00ecnh";
    t[1208] = "Watching Big Tech...";
    t[1209] = "\u0110ang xem C\u00f4ng ngh\u1ec7 l\u1edbn...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "S\u1ef1 l\u1ec7ch (ch\u00eanh l\u1ec7ch) gi\u1eefa \u0111\u1ed3ng h\u1ed3 m\u00e1y t\u00ednh c\u1ee7a b\u1ea1n so v\u1edbi th\u1eddi gian \u0111\u1ed3ng b\u1ed9 m\u1ea1ng (n\u1ebfu bi\u1ebft \u0111\u01b0\u1ee3c). I2P y\u00eau c\u1ea7u \u0111\u1ed3ng h\u1ed3 m\u00e1y t\u00ednh c\u1ee7a b\u1ea1n ph\u1ea3i ch\u00ednh x\u00e1c. N\u1ebfu s\u1ef1 l\u1ec7ch l\u1ec7ch h\u01a1n v\u00e0i gi\u00e2y, xin vui l\u00f2ng kh\u1eafc ph\u1ee5c b\u1eb1ng c\u00e1ch \u0111i\u1ec1u ch\u1ec9nh \u0111\u1ed3ng h\u1ed3 m\u00e1y t\u00ednh. N\u1ebfu I2P kh\u00f4ng th\u1ec3 k\u1ebft n\u1ed1i v\u1edbi Internet, \u0111\u1ecdc gi\u00e1 tr\u1ecb 0ms c\u00f3 th\u1ec3 xu\u1ea5t hi\u1ec7n. L\u01b0u \u00fd: Th\u00f4ng tin n\u00e0y ch\u1ec9 hi\u1ec3n th\u1ecb t\u1ea1i ph\u1ea7n <i>Th\u00f4ng tin B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn (n\u00e2ng cao)</i>. B\u1ea1n c\u00f3 th\u1ec3 th\u00eam ph\u1ea7n n\u00e0y v\u00e0o Thanh b\u00ean trang <a href='/configsidebar'>C\u1ea5u h\u00ecnh Thanh b\u00ean</a>.";
