    t[1272] = "To migrate the key to a new router, or to setup multihoming (running the same service on multiple routers for redundancy and load-balancing), copy the backed up key to your .i2p directory and specify it in the new server tunnel, or replace the default key in the plugin folder (e.g. the zzzot plugin).";
    t[1273] = "\u0110\u1ec3 di chuy\u1ec3n kh\u00f3a sang b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn m\u1edbi ho\u1eb7c thi\u1ebft l\u1eadp \u0111a \u0111i\u1ec3m (ch\u1ea1y c\u00f9ng m\u1ed9t d\u1ecbch v\u1ee5 tr\u00ean nhi\u1ec1u b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u1ec3 d\u1ef1 ph\u00f2ng v\u00e0 c\u00e2n b\u1eb1ng t\u1ea3i), h\u00e3y sao ch\u00e9p kh\u00f3a \u0111\u01b0\u1ee3c sao l\u01b0u v\u00e0o th\u01b0 m\u1ee5c .I2P c\u1ee7a b\u1ea1n v\u00e0 ch\u1ec9 \u0111\u1ecbnh n\u00f3 trong \u0111\u01b0\u1eddng h\u1ea7m m\u00e1y ch\u1ee7 m\u1edbi ho\u1eb7c thay th\u1ebf ph\u00edm m\u1eb7c \u0111\u1ecbnh trong th\u01b0 m\u1ee5c plugin (v\u00ed d\u1ee5: plugin ZZZOT).";
