    t[2158] = "I'm missing lots of hosts in my addressbook. What are some good subscription links?";
    t[2159] = "T\u00f4i thi\u1ebfu r\u1ea5t nhi\u1ec1u m\u00e1y ch\u1ee7 trong s\u1ed5 \u0111\u1ecba ch\u1ec9 c\u1ee7a m\u00ecnh. M\u1ed9t s\u1ed1 li\u00ean k\u1ebft \u0111\u0103ng k\u00fd t\u1ed1t l\u00e0 g\u00ec?";
