    t[2184] = "Help with reseeding";
    t[2185] = "Tr\u1ee3 gi\u00fap gieo h\u1ea1t";
    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "\u0110\u1ecbnh ngh\u0129a ng\u01b0\u1ee1ng sau <i class=example>180/60</i> ch\u1ec9 r\u00f5 r\u1eb1ng c\u00f9ng m\u1ed9t \u0111i\u1ec3m \u0111\u1ebfn xa \u0111\u01b0\u1ee3c ph\u00e9p th\u1ef1c hi\u1ec7n 179 l\u1ea7n c\u1ed1 g\u1eafng k\u1ebft n\u1ed1i trong kho\u1ea3ng th\u1eddi gian 60 gi\u00e2y. N\u1ebfu n\u00f3 th\u1ef1c hi\u1ec7n m\u1ed9t l\u1ea7n n\u1eefa trong c\u00f9ng kho\u1ea3ng th\u1eddi gian \u0111\u00f3, ng\u01b0\u1ee1ng s\u1ebd b\u1ecb vi ph\u1ea1m v\u00e0 c\u00e1c l\u1ea7n c\u1ed1 g\u1eafng k\u1ebft n\u1ed1i ti\u1ebfp theo s\u1ebd b\u1ecb t\u1eeb ch\u1ed1i cho \u0111\u1ebfn cu\u1ed1i kho\u1ea3ng th\u1eddi gian \u0111\u00f3:";
    t[2190] = "config home";
    t[2191] = "c\u1ea5u h\u00ecnh trang ch\u1ee7";
    t[2192] = "Restore defaults";
    t[2193] = "Kh\u00f4i ph\u1ee5c m\u1eb7c \u0111\u1ecbnh";
    t[2196] = "Abridged I2P FAQ";
    t[2197] = "C\u00e2u h\u1ecfi th\u01b0\u1eddng g\u1eb7p I2P";
    t[2206] = "Version";
    t[2207] = "Phi\u00ean b\u1ea3n";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "Khi ch\u1ea1y ch\u01b0\u01a1ng tr\u00ecnh l\u1ea7n \u0111\u1ea7u ho\u1eb7c khi \u0111\u1ecba ch\u1ec9 IP b\u00ean ngo\u00e0i c\u1ee7a b\u1ea1n thay \u0111\u1ed5i khi ch\u1ea1y \u1edf ch\u1ebf \u0111\u1ed9 <a href=/confignet#ipchange>Laptop</a>, I2P s\u1ebd ch\u1ecdn ng\u1eabu nhi\u00ean m\u1ed9t c\u1ed5ng n\u1eb1m trong kho\u1ea3ng t\u1eeb 9000 \u0111\u1ebfn 31000 \u0111\u1ec3 li\u00ean l\u1ea1c v\u1edbi c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c. <a href=/confignet#udpconfig>C\u1ed5ng \u0111\u00e3 ch\u1ecdn</a> s\u1ebd \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb tr\u00ean trang <a href=/confignet>C\u1ea5u h\u00ecnh m\u1ea1ng</a>.";
    t[2212] = "Message send rate (B/s)";
    t[2213] = "T\u1ed1c \u0111\u1ed9 g\u1eedi tin nh\u1eafn (B/s)";
    t[2214] = "Update or check already in progress";
    t[2215] = "\u0110ang c\u1eadp nh\u1eadt ho\u1eb7c ki\u1ec3m tra";
    t[2218] = "Log date format";
    t[2219] = "\u0110\u1ecbnh d\u1ea1ng ng\u00e0y th\u00e1ng nh\u1eadt k\u00fd";
    t[2226] = "Less than 256MB allocated to the JVM";
    t[2227] = "D\u01b0\u1edbi 256MB \u0111\u01b0\u1ee3c ph\u00e2n b\u1ed5 cho JVM";
    t[2230] = "Average closest floodfill distance";
    t[2231] = "Kho\u1ea3ng c\u00e1ch l\u1ea5p l\u0169 trung b\u00ecnh g\u1ea7n nh\u1ea5t";
    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "S\u1ebd m\u1ea5t \u00edt nh\u1ea5t 10 ph\u00fat t\u1eeb b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n b\u1eaft \u0111\u1ea7u \u0111\u1ec3 ch\u1ea5p nh\u1eadn x\u00e2y d\u1ef1ng c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m tham gia \u0111\u1ec3 \u0111\u1ea3m b\u1ea3o b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n \u1ed5n \u0111\u1ecbnh v\u00e0 kh\u1edfi \u0111\u1ed9ng th\u00e0nh c\u00f4ng v\u00e0o m\u1ea1ng.";
    t[2234] = "Last Heard From";
    t[2235] = "Tin nh\u1eafn cu\u1ed1i c\u00f9ng t\u1eeb";
    t[2236] = "midnight";
    t[2237] = "n\u1eeda \u0111\u00eam";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "Gi\u1edbi thi\u1ec7u nh\u1eb9 nh\u00e0ng v\u1ec1 I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Th\u1eddi gian trung b\u00ecnh m\u00e0 c\u00e1c c\u00f4ng vi\u1ec7c ph\u1ea3i ch\u1edd \u0111\u1ec3 \u0111\u01b0\u1ee3c th\u1ef1c thi. H\u00e0ng \u0111\u1ee3i c\u00f4ng vi\u1ec7c \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea tr\u00ean trang <a href='/jobs'>Trang C\u00f4ng vi\u1ec7c</a>. \u0110\u00e1ng ti\u1ebfc l\u00e0 c\u00f3 m\u1ed9t v\u00e0i h\u00e0ng \u0111\u1ee3i c\u00f4ng vi\u1ec7c kh\u00e1c trong b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn m\u00e0 c\u00f3 th\u1ec3 b\u1ecb t\u1eafc ngh\u1ebdn, v\u00e0 t\u00ecnh tr\u1ea1ng c\u1ee7a ch\u00fang kh\u00f4ng hi\u1ec3n th\u1ecb tr\u00ean b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn. Th\u1eddi gian ch\u1edd th\u00f4ng th\u01b0\u1eddng n\u00ean g\u1ea7n b\u1eb1ng kh\u00f4ng. N\u1ebfu lu\u00f4n cao h\u01a1n 500ms, m\u00e1y t\u00ednh c\u1ee7a b\u1ea1n qu\u00e1 ch\u1eadm, m\u1ea1ng \u0111ang g\u1eb7p v\u1ea5n \u0111\u1ec1 k\u1ebft n\u1ed1i, ho\u1eb7c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn g\u1eb7p v\u1ea5n \u0111\u1ec1 nghi\u00eam tr\u1ecdng. <a href='/configstats#jobQueue.jobLag'>[K\u00edch ho\u1ea1t bi\u1ec3u \u0111\u1ed3]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "\u0110\u1ecbnh c\u1ea5u h\u00ecnh c\u1eadp nh\u1eadt I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Tr\u01b0\u1edbc khi gi\u1edbi thi\u1ec7u v\u1edbi c\u1ea3 th\u1ebf gi\u1edbi v\u1ec1 trang web m\u1edbi c\u1ee7a m\u00ecnh, b\u1ea1n n\u00ean th\u00eam m\u1ed9t s\u1ed1 n\u1ed9i dung. \u0110i t\u1edbi th\u01b0 m\u1ee5c g\u1ed1c c\u1ee7a m\u00e1y ch\u1ee7 <a href=#rootdir>\u0111\u01b0\u1ee3c li\u1ec7t k\u00ea \u1edf tr\u00ean</a> v\u00e0 thay th\u1ebf trang chuy\u1ec3n h\u01b0\u1edbng <i>index.html</i> b\u1eb1ng n\u1ed9i dung c\u1ee7a ri\u00eang b\u1ea1n. N\u1ebfu b\u1ea1n c\u1ea7n m\u1eabu cho trang web c\u01a1 b\u1ea3n, vui l\u00f2ng \u0111i\u1ec1u ch\u1ec9nh <a href=http://127.0.0.1:7658/help/pagetemplate.html>trang n\u00e0y</a>. N\u1ebfu b\u1ea1n quay l\u1ea1i trang n\u00e0y sau khi ch\u1ec9nh s\u1eeda n\u1ed9i dung, h\u00e3y th\u1eed x\u00f3a b\u1ed9 nh\u1edb \u0111\u1ec7m web c\u1ee7a tr\u00ecnh duy\u1ec7t.";
