    t[2292] = "Signed by";
    t[2293] = "Ng\u01b0\u1eddi k\u00fd t\u00ean";
    t[2294] = "The <i class=example>default</i> threshold applies to any remote destination not explicitly listed in the definition or in any of the referenced files. To set a default threshold use the keyword <i class=example>default</i>.";
    t[2295] = "Ng\u01b0\u1ee1ng m\u1eb7c \u0111\u1ecbnh <i class=example>default</i> \u00e1p d\u1ee5ng cho b\u1ea5t k\u1ef3 \u0111i\u1ec3m \u0111\u1ebfn xa n\u00e0o kh\u00f4ng \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea r\u00f5 r\u00e0ng trong \u0111\u1ecbnh ngh\u0129a ho\u1eb7c b\u1ea5t k\u1ef3 t\u1ec7p tham chi\u1ebfu n\u00e0o. \u0110\u1ec3 thi\u1ebft l\u1eadp ng\u01b0\u1ee1ng m\u1eb7c \u0111\u1ecbnh, h\u00e3y s\u1eed d\u1ee5ng t\u1eeb kho\u00e1 <i class=example>default</i>.";
    t[2306] = "Estimated total leasesets";
