    t[2310] = "Send on";
    t[2311] = "G\u1eedi ti\u1ebfp";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "N\u1ebfu b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n c\u00f3 10 \u0111\u1ed3ng h\u00e0nh ho\u1ea1t \u0111\u1ed9ng tr\u1edf l\u00ean, m\u1ecdi th\u1ee9 \u0111\u1ec1u \u1ed5n. B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn n\u00ean duy tr\u00ec k\u1ebft n\u1ed1i v\u1edbi m\u1ed9t v\u00e0i \u0111\u1ed3ng h\u00e0nh li\u00ean t\u1ee5c. C\u00e1ch t\u1ed1t nh\u1ea5t \u0111\u1ec3 l\u00e0 \"k\u1ebft n\u1ed1i t\u1ed1t h\u01a1n\" v\u1edbi m\u1ea1ng l\u00e0 <a href=/config>chia s\u1ebb th\u00eam b\u0103ng th\u00f4ng</a>.";
    t[2320] = "Not enough shared bandwidth to build transit tunnels.";
    t[2321] = "Kh\u00f4ng \u0111\u1ee7 b\u0103ng th\u00f4ng chia s\u1ebb \u0111\u1ec3 x\u00e2y d\u1ef1ng \u0111\u01b0\u1eddng h\u1ea7m chuy\u1ec3n tuy\u1ebfn.";
    t[2332] = "Congestion";
