    t[2342] = "SymmetricNAT";
    t[2343] = "NAT \u0111\u1ed1i x\u1ee9ng";
    t[2364] = "Some basic indications of router overload:";
    t[2365] = "M\u1ed9t s\u1ed1 ch\u1ec9 d\u1eabn c\u01a1 b\u1ea3n c\u1ee7a qu\u00e1 t\u1ea3i b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn:";
    t[2370] = "Glossary";
    t[2371] = "Thu\u1eadt ng\u1eef";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "\u0110\u1ec3 c\u00f3 \u0111\u01b0\u1ee3c t\u00ean mi\u1ec1n ri\u00eang c\u1ee7a b\u1ea1n, nh\u1eefng \u0111\u0103ng k\u00fd t\u00ean mi\u1ec1n I2P nh\u01b0 <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> ho\u1eb7c <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> cung c\u1ea5p c\u00e1c d\u1ecbch v\u1ee5 \u0111\u0103ng k\u00fd cho ph\u00e9p b\u1ea1n \u0111\u0103ng k\u00fd v\u00e0 qu\u1ea3n l\u00fd t\u00ean mi\u1ec1n ho\u1eb7c ph\u00e2n mi\u1ec1n .i2p, sau \u0111\u00f3 s\u1ebd lan truy\u1ec1n kh\u1eafp m\u1ea1ng. M\u1ed9t s\u1ed1 trang \u0111\u0103ng k\u00fd s\u1ebd y\u00eau c\u1ea7u <i>\u0111\u1ecba ch\u1ec9 m\u1ee5c ti\u00eau B64</i> cho \u0111\u01b0\u1eddng h\u1ea7m/d\u1ecbch v\u1ee5 b\u1ea1n mu\u1ed1n li\u00ean k\u1ebft v\u1edbi t\u00ean mi\u1ec1n, b\u1ea1n n\u00ean sao ch\u00e9p t\u1eeb ph\u1ea7n <i>\u0110\u1ecba ch\u1ec9 c\u1ee5c b\u1ed9</i> tr\u00ean trang <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>C\u1ea5u h\u00ecnh Qu\u1ea3n l\u00fd \u0110\u01b0\u1eddng h\u1ea7m</a>.";
