    t[2471] = "Ki\u1ec3m so\u00e1t ngang h\u00e0ng th\u1ee7 c\u00f4ng";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "\u0110\u00e2y ch\u1ec9 ra l\u01b0\u1ee3ng RAM m\u00e0 I2P \u0111ang s\u1eed d\u1ee5ng, v\u00e0 t\u1ed5ng l\u01b0\u1ee3ng RAM c\u00f3 s\u1eb5n \u0111\u01b0\u1ee3c ph\u00e2n b\u1ed5 b\u1edfi Java. N\u1ebfu vi\u1ec7c s\u1eed d\u1ee5ng lu\u00f4n cao so v\u1edbi RAM c\u00f3 s\u1eb5n, c\u00f3 th\u1ec3 b\u1ea1n c\u1ea7n t\u0103ng l\u01b0\u1ee3ng RAM c\u1ea5p cho JVM. B\u1ea1n c\u00f3 th\u1ec3 c\u1ea5p ph\u00e1t th\u00eam RAM b\u1eb1ng c\u00e1ch ch\u1ec9nh s\u1eeda t\u1ec7p <code>wrapper.config</code> th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u1ea1i th\u01b0 m\u1ee5c \u1ee9ng d\u1ee5ng I2P. B\u1ea1n c\u1ea7n ch\u1ec9nh s\u1eeda tham s\u1ed1 <code>wrapper.java.maxmemory</code> m\u1eb7c \u0111\u1ecbnh l\u00e0 256(MB) cho I2P, ho\u1eb7c 384 cho I2P+. L\u01b0u \u00fd: n\u1ebfu thanh b\u1ed9 nh\u1edb \u0111\u01b0\u1ee3c k\u00edch ho\u1ea1t, m\u1ee5c b\u1ed9 nh\u1edb t\u1ea1i ph\u1ea7n th\u00f4ng tin b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn s\u1ebd b\u1ecb \u1ea9n \u0111i.";
