    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Nhi\u1ec1u th\u1ed1ng k\u00ea tr\u00ean thanh b\u00ean c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c <a href='/configstats'>c\u1ea5u h\u00ecnh</a> \u0111\u1ec3 \u0111\u01b0\u1ee3c <a href='/graphs'>bi\u1ec3u \u0111\u1ed3 h\u00f3a</a> cho ph\u00e2n t\u00edch s\u00e2u h\u01a1n. B\u1ea1n c\u0169ng c\u00f3 th\u1ec3 t\u00f9y ch\u1ec9nh c\u00e1c ph\u1ea7n hi\u1ec3n th\u1ecb tr\u00ean Thanh b\u00ean v\u00e0 v\u1ecb tr\u00ed c\u1ee7a ch\u00fang tr\u00ean trang <a href='/configsidebar'>C\u1ea5u h\u00ecnh Thanh b\u00ean</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "C\u00e0i \u0111\u1eb7t n\u00e0y cho ph\u00e9p b\u1ea1n b\u1eadt ho\u1eb7c t\u1eaft ph\u1ea3n h\u1ed3i \u0111\u1ed1i v\u1edbi ping g\u1eedi \u0111\u1ebfn c\u00e1c m\u00e1y ch\u1ee7 do b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn l\u01b0u tr\u1eef. \u0110\u1ec3 v\u00f4 hi\u1ec7u h\u00f3a ping, b\u1ea1n ph\u1ea3i th\u00eam d\u00f2ng <code>i2p.streaming.answerPings=false</code> v\u00e0o ph\u1ea7n <i>Tu\u1ef3 ch\u1ecdn t\u00f9y bi\u1ebfn</i> cho c\u1ea5u h\u00ecnh m\u00e1y ch\u1ee7 trong Tr\u00ecnh qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng \u1ed1ng.";
    t[2592] = "Max";
    t[2593] = "T\u1ed1i \u0111a";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "N\u1ebfu b\u1ea1n mu\u1ed1n c\u00e0i \u0111\u1eb7t c\u00e1c b\u1ea3n c\u1eadp nh\u1eadt I2P ch\u01b0a k\u00ed (.zip), th\u00ec \u0111i\u1ec1u n\u00e0y n\u00ean \u0111\u01b0\u1ee3c th\u00eam v\u00e0o t\u1ec7p <code>router.config</code> c\u1ee7a b\u1ea1n tr\u1eeb khi b\u1ea1n \u0111\u00e3 c\u1ea5u h\u00ecnh <code>routerconsole.advanced=true</code>, trong tr\u01b0\u1eddng h\u1ee3p n\u00e0y t\u00f9y ch\u1ecdn n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c cung c\u1ea5p tr\u01b0\u1edbc. L\u01b0u \u00fd: k\u1ec3 t\u1eeb I2P+ 0.9.48+, vi\u1ec7c c\u00e0i \u0111\u1eb7t <a href=/configupdate#i2pupdates>c\u00e1c b\u1ea3n c\u1eadp nh\u1eadt ch\u01b0a k\u00ed</a> \u0111\u00e3 \u0111\u01b0\u1ee3c k\u00edch ho\u1ea1t m\u1eb7c \u0111\u1ecbnh.";
