    t[2608] = "The current external IP address reported by UPnP is {0}";
    t[2609] = "\u0110\u1ecba ch\u1ec9 IP b\u1ed5 sung hi\u1ec7n t\u1ea1i \u0111\u01b0\u1ee3c b\u00e1o c\u00e1o b\u1edfi UPnP l\u00e0 {0}";
    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "N\u1ebfu b\u1ea1n bi\u1ebft v\u00e0 tin t\u01b0\u1edfng ai \u0111\u00f3 \u0111ang ch\u1ea1y I2P, h\u00e3y nh\u1edd h\u1ecd g\u1eedi cho b\u1ea1n m\u1ed9t t\u1ec7p gieo h\u1ea1t \u0111\u01b0\u1ee3c t\u1ea1o ra b\u1eb1ng trang n\u00e0y tr\u00ean b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n router c\u1ee7a h\u1ecd. Sau \u0111\u00f3, ch\u1ecdn t\u00f9y ch\u1ecdn <i>Gieo h\u1ea1t t\u1eeb T\u1ec7p</i> tr\u00ean {0} b\u1eb1ng t\u1ec7p b\u1ea1n nh\u1eadn \u0111\u01b0\u1ee3c.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[2621] = "\u0110\u1ec3 k\u00edch ho\u1ea1t nh\u1eefng thay \u0111\u1ed5i ch\u1ec9 trong phi\u00ean cho c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m kh\u00e1ch h\u00e0ng, h\u00e3y k\u00edch ho\u1ea1t ch\u1ebf \u0111\u1ed9 <a href=\"/help/advancedsettings\">N\u00e2ng cao</a> c\u1ee7a console.";
