    t[2672] = "Peers we've been talking to in the last minute / last hour";
    t[2673] = "Nh\u1eefng ng\u01b0\u1eddi b\u1ea1n m\u00e0 ch\u00fang ta \u0111\u00e3 n\u00f3i chuy\u1ec7n trong v\u00e0i ph\u00fat qua/gi\u1edd qua";
    t[2676] = "Open console on startup";
    t[2677] = "M\u1edf b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n khi kh\u1edfi \u0111\u1ed9ng";
    t[2680] = "Review possible sybils in network database";
    t[2681] = "Xem x\u00e9t c\u00e1c sybils c\u00f3 th\u1ec3 c\u00f3 trong c\u01a1 s\u1edf d\u1eef li\u1ec7u m\u1ea1ng";
    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "C\u1ea5u h\u00ecnh li\u00ean k\u1ebft WAN Ethernet";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "C\u00e0i \u0111\u1eb7t n\u00e0y (t\u00ednh b\u1eb1ng gi\u00e2y) cho ph\u00e9p b\u1ea1n ghi \u0111\u00e8 s\u1ef1 ch\u1eadm tr\u1ec5 gi\u1eefa c\u00e1c l\u1ea7n ch\u1ea1y c\u1ee7a c\u00f4ng vi\u1ec7c kh\u00e1m ph\u00e1 ngang h\u00e0ng, c\u1ed1 g\u1eafng x\u00e1c \u0111\u1ecbnh v\u1ecb tr\u00ed c\u00e1c \u0111\u1ed3ng nghi\u1ec7p m\u1edbi \u0111\u1ec3 th\u00eam v\u00e0o NETDB. C\u00f4ng vi\u1ec7c s\u1ebd ch\u1ea1y c\u1ee9 sau 80 gi\u00e2y theo m\u1eb7c \u0111\u1ecbnh ho\u1eb7c n\u1ebfu b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111ang tr\u1ea3i qua \u0111\u1ed9 tr\u1ec5 c\u00f4ng vi\u1ec7c ho\u1eb7c tin nh\u1eafn, c\u1ee9 sau 3 ph\u00fat. N\u1ebfu k\u00edch th\u01b0\u1edbc c\u1ee7a NETDB \u0111\u1ea1t 4000 \u0111\u1ed3ng nghi\u1ec7p, t\u1ea1m d\u1eebng s\u1ebd t\u0103ng l\u00ean 15 ph\u00fat. B\u1ea1n c\u00f3 th\u1ec3 mu\u1ed1n t\u0103ng \u0111\u1ed9 tr\u1ec5 n\u1ebfu NETDB c\u1ee7a b\u1ea1n \u0111\u01b0\u1ee3c \u0111\u00f4ng d\u00e2n c\u01b0 (h\u01a1n 2000 \u0111\u1ed3ng nghi\u1ec7p) ho\u1eb7c n\u1ebfu b\u1ea1n mu\u1ed1n gi\u1ea3m s\u1eed d\u1ee5ng b\u0103ng th\u00f4ng t\u1ed5ng th\u1ec3. L\u01b0u \u00fd: \u0110\u1ed1i v\u1edbi c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn l\u0169 l\u1ee5t, c\u00f4ng vi\u1ec7c n\u00e0y kh\u00f4ng ch\u1ea1y.";
    t[2698] = "Current";
    t[2699] = "Hi\u1ec7n t\u1ea1i";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "M\u1ed9t trang web \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef tr\u00ean m\u1ea1ng I2P. M\u1eb7c \u0111\u1ecbnh, m\u00e1y ch\u1ee7 web <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty</a> \u0111\u01b0\u1ee3c c\u1ea5u h\u00ecnh v\u00e0 ch\u1ea1y tr\u00ean <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "C\u00f3 th\u1ec3 v\u00f4 hi\u1ec7u h\u00f3a ho\u1eb7c thay \u0111\u1ed5i trong <a href=/i2ptunnelmgr>Qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m</a>. C\u0169ng c\u00f3 th\u1ec3 c\u1ea5u h\u00ecnh li\u00ean k\u1ebft v\u1edbi giao di\u1ec7n c\u1ee5 th\u1ec3 ho\u1eb7c t\u1ea5t c\u1ea3 c\u00e1c giao di\u1ec7n.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "D\u1ecbch v\u1ee5 I2P hi\u1ec7n \u0111\u01b0\u1ee3c b\u1eadt khi kh\u1edfi \u0111\u1ed9ng h\u1ec7 th\u1ed1ng";
    t[2748] = "Computer related news aggregation";
    t[2749] = "T\u1ed5ng h\u1ee3p tin t\u1ee9c li\u00ean quan \u0111\u1ebfn m\u00e1y t\u00ednh";
    t[2752] = "Same IP as us";
    t[2753] = "C\u00f9ng IP v\u1edbi ch\u00fang t\u00f4i";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "B\u1ea1n c\u00f3 th\u1ec3 t\u1ea1o d\u00f2ng b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn m\u1edbi t\u1ea1i \u0111\u00e2y.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "C\u00e1c \u0111\u01b0\u1eddng h\u1ea7m \u0111\u1ed3ng \u0111\u1eb3ng \u0111\u00e3 \u0111\u1ed3ng \u00fd tham gia";
    t[2758] = "Advanced Lookup";
    t[2759] = "Tra c\u1ee9u n\u00e2ng cao";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "\u0110\u1ec3 truy c\u1eadp v\u00e0o c\u00e1c trang web \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef tr\u00ean I2P, v\u00e0 t\u00f9y ch\u1ecdn s\u1eed d\u1ee5ng outproxy m\u1eb7c \u0111\u1ecbnh \u0111\u1ec3 k\u1ebft n\u1ed1i v\u1edbi c\u00e1c trang web tr\u00ean Internet c\u00f4ng khai, b\u1ea1n c\u1ea7n c\u1ea5u h\u00ecnh tr\u00ecnh duy\u1ec7t c\u1ee7a m\u00ecnh s\u1eed d\u1ee5ng proxy HTTP c\u1ee7a I2P, m\u1eb7c \u0111\u1ecbnh ch\u1ea1y tr\u00ean <code>127.0.0.1 c\u1ed5ng 4444</code>. H\u1ea7u h\u1ebft c\u00e1c tr\u00ecnh duy\u1ec7t \u0111\u1ec1u cung c\u1ea5p t\u00f9y ch\u1ecdn \u0111\u1ec3 c\u1ea5u h\u00ecnh proxy; trong h\u01b0\u1edbng d\u1eabn n\u00e0y ch\u00fang t\u00f4i s\u1ebd t\u1eadp trung v\u00e0o Firefox.";
    t[2776] = "Close to us";
    t[2777] = "G\u1ea7n g\u0169i v\u1edbi ch\u00fang t\u00f4i";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "I2P+ Sitemap";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "Phi\u00ean b\u1ea3n c\u1ee7a ti\u1ec7n \u00edch t\u1ea3i v\u1ec1 l\u00e0 {0} kh\u00f4ng m\u1edbi h\u01a1n ti\u1ec7n \u00edch \u0111\u00e3 \u0111\u01b0\u1ee3c c\u00e0i \u0111\u1eb7t";
    t[2796] = "Streaming radio service";
    t[2797] = "D\u1ecbch v\u1ee5 ph\u00e1t thanh tr\u1ef1c tuy\u1ebfn";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ ho\u1ea1t \u0111\u1ed9ng t\u1ed1t nh\u1ea5t khi b\u1ea1n c\u00f3 th\u1ec3 ph\u1ea3n \u00e1nh ch\u00ednh x\u00e1c t\u1ed1c \u0111\u1ed9 k\u1ebft n\u1ed1i m\u1ea1ng c\u1ee7a m\u00ecnh trong m\u1ee5c <a href=/config>c\u1ea5u h\u00ecnh b\u0103ng th\u00f4ng</a>. M\u1eb7c \u0111\u1ecbnh I2P+ \u0111\u01b0\u1ee3c c\u1ea5u h\u00ecnh v\u1edbi m\u1ed9t s\u1ed1 gi\u00e1 tr\u1ecb t\u01b0\u01a1ng \u0111\u1ed1i b\u1ea3o th\u1ee7 kh\u00f4ng ph\u00f9 h\u1ee3p v\u1edbi nhi\u1ec1u tr\u01b0\u1eddng h\u1ee3p s\u1eed d\u1ee5ng, v\u00ec v\u1eady h\u00e3y d\u00e0nh th\u1eddi gian \u0111\u1ec3 xem x\u00e9t l\u1ea1i c\u00e1c thi\u1ebft l\u1eadp n\u00e0y v\u00e0 s\u1eeda ch\u1eefa n\u01a1i c\u1ea7n thi\u1ebft. B\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c h\u01b0\u1edfng l\u1ee3i nhi\u1ec1u h\u01a1n t\u1eeb m\u1ea1ng khi c\u1ea5p ph\u00e1t nhi\u1ec1u b\u0103ng th\u00f4ng h\u01a1n, <i>c\u1ee5 th\u1ec3</i> l\u00e0 b\u0103ng th\u00f4ng upstream.";
    t[2810] = "Transit by Peer";
    t[2811] = "Qu\u00e1 c\u1ea3nh b\u1edfi ngang h\u00e0ng";
    t[2812] = "Hidden Mode";
    t[2813] = "Ch\u1ebf \u0111\u1ed9 \u1ea9n";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "Plugin y\u00eau c\u1ea7u phi\u00ean b\u1ea3n Jetty {0} ho\u1eb7c th\u1ea5p h\u01a1n";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "Proxy c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef t\u1eeb xa ho\u1eb7c d\u1ecbch v\u1ee5 ch\u1ea1y tr\u00ean m\u00e1y t\u00ednh c\u1ee7a b\u1ea1n (localhost / 127.0.0.1).";
    t[2824] = "Events in peak period";
    t[2825] = "S\u1ef1 ki\u1ec7n trong th\u1eddi k\u1ef3 cao \u0111i\u1ec3m";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "B\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Ph\u1ea3i l\u00e0m g\u00ec trong tr\u01b0\u1eddng h\u1ee3p I2P+ kh\u00f4ng ho\u1ea1t \u0111\u1ed9ng";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "C\u1ea2NH B\u00c1O \u1ea8N DANH - C\u00e0i \u0111\u1eb7t bao g\u1ed3m \u0111\u01b0\u1eddng h\u1ea7m 1 b\u01b0\u1edbc.";
    t[2858] = "I2P IRC Network";
    t[2859] = "M\u1ea1ng IRC I2P";
    t[2864] = "pixels wide";
    t[2865] = "chi\u1ec1u r\u1ed9ng pixel";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Giao th\u1ee9c M\u1ea1ng I2P (I2NP) qu\u1ea3n l\u00fd \u0111\u1ecbnh tuy\u1ebfn v\u00e0 tr\u1ed9n l\u1eabn c\u00e1c tin nh\u1eafn gi\u1eefa c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn, b\u00ean c\u1ea1nh l\u1ef1a ch\u1ecdn ph\u01b0\u01a1ng ti\u1ec7n v\u1eadn chuy\u1ec3n (khi h\u1ed7 tr\u1ee3 nhi\u1ec1u h\u01a1n m\u1ed9t) khi li\u00ean l\u1ea1c v\u1edbi \u0111\u1ed3ng \u0111\u1eb3ng. \u0110\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin, xem <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>t\u00e0i li\u1ec7u tr\u1ef1c tuy\u1ebfn</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "\u0110\u00e3 h\u1ebft h\u1ea1n {0} tr\u01b0\u1edbc";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "T\u00ecnh tr\u1ea1ng c\u1ee7a b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n trong vi\u1ec7c ch\u1ea5p nh\u1eadn hay t\u1eeb ch\u1ed1i c\u00e1c y\u00eau c\u1ea7u t\u1eeb c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c \u0111\u1ec3 x\u00e2y d\u1ef1ng \u0111\u01b0\u1eddng h\u1ea7m tham gia qua b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n. B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n c\u00f3 th\u1ec3 ch\u1ea5p nh\u1eadn t\u1ea5t c\u1ea3 c\u00e1c y\u00eau c\u1ea7u, ch\u1ea5p nh\u1eadn ho\u1eb7c t\u1eeb ch\u1ed1i m\u1ed9t ph\u1ea7n tr\u0103m y\u00eau c\u1ea7u, ho\u1eb7c t\u1eeb ch\u1ed1i t\u1ea5t c\u1ea3 c\u00e1c y\u00eau c\u1ea7u v\u00ec m\u1ed9t s\u1ed1 l\u00fd do, \u0111\u1ec3 ki\u1ec3m so\u00e1t b\u0103ng th\u00f4ng v\u00e0 y\u00eau c\u1ea7u CPU, \u0111\u1ed3ng th\u1eddi duy tr\u00ec n\u0103ng l\u1ef1c cho c\u00e1c m\u00e1y kh\u00e1ch \u0111\u1ecba ph\u01b0\u01a1ng. <b>L\u01b0u \u00dd</b>";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Vui l\u00f2ng li\u00ean h\u1ec7 v\u1edbi m\u1ed9t ng\u01b0\u1eddi b\u1ea1n \u0111\u00e1ng tin c\u1eady \u0111\u00e3 bi\u1ebft c\u00f3 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P \u0111ang ch\u1ea1y v\u00e0 y\u00eau c\u1ea7u h\u1ecd tr\u1ee3 gi\u00fap c\u00e0i \u0111\u1eb7t l\u1ea1i b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P c\u1ee7a b\u1ea1n. Y\u00eau c\u1ea7u h\u1ecd g\u1eedi cho b\u1ea1n t\u1ec7p reseed \u0111\u01b0\u1ee3c xu\u1ea5t t\u1eeb b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P \u0111ang ch\u1ea1y c\u1ee7a h\u1ecd. \u0110i\u1ec1u quan tr\u1ecdng l\u00e0 t\u1ec7p \u0111\u01b0\u1ee3c trao \u0111\u1ed5i qua k\u00eanh b\u1ea3o m\u1eadt, v\u00ed d\u1ee5: \u0111\u01b0\u1ee3c m\u00e3 h\u00f3a \u0111\u1ec3 tr\u00e1nh gi\u1ea3 m\u1ea1o t\u1eeb b\u00ean ngo\u00e0i (K\u00fd hi\u1ec7u PGP, M\u00e3 h\u00f3a v\u00e0 X\u00e1c minh b\u1eb1ng kh\u00f3a chung \u0111\u00e1ng tin c\u1eady). B\u1ea3n th\u00e2n t\u1ec7p n\u00e0y ch\u01b0a \u0111\u01b0\u1ee3c k\u00fd, v\u00ec v\u1eady vui l\u00f2ng ch\u1ec9 ch\u1ea5p nh\u1eadn t\u1ec7p t\u1eeb nh\u1eefng ng\u01b0\u1eddi b\u1ea1n \u0111\u00e1ng tin c\u1eady \u0111\u00e3 bi\u1ebft. Kh\u00f4ng bao gi\u1edd nh\u1eadp t\u1ec7p reseed n\u1ebfu b\u1ea1n kh\u00f4ng th\u1ec3 x\u00e1c minh ngu\u1ed3n c\u1ee7a n\u00f3.";
    t[2916] = "Last Good Send";
    t[2917] = "G\u1eedi t\u1ed1t cu\u1ed1i c\u00f9ng";
    t[2918] = "Delete this value to disable";
    t[2919] = "X\u00f3a gi\u00e1 tr\u1ecb n\u00e0y \u0111\u1ec3 t\u1eaft";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "B\u1ea1n c\u00f3 th\u1ec3 s\u1eed d\u1ee5ng m\u1ed9t m\u00e1y ghi \u00e2m trong m\u1ed9t \u0111\u01b0\u1eddng h\u1ea7m ghi ra m\u1ed9t t\u1ec7p m\u00e0 \u0111\u01b0\u1eddng h\u1ea7m kh\u00e1c ho\u1eb7c nhi\u1ec1u \u0111\u01b0\u1eddng h\u1ea7m c\u00f3 th\u1ec3 s\u1eed d\u1ee5ng cho vi\u1ec7c \u0111i\u1ec1u ch\u1ec9nh t\u1ed1c \u0111\u1ed9. Nh\u1eefng t\u1ec7p n\u00e0y c\u0169ng c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c ch\u1ec9nh s\u1eeda b\u1eb1ng tay.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ch\u1ea1y phi\u00ean b\u1ea3n th\u01b0 vi\u1ec7n Java BigInteger kh\u00f4ng b\u1ea3n \u0111\u1ecba, \u0111\u01b0\u1ee3c m\u00f4 ph\u1ecfng b\u1edfi ph\u1ea7n m\u1ec1m";
    t[2928] = "Country";
    t[2929] = "Qu\u1ed1c gia";
    t[2934] = "Peer's clockskew relative to our clock";
    t[2935] = "\u0110\u1ed3ng h\u1ed3 c\u1ee7a m\u00e1y ngang h\u00e0ng l\u1ec7ch so v\u1edbi \u0111\u1ed3ng h\u1ed3 c\u1ee7a ch\u00fang ta";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "Ng\u01b0\u1ee1ng m\u00e0 n\u1ebfu b\u1ecb vi ph\u1ea1m s\u1ebd khi\u1ebfn \u0111\u00edch t\u1eeb xa vi ph\u1ea1m \u0111\u01b0\u1ee3c ghi l\u1ea1i trong m\u1ed9t t\u1ec7p \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "\u0110i\u1ec1u n\u00e0y th\u01b0\u1eddng l\u00e0 do xung \u0111\u1ed9t c\u1ed5ng 7654. Ki\u1ec3m tra nh\u1eadt k\u00fd \u0111\u1ec3 x\u00e1c minh.";
    t[2940] = "Disabling inbound TCP";
    t[2941] = "V\u00f4 hi\u1ec7u h\u00f3a TCP g\u1eedi \u0111\u1ebfn";
    t[2944] = "Keyring";
    t[2945] = "M\u00f3c kh\u00f3a";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "Gia \u0111\u00ecnh \u0111\u00e3 \u0111\u01b0\u1ee3c x\u00e1c minh (ch\u1ee9ng ch\u1ec9 k\u00fd \u0111\u00e3 \u0111\u01b0\u1ee3c c\u00e0i \u0111\u1eb7t v\u00e0 h\u1ee3p l\u1ec7)";
    t[2954] = "Router info not available";
    t[2955] = "Kh\u00f4ng c\u00f3 th\u00f4ng tin v\u1ec1 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "C\u00e1c \u1ee9ng d\u1ee5ng web Java \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea b\u00ean d\u01b0\u1edbi \u0111\u01b0\u1ee3c kh\u1edfi ch\u1ea1y b\u1edfi kh\u00e1ch h\u00e0ng webConsole v\u00e0 ch\u1ea1y trong c\u00f9ng m\u1ed9t JVM nh\u01b0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn. Th\u00f4ng th\u01b0\u1eddng ch\u00fang l\u00e0 c\u00e1c \u1ee9ng d\u1ee5ng web c\u00f3 th\u1ec3 truy c\u1eadp qua b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn. Ch\u00fang c\u00f3 th\u1ec3 l\u00e0 c\u00e1c \u1ee9ng d\u1ee5ng ho\u00e0n ch\u1ec9nh (v.d. i2psnark), m\u1eb7t tr\u01b0\u1edbc cho kh\u00e1ch h\u00e0ng ho\u1eb7c \u1ee9ng d\u1ee5ng kh\u00e1c ph\u1ea3i \u0111\u01b0\u1ee3c b\u1eadt ri\u00eang bi\u1ec7t (v.d. susidns, i2ptunnel), ho\u1eb7c kh\u00f4ng c\u00f3 giao di\u1ec7n web (v.d. danh b\u1ea1).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "C\u1ea2NH B\u00c1O - \u0110\u01b0\u1eddng h\u1ea7m 0-hop \u0111\u1ea7u v\u00e0o kh\u00f4ng \u0111\u01b0\u1ee3c khuy\u1ebfn ngh\u1ecb cho c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u1ea9n.";
    t[2972] = "HTTP Proxy";
    t[2973] = "Proxy HTTP";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "\u0110\u00e2y l\u00e0 t\u1ed5ng s\u1ed1 \u0111\u1ed3ng nghi\u1ec7p m\u00e0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n bi\u1ebft. Ch\u00fang \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea tr\u00ean trang <a href='/netdb'>C\u01a1 s\u1edf d\u1eef li\u1ec7u M\u1ea1ng</a>. S\u1ed1 l\u01b0\u1ee3ng n\u00e0y c\u00f3 th\u1ec3 t\u1eeb d\u01b0\u1edbi 100 \u0111\u1ebfn 1000 ho\u1eb7c nhi\u1ec1u h\u01a1n. S\u1ed1 l\u01b0\u1ee3ng n\u00e0y kh\u00f4ng ph\u1ea3i l\u00e0 k\u00edch th\u01b0\u1edbc t\u1ed5ng th\u1ec3 c\u1ee7a m\u1ea1ng; n\u00f3 c\u00f3 th\u1ec3 thay \u0111\u1ed5i r\u1ea5t nhi\u1ec1u t\u00f9y thu\u1ed9c v\u00e0o b\u0103ng th\u00f4ng t\u1ed5ng th\u1ec3, b\u0103ng th\u00f4ng chia s\u1ebb v\u00e0 l\u01b0u l\u01b0\u1ee3ng c\u1ee7a b\u1ea1n. I2P kh\u00f4ng y\u00eau c\u1ea7u m\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ph\u1ea3i bi\u1ebft m\u1ecdi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c trong m\u1ea1ng.";
