    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "B\u1ea1n c\u00f3 th\u1ec3 ghi \u0111\u00e8 <a href=http://127.0.0.1:7658/help/images/>giao di\u1ec7n m\u1eb7c \u0111\u1ecbnh</a> c\u1ee7a danh s\u00e1ch th\u01b0 m\u1ee5c b\u1eb1ng c\u00e1ch cung c\u1ea5p <a href=http://127.0.0.1:7658 \u0111\u00e3 ch\u1ec9nh s\u1eeda /.resources/jetty-dir.css>jetty-dir.css</a> \u0111\u1ec3 thi\u1ebft l\u1eadp giao di\u1ec7n chung. L\u01b0u \u00fd r\u1eb1ng t\u1ec7p n\u00e0y s\u1ebd kh\u00f4ng \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb trong danh s\u00e1ch th\u01b0 m\u1ee5c c\u1ee7a m\u00e1y ch\u1ee7 web. C\u00e1c t\u1eadp tin v\u00e0 th\u01b0 m\u1ee5c c\u00f3 ti\u1ec1n t\u1ed1 . v\u00e0 c\u00e1c t\u1ec7p c\u00f3 t\u00ean favicon.ico ho\u1eb7c c\u00e1c t\u1ec7p k\u1ebft th\u00fac b\u1eb1ng ~ ho\u1eb7c .bak ho\u1eb7c .old c\u0169ng s\u1ebd b\u1ecb \u1ea9n kh\u1ecfi ch\u1ebf \u0111\u1ed9 xem (m\u1eb7c d\u00f9 v\u1eabn c\u00f3 th\u1ec3 truy c\u1eadp \u0111\u01b0\u1ee3c). L\u01b0u \u00fd: \u0110\u1ec3 t\u1ea1o file \u1ea9n c\u00f3 \u0111u\u00f4i . ti\u1ec1n t\u1ed1 tr\u00ean Windows, th\u00eam \u0111u\u00f4i . v\u00e0o t\u1eadp tin ho\u1eb7c th\u01b0 m\u1ee5c, v\u00ed d\u1ee5: <code>.hidden.</code>; Sau \u0111\u00f3, Windows explorer s\u1ebd l\u01b0u t\u1ec7p v\u1edbi t\u00ean ch\u00ednh x\u00e1c, lo\u1ea1i b\u1ecf d\u1ea5u ch\u1ea5m trong qu\u00e1 tr\u00ecnh n\u00e0y.";
