    t[3202] = "The following filter definition applies some throttling by default, no throttling for destinations in the file <i class=example>friends.txt</i>, forbids any connections from destinations in the file <i class=example>enemies.txt</i>, and logs any aggressive behavior in a file called <i class=example>suspicious.txt</i>:";
    t[3203] = "\u0110\u1ecbnh ngh\u0129a b\u1ed9 l\u1ecdc sau \u00e1p d\u1ee5ng m\u1ed9t s\u1ed1 \u0111i\u1ec1u ch\u1ec9nh t\u1ed1c \u0111\u1ed9 m\u1eb7c \u0111\u1ecbnh, kh\u00f4ng \u0111i\u1ec1u ch\u1ec9nh t\u1ed1c \u0111\u1ed9 \u0111\u1ed1i v\u1edbi \u0111i\u1ec3m \u0111\u1ebfn trong t\u1ec7p <i class=example>friends.txt</i>, c\u1ea5m b\u1ea5t k\u1ef3 k\u1ebft n\u1ed1i n\u00e0o t\u1eeb \u0111i\u1ec3m \u0111\u1ebfn trong t\u1ec7p <i class=example>enemies.txt</i>, v\u00e0 ghi l\u1ea1i b\u1ea5t k\u1ef3 h\u00e0nh vi x\u00e2m nh\u1eadp trong m\u1ed9t t\u1ec7p g\u1ecdi l\u00e0 <i class=example>suspicious.txt</i>:";
