    t[3241] = "B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u1ea7u ti\u00ean trong m\u1ed9t \u0111\u01b0\u1eddng h\u1ea7m. \u0110\u1ed1i v\u1edbi \u0111\u01b0\u1eddng h\u1ea7m thu, \u0111\u00e2y l\u00e0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u01b0\u1ee3c \u0111\u1ec1 c\u1eadp trong <i>LeaseSet</i> \u0111\u01b0\u1ee3c xu\u1ea5t b\u1ea3n trong <i>C\u01a1 s\u1edf d\u1eef li\u1ec7u M\u1ea1ng</i>. \u0110\u1ed1i v\u1edbi \u0111\u01b0\u1eddng h\u1ea7m xu\u1ea5t, c\u1ed5ng l\u00e0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u1edfi x\u01b0\u1edbng.";
