    t[3302] = "This is an experimental network database tool for debugging and analysis. Do not panic even if you see warnings indicated. Possible \"threats\" are summarized, however these are unlikely to be real threats. If you see anything you would like to discuss with the devs, contact us on IRC #i2p-dev.";
    t[3303] = "\u0110\u00e2y l\u00e0 m\u1ed9t c\u00f4ng c\u1ee5 c\u01a1 s\u1edf d\u1eef li\u1ec7u m\u1ea1ng th\u1eed nghi\u1ec7m \u0111\u1ec3 g\u1ee1 l\u1ed7i v\u00e0 ph\u00e2n t\u00edch. \u0110\u1eebng ho\u1ea3ng s\u1ee3 ngay c\u1ea3 khi b\u1ea1n th\u1ea5y c\u1ea3nh b\u00e1o \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh. Nh\u1eefng \"m\u1ed1i \u0111e d\u1ecda\" c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c t\u00f3m t\u1eaft, tuy nhi\u00ean \u0111\u00e2y kh\u00f4ng ch\u1eafc l\u00e0 nh\u1eefng m\u1ed1i \u0111e d\u1ecda th\u1ef1c s\u1ef1. N\u1ebfu b\u1ea1n th\u1ea5y b\u1ea5t k\u1ef3 \u0111i\u1ec1u g\u00ec b\u1ea1n mu\u1ed1n th\u1ea3o lu\u1eadn v\u1edbi nh\u00e0 ph\u00e1t tri\u1ec3n, h\u00e3y li\u00ean h\u1ec7 v\u1edbi ch\u00fang t\u00f4i tr\u00ean IRC #i2p-dev.";
