    t[3483] = "C\u00e0i \u0111\u1eb7t n\u00e0y x\u00e1c \u0111\u1ecbnh xem c\u00e1c s\u1ed1 li\u1ec7u th\u1ed1ng k\u00ea v\u1ec1 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a ch\u00fang t\u00f4i c\u00f3 \u0111\u01b0\u1ee3c c\u00f4ng b\u1ed1 l\u1ebb t\u1ebb l\u00ean NETDB hay kh\u00f4ng. [M\u1eb7c \u0111\u1ecbnh l\u00e0 sai]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "\u0110\u00e2y l\u00e0 s\u1ed1 l\u01b0\u1ee3ng \u0111\u1ed3ng nghi\u1ec7p m\u00e0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n c\u00f3 s\u1eb5n \u0111\u1ec3 x\u00e2y d\u1ef1ng \u0111\u01b0\u1eddng h\u1ea7m kh\u00e1ch h\u00e0ng. Th\u00f4ng th\u01b0\u1eddng n\u1eb1m trong kho\u1ea3ng 8-30. C\u00e1c \u0111\u1ed3ng nghi\u1ec7p nhanh c\u1ee7a b\u1ea1n \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb t\u1ea1i trang <a href='/profiles'>Trang H\u1ed3 s\u01a1</a>. <a href='/configstats#router.fastPeers'>[K\u00edch ho\u1ea1t bi\u1ec3u \u0111\u1ed3]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Nh\u1ea5n n\u00fat <i>Gieo h\u1ea1t t\u1eeb T\u1ec7p</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "M\u1ed9t bi\u1ebfn th\u1ec3 c\u1ee7a \u0111\u1ecbnh tuy\u1ebfn l\u1edbp h\u00e0nh m\u1ea7m m\u00e3 h\u00f3a nhi\u1ec1u tin nh\u1eafn c\u00f9ng nhau \u0111\u1ec3 l\u00e0m cho kh\u00f3 kh\u0103n h\u01a1n cho k\u1ebb t\u1ea5n c\u00f4ng th\u1ef1c hi\u1ec7n ph\u00e2n t\u00edch l\u01b0u l\u01b0\u1ee3ng v\u00e0 t\u0103ng t\u1ed1c \u0111\u1ed9 chuy\u1ec3n d\u1eef li\u1ec7u. \u0110\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin, xem <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>t\u00e0i li\u1ec7u tr\u1ef1c tuy\u1ebfn</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "C\u00e1ch c\u1ee7ng c\u1ed1 trang web WordPress c\u1ee7a b\u1ea1n";
    t[3496] = "I2P Internals";
    t[3497] = "N\u1ed9i b\u1ed9 I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Theo m\u1eb7c \u0111\u1ecbnh, I2P \u0111\u01b0\u1ee3c cung c\u1ea5p m\u1ed9t m\u00e1y ch\u1ee7 web \u0111\u1ec3 l\u01b0u tr\u1eef trang web \u1ea9n danh c\u1ee7a ri\u00eang b\u1ea1n (theo truy\u1ec1n th\u1ed1ng \u0111\u01b0\u1ee3c g\u1ecdi l\u00e0 <i>eepsite</i>). C\u1ea3 trang web v\u00e0 B\u1ea3ng \u0111i\u1ec1u khi\u1ec3n B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P \u0111\u1ec1u \u0111ang ch\u1ea1y tr\u00ean phi\u00ean b\u1ea3n h\u1ee3p l\u00fd c\u1ee7a <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'> C\u1ea7u t\u00e0u</a>, \u0111\u01b0\u1ee3c t\u00f9y ch\u1ec9nh cho I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "C\u00e0i \u0111\u1eb7t n\u00e0y cho ph\u00e9p b\u1ea1n lo\u1ea1i tr\u1eeb c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u0169 h\u01a1n kh\u1ecfi NETDB c\u1ee7a b\u1ea1n. B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u0169 h\u01a1n m\u1eb7c \u0111\u1ecbnh ho\u1eb7c gi\u00e1 tr\u1ecb b\u1ea1n \u0111\u1eb7t s\u1ebd b\u1ecb x\u00f3a kh\u1ecfi NETDB v\u00e0 b\u1ecb c\u1ea5m trong su\u1ed1t th\u1eddi gian c\u1ee7a phi\u00ean \u0111\u1ecbnh tuy\u1ebfn. Theo m\u1eb7c \u0111\u1ecbnh, c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u0169 h\u01a1n 0.9.20 \u0111\u01b0\u1ee3c lo\u1ea1i tr\u1eeb. L\u01b0u \u00fd: B\u1eaft \u0111\u1ea7u v\u1edbi i2p+ phi\u00ean b\u1ea3n 0.9.46+, ch\u1ec9 c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ch\u1ea1y c\u00e1c phi\u00ean b\u1ea3n r\u1ea5t g\u1ea7n \u0111\u00e2y \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng \u0111\u1ec3 x\u00e2y d\u1ef1ng c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m c\u1ee5c b\u1ed9. [Kh\u1edfi \u0111\u1ed9ng l\u1ea1i y\u00eau c\u1ea7u]";
