    t[3618] = "ERR - Clock Skew";
    t[3619] = "ERR - \u0110\u1ed3ng h\u1ed3 l\u1ec7ch";
    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "C\u00e0i \u0111\u1eb7t n\u00e0y x\u00e1c \u0111\u1ecbnh li\u1ec7u b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u00f3 n\u00ean s\u1eed d\u1ee5ng t\u1ec7p <i>blocklist.txt</i> \u0111\u01b0\u1ee3c cung c\u1ea5p v\u00e0 b\u1ea5t k\u1ef3 danh s\u00e1ch ch\u1eb7n \u0111\u01b0\u1ee3c c\u1ea5u h\u00ecnh b\u1edfi ng\u01b0\u1eddi d\u00f9ng hay kh\u00f4ng \u0111\u1ec3 cho ph\u00e9p c\u1ea5m c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn b\u1eb1ng h\u00e0m \u0111\u1ecbnh danh ho\u1eb7c \u0111\u1ecba ch\u1ec9 IP. Ph\u1ea1m vi v\u00e0 m\u1eb7t n\u1ea1 m\u1ea1ng \u0111\u01b0\u1ee3c h\u1ed7 tr\u1ee3 cho IPv4 nh\u01b0ng kh\u00f4ng ph\u1ea3i IPv6. Xem t\u1ec7p <i>blocklist.txt</i> trong th\u01b0 m\u1ee5c \u1ee9ng d\u1ee5ng I2P+ c\u1ee7a b\u1ea1n \u0111\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin. [\u0110\u01b0\u1ee3c b\u1eadt theo m\u1eb7c \u0111\u1ecbnh, b\u1eaft bu\u1ed9c kh\u1edfi \u0111\u1ed9ng l\u1ea1i]";
    t[3626] = "Licensing and copyright notices";
