    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "G\u00f3i UDP \u0111i tr\u00ean c\u1ed5ng 123, cho ph\u00e9p tr\u1ea3 l\u1eddi: \u0111i\u1ec1u n\u00e0y c\u1ea7n thi\u1ebft cho \u0111\u1ed3ng b\u1ed9 th\u1eddi gian n\u1ed9i b\u1ed9 c\u1ee7a I2P (th\u00f4ng qua SNTP - truy v\u1ea5n ng\u1eabu nhi\u00ean m\u1ed9t m\u00e1y ch\u1ee7 SNTP trong <code>pool.ntp.org</code> ho\u1eb7c <a href=/help/advancedsettings#ntpserverconfig>m\u1ed9t m\u00e1y ch\u1ee7 kh\u00e1c b\u1ea1n ch\u1ec9 \u0111\u1ecbnh</a>).";
