    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "Ng\u01b0\u1eddi d\u00f9ng kh\u00e1ch h\u1ed9 IRC ki\u1ec3u XChat c\u00f3 th\u1ec3 t\u1ea1o m\u1ea1ng m\u1edbi v\u1edbi m\u00e1y ch\u1ee7 <code>127.0.0.1/6668</code> (nh\u1edb \u0111\u00e1nh d\u1ea5u v\u00e0o \u00f4 <i>B\u1ecf qua m\u00e1y ch\u1ee7 proxy</i> n\u1ebfu b\u1ea1n \u0111\u00e3 c\u1ea5u h\u00ecnh m\u00e1y ch\u1ee7 proxy), ho\u1eb7c b\u1ea1n c\u00f3 th\u1ec3 k\u1ebft n\u1ed1i v\u1edbi l\u1ec7nh <code>/server 127.0.0.1 6668</code>. C\u00e1c kh\u00e1ch h\u1ed9 IRC kh\u00e1c nhau c\u00f3 th\u1ec3 bi\u1ebfn \u0111\u1ed5i c\u00fa ph\u00e1p.";
