    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "C\u00e1c t\u00f9y ch\u1ecdn c\u1ea5u h\u00ecnh b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea d\u01b0\u1edbi \u0111\u00e2y kh\u00f4ng c\u00f3 trong giao di\u1ec7n ng\u01b0\u1eddi d\u00f9ng, th\u01b0\u1eddng l\u00e0 v\u00ec ch\u00fang \u00edt khi \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng ho\u1eb7c cung c\u1ea5p quy\u1ec1n truy c\u1eadp v\u00e0o c\u00e1c thi\u1ebft l\u1eadp n\u00e2ng cao m\u00e0 h\u1ea7u h\u1ebft ng\u01b0\u1eddi d\u00f9ng s\u1ebd kh\u00f4ng c\u1ea7n. Danh s\u00e1ch n\u00e0y kh\u00f4ng to\u00e0n di\u1ec7n. M\u1ed9t s\u1ed1 thi\u1ebft l\u1eadp s\u1ebd y\u00eau c\u1ea7u kh\u1edfi \u0111\u1ed9ng l\u1ea1i b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u1ec3 c\u00f3 hi\u1ec7u l\u1ef1c. L\u01b0u \u00fd r\u1eb1ng t\u1ea5t c\u1ea3 c\u00e1c thi\u1ebft l\u1eadp \u0111\u1ec1u ph\u00e2n bi\u1ec7t hoa th\u01b0\u1eddng. B\u1ea1n s\u1ebd c\u1ea7n ch\u1ec9nh s\u1eeda t\u1ec7p <code>router.config</code> c\u1ee7a m\u00ecnh \u0111\u1ec3 th\u00eam t\u00f9y ch\u1ecdn, ho\u1eb7c, khi b\u1ea1n \u0111\u00e3 th\u00eam <code>routerconsole.advanced=true</code> v\u00e0o t\u1ec7p router.config, b\u1ea1n c\u00f3 th\u1ec3 ch\u1ec9nh s\u1eeda c\u00e1c thi\u1ebft l\u1eadp b\u00ean trong b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n tr\u00ean trang <a href=/configadvanced>C\u1ea5u h\u00ecnh n\u00e2ng cao</a>.";
