    t[3754] = "When set to true, your router will not be classified as slow, regardless of the specifications of your host system. Ordinarily, routers running on hosts with the following characteristics will be classified as slow, and various performance-related router options will be modified accordingly:";
    t[3755] = "Khi \u0111\u01b0\u1ee3c \u0111\u1eb7t th\u00e0nh True, b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n s\u1ebd kh\u00f4ng \u0111\u01b0\u1ee3c ph\u00e2n lo\u1ea1i l\u00e0 ch\u1eadm, b\u1ea5t k\u1ec3 th\u00f4ng s\u1ed1 k\u1ef9 thu\u1eadt c\u1ee7a h\u1ec7 th\u1ed1ng m\u00e1y ch\u1ee7 c\u1ee7a b\u1ea1n. Th\u00f4ng th\u01b0\u1eddng, c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ch\u1ea1y tr\u00ean m\u00e1y ch\u1ee7 v\u1edbi c\u00e1c \u0111\u1eb7c \u0111i\u1ec3m sau s\u1ebd \u0111\u01b0\u1ee3c ph\u00e2n lo\u1ea1i l\u00e0 ch\u1eadm v\u00e0 c\u00e1c t\u00f9y ch\u1ecdn b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn li\u00ean quan \u0111\u1ebfn hi\u1ec7u su\u1ea5t kh\u00e1c nhau s\u1ebd \u0111\u01b0\u1ee3c s\u1eeda \u0111\u1ed5i t\u01b0\u01a1ng \u1ee9ng:";
