    t[3778] = "Disabled system tray";
    t[3779] = "Khay h\u1ec7 th\u1ed1ng b\u1ecb v\u00f4 hi\u1ec7u h\u00f3a";
    t[3780] = "To preserve anonymity, make sure that the webserver is not publicly available outside of the I2P network, which is normally achieved by configuring the webserver to listen on localhost (127.0.0.1) rather than all interfaces (0.0.0.0).";
    t[3781] = "\u0110\u1ec3 duy tr\u00ec t\u00ednh \u1ea9n danh, h\u00e3y \u0111\u1ea3m b\u1ea3o r\u1eb1ng m\u00e1y ch\u1ee7 web kh\u00f4ng kh\u1ea3 d\u1ee5ng c\u00f4ng khai b\u00ean ngo\u00e0i m\u1ea1ng I2P, \u0111i\u1ec1u n\u00e0y th\u01b0\u1eddng \u0111\u1ea1t \u0111\u01b0\u1ee3c b\u1eb1ng c\u00e1ch \u0111\u1ecbnh c\u1ea5u h\u00ecnh m\u00e1y ch\u1ee7 web \u0111\u1ec3 nghe tr\u00ean localhost (127.0.0.1) thay v\u00ec t\u1ea5t c\u1ea3 c\u00e1c giao di\u1ec7n (0.0.0.0).";
