    t[3830] = "Used by client apps. Can be changed to a different port on the <a href=/configclients>Client Configuration page</a> but this is not recommended. Can be bound to a different interface or all interfaces, or disabled, on the <a href=/configclients>Client Configuration page</a>.";
    t[3831] = "\u0110\u01b0\u1ee3c s\u1eed d\u1ee5ng b\u1edfi c\u00e1c \u1ee9ng d\u1ee5ng kh\u00e1ch. C\u00f3 th\u1ec3 thay \u0111\u1ed5i sang c\u1ed5ng kh\u00e1c tr\u00ean trang <a href=/configclients>C\u1ea5u h\u00ecnh Kh\u00e1ch h\u00e0ng</a> nh\u01b0ng kh\u00f4ng khuy\u1ebfn kh\u00edch. C\u00f3 th\u1ec3 li\u00ean k\u1ebft v\u1edbi giao di\u1ec7n kh\u00e1c ho\u1eb7c t\u1ea5t c\u1ea3 c\u00e1c giao di\u1ec7n, ho\u1eb7c v\u00f4 hi\u1ec7u h\u00f3a, tr\u00ean trang <a href=/configclients>C\u1ea5u h\u00ecnh Kh\u00e1ch h\u00e0ng</a>.";
    t[3832] = "Log record format";
