    t[3839] = "\u0110\u1ec3 tham kh\u1ea3o h\u01b0\u1edbng d\u1eabn c\u1ea5u h\u00ecnh chi ti\u1ebft h\u01a1n cho c\u00e1c tr\u00ecnh duy\u1ec7t kh\u00e1c nhau, xem <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>h\u01b0\u1edbng d\u1eabn c\u1ea5u h\u00ecnh tr\u00ecnh duy\u1ec7t</a>.";
    t[3842] = "Periodically test tunnels to determine the average lag, and display the results in the Congestion sidepanel section. To enable, set this value to false. [Default is false]";
    t[3843] = "\u0110\u1ecbnh k\u1ef3 ki\u1ec3m tra c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m \u0111\u1ec3 x\u00e1c \u0111\u1ecbnh \u0111\u1ed9 tr\u1ec5 trung b\u00ecnh, v\u00e0 hi\u1ec3n th\u1ecb k\u1ebft qu\u1ea3 trong m\u1ee5c ph\u1ea7n ph\u1ee5 Congestion. \u0110\u1ec3 k\u00edch ho\u1ea1t, h\u00e3y \u0111\u1eb7t gi\u00e1 tr\u1ecb n\u00e0y th\u00e0nh sai. [M\u1eb7c \u0111\u1ecbnh l\u00e0 sai]";
