    t[3954] = "NTCP [IPv6] &amp; SSU";
    t[3955] = "NTCP [IPv6] &amp; SSU";
    t[3958] = "I2P requires your computer's time be accurate.";
    t[3959] = "I2P y\u00eau c\u1ea7u th\u1eddi gian tr\u00ean m\u00e1y t\u00ednh c\u1ee7a b\u1ea1n ph\u1ea3i ch\u00ednh x\u00e1c.";
    t[3960] = "Just finished jobs";
    t[3961] = "V\u1eeba ho\u00e0n th\u00e0nh c\u00f4ng vi\u1ec7c";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "M\u1ed9t s\u1ed1 kh\u00e1ch h\u1ed9 IRC \u0111\u01b0\u1ee3c c\u1ea5u h\u00ecnh \u0111\u1ec3 ng\u1eaft k\u1ebft n\u1ed1i kh\u1ecfi m\u00e1y ch\u1ee7 n\u1ebfu kh\u00f4ng c\u00f3 giao ti\u1ebfp v\u1edbi m\u00e1y ch\u1ee7 trong m\u1ed9t th\u1eddi gian, \u0111i\u1ec1u n\u00e0y \u0111\u00f4i khi g\u00e2y tr\u1edf ng\u1ea1i cho IRC I2P n\u1ebfu gi\u00e1 tr\u1ecb <i>ping timeout</i> \u0111\u01b0\u1ee3c \u0111\u1eb7t qu\u00e1 th\u1ea5p. \u0110\u1eb7t gi\u00e1 tr\u1ecb ping timeout trong kh\u00e1ch h\u1ed9 c\u1ee7a b\u1ea1n l\u00ean m\u1ee9c cao (v\u00ed d\u1ee5 320 gi\u00e2y) th\u01b0\u1eddng s\u1ebd \u0111em l\u1ea1i k\u1ebft n\u1ed1i \u1ed5n \u0111\u1ecbnh h\u01a1n \u0111\u1ebfn m\u1ea1ng. Trong hexchat b\u1ea1n c\u00f3 th\u1ec3 c\u1ea5u h\u00ecnh gi\u00e1 tr\u1ecb b\u1eb1ng c\u00e1ch nh\u1eadp <code>/set net_ping_timeout 320</code>. \u0110i\u1ec1u n\u00e0y s\u1ebd ghi gi\u00e1 tr\u1ecb v\u00e0o t\u1eadp tin <code>hexchat.conf</code> c\u1ee7a b\u1ea1n.";
    t[3964] = "Run at Startup?";
    t[3965] = "Ch\u1ea1y khi kh\u1edfi \u0111\u1ed9ng?";
    t[3972] = "Never";
    t[3973] = "Kh\u00f4ng bao gi\u1edd";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "M\u1ed9t c\u1ea5u h\u00ecnh <a href=/confignet#ipchange>t\u00f9y ch\u1ecdn</a> t\u1ef1 \u0111\u1ed9ng thay \u0111\u1ed5i <a href=/netdb?r=.>danh t\u00ednh b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn</a> v\u00e0 <a href=/confignet#udpconfig>c\u1ed5ng b\u00ean ngo\u00e0i</a> khi \u0111\u1ecba ch\u1ec9 IP c\u00f4ng khai m\u00e0 h\u1ec7 th\u1ed1ng c\u1ee7a b\u1ea1n s\u1eed d\u1ee5ng thay \u0111\u1ed5i. \u0110i\u1ec1u n\u00e0y c\u00f3 th\u1ec3 ng\u0103n ch\u1eb7n \u0111\u1ed1i th\u1ee7 t\u01b0\u01a1ng quan danh t\u00ednh b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn v\u00e0 \u0111\u1ecba ch\u1ec9 IP trong tr\u01b0\u1eddng h\u1ee3p \u0111\u1ecba ch\u1ec9 IP c\u1ee7a b\u1ea1n thay \u0111\u1ed5i th\u01b0\u1eddng xuy\u00ean, v\u00ed d\u1ee5 khi ch\u1ea1y I2P tr\u00ean m\u00e1y t\u00ednh x\u00e1ch tay t\u1eeb nhi\u1ec1u v\u1ecb tr\u00ed.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00f4ng \u0111\u01b0\u1ee3c c\u1ea5u h\u00ecnh \u0111\u1ec3 xu\u1ea5t b\u1ea3n \u0111\u1ecba ch\u1ec9 c\u1ee7a n\u00f3, do \u0111\u00f3 n\u00f3 kh\u00f4ng mong \u0111\u1ee3i c\u00e1c k\u1ebft n\u1ed1i \u0111\u1ebfn.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "M\u1ed9t \u1ee9ng d\u1ee5ng d\u00f2ng l\u1ec7nh \u0111\u01b0\u1ee3c cung c\u1ea5p c\u00f9ng v\u1edbi I2P+ (Linux/MacOS) \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng \u0111\u1ec3 th\u1ef1c hi\u1ec7n y\u00eau c\u1ea7u <code>head</code> tr\u00ean m\u1ed9t t\u00e0i nguy\u00ean http \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh tr\u00ean m\u1ea1ng, tr\u1ea3 v\u1ec1 nhi\u1ec1u ti\u00eau \u0111\u1ec1 ph\u1ea3n h\u1ed3i kh\u00e1c nhau t\u1eeb m\u00e1y ch\u1ee7 t\u1eeb xa. Theo m\u1eb7c \u0111\u1ecbnh, eephead s\u1eed d\u1ee5ng proxy HTTP tr\u00ean <code>127.0.0.1:4444</code>.";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
    t[4011] = "IPv6 NTCP, SSU, ng\u01b0\u1eddi gi\u1edbi thi\u1ec7u";
    t[4016] = "Console language saved.";
    t[4017] = "\u0110\u00e3 l\u01b0u ng\u00f4n ng\u1eef b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n.";
    t[4022] = "Rebuilding";
    t[4023] = "X\u00e2y d\u1ef1ng l\u1ea1i";
    t[4024] = "Known";
    t[4025] = "\u0110\u01b0\u1ee3c bi\u1ebft";
    t[4026] = "This setting permits a custom text prefix to be set for the page title on router console pages, potentially useful when you have multiple consoles open on browser tabs and want an easy method to differentiate between them.";
    t[4027] = "C\u00e0i \u0111\u1eb7t n\u00e0y cho ph\u00e9p \u0111\u1eb7t m\u1ed9t ti\u1ec1n t\u1ed1 v\u0103n b\u1ea3n t\u00f9y ch\u1ec9nh cho ti\u00eau \u0111\u1ec1 trang tr\u00ean c\u00e1c trang console m\u00e1y ch\u1ee7, c\u00f3 th\u1ec3 h\u1eefu \u00edch khi b\u1ea1n m\u1edf nhi\u1ec1u console tr\u00ean c\u00e1c tab tr\u00ecnh duy\u1ec7t v\u00e0 mu\u1ed1n c\u00f3 ph\u01b0\u01a1ng ph\u00e1p d\u1ec5 d\u00e0ng \u0111\u1ec3 ph\u00e2n bi\u1ec7t gi\u1eefa ch\u00fang.";
    t[4034] = "Please enter a search query";
    t[4035] = "Vui l\u00f2ng nh\u1eadp truy v\u1ea5n t\u00ecm ki\u1ebfm";
    t[4040] = "How do I connect to IRC within I2P?";
    t[4041] = "T\u00f4i c\u00f3 th\u1ec3 k\u1ebft n\u1ed1i \u0111\u1ebfn IRC trong I2P nh\u01b0 th\u1ebf n\u00e0o?";
    t[4042] = "Bandwidth Test in progress";
