    t[4050] = "Launch console at startup";
    t[4051] = "Kh\u1edfi ch\u1ea1y b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n khi kh\u1edfi \u0111\u1ed9ng";
    t[4052] = "Job Statistics (excluding single-shot jobs)";
