    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "\u0110\u1ec3 truy c\u1eadp c\u00e1c trang web \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef tr\u00ean m\u1ea1ng I2P v\u00e0 t\u00f9y \u00fd s\u1eed d\u1ee5ng proxy ngo\u00e0i m\u1eb7c \u0111\u1ecbnh \u0111\u1ec3 k\u1ebft n\u1ed1i v\u1edbi c\u00e1c trang web tr\u00ean Clearnet, b\u1ea1n s\u1ebd c\u1ea7n \u0111\u1ecbnh c\u1ea5u h\u00ecnh tr\u00ecnh duy\u1ec7t c\u1ee7a m\u00ecnh \u0111\u1ec3 s\u1eed d\u1ee5ng proxy I2P+ <b>HTTP</b>, theo m\u1eb7c \u0111\u1ecbnh ch\u1ea1y tr\u00ean < m\u00e3>127.0.0.1 c\u1ed5ng 4444</code>. \u0110\u1ec3 \u0111\u01b0\u1ee3c tr\u1ee3 gi\u00fap th\u00eam, h\u00e3y xem <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>h\u01b0\u1edbng d\u1eabn c\u1ea5u h\u00ecnh</a> ho\u1eb7c <a href=/help/configuration#browserconfig>h\u01b0\u1edbng d\u1eabn nh\u1ecf d\u00e0nh cho Firefox</a>.";
