    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>L\u01b0u \u00fd:</b> Tr\u00ean m\u1ed9t s\u1ed1 b\u1ea3n c\u00e0i \u0111\u1eb7t Apache, <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> v\u00e0 m\u00f4-\u0111un <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> \u0111\u01b0\u1ee3c b\u1eadt theo m\u1eb7c \u0111\u1ecbnh. \u0110i\u1ec1u quan tr\u1ecdng l\u00e0 ph\u1ea3i v\u00f4 hi\u1ec7u h\u00f3a nh\u1eefng t\u00ednh n\u0103ng n\u00e0y ho\u1eb7c b\u1ea3o v\u1ec7 quy\u1ec1n truy c\u1eadp v\u00e0o c\u00e1c url \u0111\u1ec3 tr\u00e1nh \u1ea3nh h\u01b0\u1edfng \u0111\u1ebfn t\u00ednh \u1ea9n danh v\u00e0 b\u1ea3o m\u1eadt c\u1ee7a m\u00e1y ch\u1ee7 c\u1ee7a b\u1ea1n.";
