    t[4644] = "The reseed status will be indicated on the sidebar. You can also check the {0} for the following message: <code>Reseed got 100 router infos from file with 0 errors</code>";
    t[4645] = "Tr\u1ea1ng th\u00e1i gieo l\u1ea1i s\u1ebd \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh tr\u00ean thanh b\u00ean. B\u1ea1n c\u0169ng c\u00f3 th\u1ec3 ki\u1ec3m tra {0} \u0111\u1ec3 bi\u1ebft th\u00f4ng b\u00e1o sau: <code>Reseed nh\u1eadn \u0111\u01b0\u1ee3c 100 th\u00f4ng tin b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn t\u1eeb t\u1ec7p v\u1edbi 0 l\u1ed7i</code>";
