    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "Phi\u00ean b\u1ea3n c\u1ee7a ph\u1ea7n m\u1ec1m i2p b\u1ea1n \u0111ang ch\u1ea1y. N\u1ebfu m\u1ed9t phi\u00ean b\u1ea3n m\u1edbi c\u00f3 s\u1eb5n, b\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c th\u00f4ng b\u00e1o trong thanh b\u00ean. B\u1ea1n n\u00ean c\u1eadp nh\u1eadt b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n \u0111\u1ec3 \u0111\u1ea3m b\u1ea3o hi\u1ec7u su\u1ea5t v\u00e0 b\u1ea3o m\u1eadt t\u1ed1i \u01b0u. C\u1eadp nh\u1eadt b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn th\u01b0\u1eddng \u0111\u01b0\u1ee3c cung c\u1ea5p trung b\u00ecnh c\u1ee9 sau 2-3 th\u00e1ng.";
