    t[4696] = "Prefer IPv4 over IPv6";
    t[4697] = "Th\u00edch IPv4 h\u01a1n IPv6";
    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (d\u1ef1a tr\u00ean TCP NIO) v\u00e0 NTCP2 l\u00e0 giao th\u1ee9c m\u1ea1ng c\u00f3 c\u01a1 s\u1edf TCP s\u1eed d\u1ee5ng tri\u1ec3n khai TCP NIO (NIO m\u1edbi) c\u1ee7a Java \u0111\u1ec3 chuy\u1ec3n tin nh\u1eafn I2NP gi\u1eefa c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn tr\u00ean m\u1ea1ng. NTCP2 c\u1ea3i thi\u1ec7n kh\u1ea3 n\u0103ng ch\u1ed1ng l\u1ea1i c\u00e1c cu\u1ed9c t\u1ea5n c\u00f4ng v\u00e0 ph\u01b0\u01a1ng ph\u00e1p x\u00e1c \u0111\u1ecbnh l\u01b0u l\u01b0\u1ee3ng t\u1ef1 \u0111\u1ed9ng c\u1ee7a NTCP. \u0110\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin, h\u00e3y xem <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>t\u00e0i li\u1ec7u tr\u1ef1c tuy\u1ebfn</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "B\u1ea1n c\u00f3 th\u1ec3 s\u1eed d\u1ee5ng m\u1ed9t m\u00e1y ghi \u00e2m \u0111\u1ec3 ghi l\u1ea1i c\u00e1c \u0111i\u1ec3m \u0111\u1ebfn c\u1ee7a c\u00e1c m\u00e1y kh\u00e1ch t\u00edch c\u1ef1c v\u00e0o m\u1ed9t t\u1ec7p \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh, sau \u0111\u00f3 s\u1eed d\u1ee5ng c\u00f9ng m\u1ed9t t\u1ec7p \u0111\u1ec3 \u0111i\u1ec1u ti\u1ebft ch\u00fang. Snippet sau \u0111\u00e2y x\u00e1c \u0111\u1ecbnh m\u1ed9t b\u1ed9 l\u1ecdc ban \u0111\u1ea7u cho ph\u00e9p t\u1ea5t c\u1ea3 c\u00e1c y\u00eau c\u1ea7u k\u1ebft n\u1ed1i, nh\u01b0ng n\u1ebfu b\u1ea5t k\u1ef3 \u0111i\u1ec3m \u0111\u1ebfn n\u00e0o v\u01b0\u1ee3t qu\u00e1 180 y\u00eau c\u1ea7u trong 60 gi\u00e2y, n\u00f3 s\u1ebd \u0111\u01b0\u1ee3c \u0111i\u1ec1u ch\u1ec9nh xu\u1ed1ng c\u00f2n 30 y\u00eau c\u1ea7u c\u1ee9 sau 60 gi\u00e2y:";
