    t[4822] = "Be aware that a poorly configured webserver or web appplication can leak information such as your real IP address or server details that may reduce your anonymity or assist a hacker. If using an alternative platform, be sure to secure it before putting it online. If in doubt, consult online guides about web server and web application hardening, for example:";
    t[4823] = "Xin l\u01b0u \u00fd r\u1eb1ng m\u00e1y ch\u1ee7 web ho\u1eb7c \u1ee9ng d\u1ee5ng web \u0111\u01b0\u1ee3c c\u1ea5u h\u00ecnh k\u00e9m c\u00f3 th\u1ec3 r\u00f2 r\u1ec9 th\u00f4ng tin nh\u01b0 \u0111\u1ecba ch\u1ec9 IP th\u1ef1c ho\u1eb7c chi ti\u1ebft m\u00e1y ch\u1ee7 c\u1ee7a b\u1ea1n, \u0111i\u1ec1u n\u00e0y c\u00f3 th\u1ec3 l\u00e0m gi\u1ea3m t\u00ednh \u1ea9n danh c\u1ee7a b\u1ea1n ho\u1eb7c h\u1ed7 tr\u1ee3 tin t\u1eb7c. N\u1ebfu s\u1eed d\u1ee5ng m\u1ed9t n\u1ec1n t\u1ea3ng thay th\u1ebf, h\u00e3y \u0111\u1ea3m b\u1ea3o b\u1ea3o m\u1eadt n\u00f3 tr\u01b0\u1edbc khi \u0111\u01b0a n\u00f3 l\u00ean m\u1ea1ng. N\u1ebfu nghi ng\u1edd, h\u00e3y tham kh\u1ea3o h\u01b0\u1edbng d\u1eabn tr\u1ef1c tuy\u1ebfn v\u1ec1 t\u0103ng c\u01b0\u1eddng m\u00e1y ch\u1ee7 web v\u00e0 \u1ee9ng d\u1ee5ng web, v\u00ed d\u1ee5:";
