    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ h\u1ed7 tr\u1ee3 ghi \u0111 giao di\u1ec7n t\u00f9y ch\u1ec9nh cho b\u1ea3n \u0111i\u1ec1u khi\u1ec3n, ng\u01b0\u1eddi qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m, I2PSnark, SusiDNS v\u00e0 Susimail, cho ph\u00e9p thay \u0111\u1ed5i c\u00e1c giao di\u1ec7n \u0111\u01b0\u1ee3c duy tr\u00ec sau c\u00e1c b\u1ea3n n\u00e2ng c\u1ea5p. \u0110\u1ec3 k\u00edch ho\u1ea1t ghi \u0111\u00e8, t\u1ea1o m\u1ed9t t\u1ec7p css c\u00f3 t\u00ean <code>override.css</code> v\u1edbi c\u00e1c s\u1eeda \u0111\u1ed5i giao di\u1ec7n c\u1ee7a b\u1ea1n v\u00e0 \u0111\u1eb7t t\u1ea1i th\u01b0 vi\u1ec7n giao di\u1ec7n c\u1ee7a phong c\u00e1ch b\u1ea1n mu\u1ed1n thay \u0111\u1ed5i, ho\u1eb7c \u0111\u1ed5i t\u00ean m\u1ed9t trong c\u00e1c m\u1eabu t\u1ec7p, v\u00e0 sau \u0111\u00f3 l\u00e0m m\u1edbi tr\u00ecnh duy\u1ec7t t\u1eeb \u0111\u1ea7u. L\u01b0u \u00fd r\u1eb1ng ng\u01b0\u1eddi qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m v\u00e0 b\u1ea3n \u0111i\u1ec1u khi\u1ec3n chia s\u1ebb c\u00f9ng m\u1ed9t t\u1ec7p override.css. \u0110\u1ec3 h\u1ee7y k\u00edch ho\u1ea1t ghi \u0111\u00e8, x\u00f3a ho\u1eb7c \u0111\u1ed5i t\u00ean t\u1ec7p<code>override.css</code> v\u00e0 sau \u0111\u00f3 l\u00e0m m\u1edbi tr\u00ecnh duy\u1ec7t t\u1eeb \u0111\u1ea7u (th\u01b0\u1eddng l\u00e0 ph\u00edm t\u1eaft Control + Shift + R).";
