    t[5503] = "BOB";
    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "N\u1ebfu sau v\u00e0i ph\u00fat \u0111\u00e3 ho\u1ea1t \u0111\u1ed9ng, b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n hi\u1ec3n th\u1ecb 0 \u0110\u1ed3ng h\u00e0nh ho\u1ea1t \u0111\u1ed9ng v\u00e0 0 \u0110\u1ed3ng h\u00e0nh bi\u1ebft \u0111\u01b0\u1ee3c, v\u1edbi th\u00f4ng b\u00e1o \u1edf thanh b\u00ean r\u1eb1ng c\u1ea7n ki\u1ec3m tra k\u1ebft n\u1ed1i m\u1ea1ng, \u0111\u1ea3m b\u1ea3o b\u1ea1n c\u00f3 th\u1ec3 truy c\u1eadp internet hay kh\u00f4ng. N\u1ebfu k\u1ebft n\u1ed1i internet c\u1ee7a b\u1ea1n ho\u1ea1t \u0111\u1ed9ng b\u00ecnh th\u01b0\u1eddng, b\u1ea1n c\u00f3 th\u1ec3 c\u1ea7n m\u1edf ch\u1eb7n Java trong t\u01b0\u1eddng l\u1eeda. Ng\u01b0\u1ee3c l\u1ea1i, b\u1ea1n c\u00f3 th\u1ec3 c\u1ea7n t\u00e1i ph\u00e2n ph\u1ed1i b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P c\u1ee7a m\u00ecnh. Truy c\u1eadp trang <a href=/configreseed#reseedconfig>C\u1ea5u h\u00ecnh T\u00e1i ph\u00e2n ph\u1ed1i</a> v\u00e0 nh\u1ea5p n\u00fat <i>L\u01b0u thay \u0111\u1ed5i v\u00e0 T\u00e1i ph\u00e2n ph\u1ed1i ngay</i>. Xem th\u00eam th\u00f4ng tin \u1edf ph\u1ea7n <a href=#reseedhelp>H\u01b0\u1edbng d\u1eabn T\u00e1i ph\u00e2n ph\u1ed1i</a> tr\u00ean.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "M\u1ed9t API \u1ed5 c\u1eafm c\u1ea5p cao h\u01a1n cho kh\u00e1ch h\u00e0ng. Ch\u1ec9 m\u1edf khi m\u00e1y kh\u00e1ch SAM V3 y\u00eau c\u1ea7u phi\u00ean UDP. C\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c b\u1eadt/t\u1eaft tr\u00ean trang c\u1ea5u h\u00ecnh m\u00e1y kh\u00e1ch <a href=/configclents> </a>. C\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c thay \u0111\u1ed5i trong t\u1ec7p <code> client.config </code> v\u1edbi t\u00f9y ch\u1ecdn d\u00f2ng l\u1ec7nh sam <code> sam.udp.port = nnnn </code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "N\u1ebfu b\u1ea1n mu\u1ed1n trang web c\u1ee7a m\u00ecnh ph\u1ea3n h\u1ed3i nhanh th\u00ec vi\u1ec7c n\u00e9n h\u00ecnh \u1ea3nh l\u00e0 \u0111i\u1ec1u c\u1ea7n thi\u1ebft khi l\u01b0u tr\u1eef h\u00ecnh \u1ea3nh l\u1edbn. Vi\u1ec7c s\u1eed d\u1ee5ng d\u1ecbch v\u1ee5 nh\u01b0 <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> \u0111\u1ec3 n\u00e9n h\u00ecnh \u1ea3nh png v\u00e0 jpeg c\u1ee7a b\u1ea1n th\u01b0\u1eddng s\u1ebd t\u1ea1o ra c\u00e1c t\u1ec7p nh\u1ecf h\u01a1n nhi\u1ec1u v\u1edbi m\u1ee9c \u0111\u1ed9 m\u1ea5t m\u00e1t t\u1ed1i thi\u1ec3u Ch\u1ea5t l\u01b0\u1ee3ng. Trong m\u1ed9t s\u1ed1 tr\u01b0\u1eddng h\u1ee3p, \u0111\u1ecbnh d\u1ea1ng webp c\u00f3 th\u1ec3 l\u00e0 jpeg t\u1ed1t nh\u1ea5t, t\u1ea1o ra c\u00e1c t\u1ec7p nh\u1ecf h\u01a1n v\u1edbi \u0111\u1ed9 trung th\u1ef1c h\u00ecnh \u1ea3nh t\u01b0\u01a1ng \u0111\u01b0\u01a1ng ho\u1eb7c t\u1ed1t h\u01a1n v\u00e0 c\u00f3 h\u1ed7 tr\u1ee3 tr\u00ecnh duy\u1ec7t r\u1ed9ng r\u00e3i. Ngo\u00e0i ra, h\u00e3y c\u00e2n nh\u1eafc s\u1eed d\u1ee5ng svgs thay v\u00ec bitmap cho bi\u1ec3u t\u01b0\u1ee3ng v\u00e0 h\u00ecnh minh h\u1ecda - ch\u00fang th\u01b0\u1eddng nh\u1ecf h\u01a1n t\u1ec7p bitmap t\u01b0\u01a1ng \u0111\u01b0\u01a1ng (ch\u1ea1y ch\u00fang th\u00f4ng qua m\u1ed9t d\u1ecbch v\u1ee5 nh\u01b0 <a href=https://vecta.io/nano target=_blank class='sitelink external '>Tr\u00ecnh t\u1ed1i \u01b0u h\u00f3a Nano SVG</a> \u0111\u1ec3 lo\u1ea1i b\u1ecf c\u00e1c h\u00e0nh tr\u00ecnh kh\u00f4ng c\u1ea7n thi\u1ebft), m\u1edf r\u1ed9ng quy m\u00f4 m\u00e0 kh\u00f4ng l\u00e0m gi\u1ea3m ch\u1ea5t l\u01b0\u1ee3ng v\u00e0 c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c n\u00e9n b\u1eb1ng m\u00e1y ch\u1ee7 web c\u1ee7a b\u1ea1n.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP b\u1ecb v\u00f4 hi\u1ec7u h\u00f3a tr\u00ean thi\u1ebft b\u1ecb";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "M\u1eb7c \u0111\u1ecbnh, h\u1ea7u h\u1ebft c\u00e1c d\u1ecbch v\u1ee5 kh\u00e1ch c\u1ee7a b\u1ea1n (th\u01b0 \u0111i\u1ec7n t\u1eed, proxy HTTP, IRC) s\u1ebd chia s\u1ebb c\u00f9ng b\u1ed9 \u0111\u01b0\u1eddng h\u1ea7m (v\u00ec l\u00fd do hi\u1ec7u su\u1ea5t) v\u00e0 \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea nh\u01b0 <i>Kh\u00e1ch s\u1eed d\u1ee5ng chung</i> v\u00e0 <i>Kh\u00e1ch s\u1eed d\u1ee5ng chung(DSA)</i> trong thanh b\u00ean d\u01b0\u1edbi D\u1ecbch v\u1ee5 \u0110\u01b0\u1eddng h\u1ea7m v\u00e0 tr\u00ean trang <a href=/tunnels>\u0110\u01b0\u1eddng h\u1ea7m</a>.";
