    t[5545] = "Ph\u1ea7n n\u00e0y m\u1eb7c \u0111\u1ecbnh kh\u00f4ng \u0111\u01b0\u1ee3c b\u1eadt tr\u1eeb khi b\u1eadt ch\u1ebf \u0111\u1ed9 <a href='/help/configuration#advancedconsole'>B\u1ea3ng \u0111i\u1ec1u khi\u1ec3n N\u00e2ng cao</a>. B\u1ea1n c\u00f3 th\u1ec3 b\u1eadt n\u00f3 tr\u00ean trang <a href='/configsidebar'>C\u1ea5u h\u00ecnh Thanh b\u00ean</a>.";
