    t[5613] = "\u0110\u01b0\u1eddng d\u1eabn li\u00ean l\u1ea1c \u0111\u01b0\u1ee3c m\u00e3 h\u00f3a <a href=https://geti2p.net/en/docs/tunnels/unidirectional class='sitelink external' target=_blank rel=noreferrer>m\u1ed9t chi\u1ec1u</a> \u0111\u01b0\u1ee3c m\u00e3 h\u00f3a gi\u1eefa m\u00e1y kh\u00e1ch ho\u1eb7c m\u00e1y ch\u1ee7 tr\u00ean m\u1ea1ng I2P . T\u01b0\u01a1ng t\u1ef1 nh\u01b0 m\u1ea1ch trong Tor, ngo\u1ea1i tr\u1eeb m\u1ea1ch Tor l\u00e0 hai chi\u1ec1u.";
