    t[5674] = "classic";
    t[5675] = "c\u1ed5 \u0111i\u1ec3n";
    t[5680] = "Configure I2P system service";
    t[5681] = "C\u1ea5u h\u00ecnh d\u1ecbch v\u1ee5 h\u1ec7 th\u1ed1ng I2P";
    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "Ki\u1ec3m tra xem c\u00f3 ch\u01b0\u01a1ng tr\u00ecnh n\u00e0o kh\u00e1c \u0111ang s\u1eed d\u1ee5ng c\u1ed5ng \u0111\u00e3 \u0111\u1ecbnh c\u1ea5u h\u00ecnh hay kh\u00f4ng. N\u1ebfu v\u1eady, h\u00e3y d\u1eebng ch\u01b0\u01a1ng tr\u00ecnh \u0111\u00f3 ho\u1eb7c \u0111\u1ecbnh c\u1ea5u h\u00ecnh I2P \u0111\u1ec3 s\u1eed d\u1ee5ng m\u1ed9t c\u1ed5ng kh\u00e1c.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "Ch\u1ec9nh s\u1eeda th\u1ee7 c\u00f4ng c\u00e1c \u0111\u1ed3ng nghi\u1ec7p v\u00e0 xem c\u00e1c \u0111\u1ed3ng nghi\u1ec7p v\u00e0 danh s\u00e1ch ch\u1eb7n b\u1ecb c\u1ea5m";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "T\u01b0\u1eddng l\u1eeda v\u1edbi TCP trong n\u01b0\u1edbc \u0111\u01b0\u1ee3c b\u1eadt";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "M\u1edf c\u1ed5ng <a href=/confignet#udpconfig>c\u1ee7a I2P+</a> tr\u00ean modem, router v\u00e0/ho\u1eb7c t\u01b0\u1eddng l\u1eeda c\u1ee7a b\u1ea1n \u0111\u1ec3 k\u1ebft n\u1ed1i t\u1ed1t h\u01a1n (t\u1ed1t nh\u1ea5t l\u00e0 c\u1ea3 UDP v\u00e0 TCP). Th\u00f4ng tin chi ti\u1ebft h\u01a1n v\u1ec1 c\u00e1ch th\u1ef1c hi\u1ec7n chuy\u1ec3n ti\u1ebfp c\u1ed5ng c\u00f3 th\u1ec3 t\u00ecm th\u1ea5y t\u1ea1i <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, ngo\u00e0i ra c\u00f2n c\u00f3 di\u1ec5n \u0111\u00e0n v\u00e0 k\u00eanh IRC \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea b\u00ean d\u01b0\u1edbi. L\u01b0u \u00fd r\u1eb1ng I2P kh\u00f4ng h\u1ed7 tr\u1ee3 k\u1ebft n\u1ed1i ra internet qua proxy http ho\u1eb7c socks [\u0111\u00f3n nh\u1eadn b\u1ea3n v\u00e1!], m\u1eb7c d\u00f9 b\u1ea1n c\u00f3 th\u1ec3 k\u1ebft n\u1ed1i t\u1edbi c\u00e1c proxy qua ch\u00ednh I2P sau khi k\u1ebft n\u1ed1i v\u00e0o m\u1ea1ng.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "B\u1ed9 l\u1ecdc \u0111\u01b0\u1eddng h\u1ea7m c\u00f3 th\u1ec3 cung c\u1ea5p kh\u1ea3 n\u0103ng b\u1ea3o v\u1ec7 ch\u1ed1ng l\u1ea1i c\u00e1c cu\u1ed9c t\u1ea5n c\u00f4ng t\u1eeb ch\u1ed1i d\u1ecbch v\u1ee5 m\u00e0 kh\u00f4ng l\u00e0m gi\u00e1n \u0111o\u1ea1n d\u1ecbch v\u1ee5 cho ng\u01b0\u1eddi d\u00f9ng ch\u00ednh h\u00e3ng, k\u1ebft h\u1ee3p v\u1edbi b\u1ed9 \u0111i\u1ec1u ti\u1ebft \u0111\u01b0\u1eddng h\u1ea7m ho\u1eb7c nh\u01b0 m\u1ed9t chi\u1ebfn l\u01b0\u1ee3c thay th\u1ebf.";
