    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "H\u00e0nh \u0111\u1ed9ng \u0111\u00f3ng g\u00f3p cho m\u1ea1ng b\u1eb1ng c\u00e1ch cho ph\u00e9p c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c x\u00e2y d\u1ef1ng \u0111\u01b0\u1eddng h\u1ea7m s\u1eed d\u1ee5ng b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n trong chu\u1ed7i \u0111\u01b0\u1eddng h\u1ea7m. \u00cdt nh\u1ea5t 12KB/s b\u0103ng th\u00f4ng l\u00ean h\u1ea1 l\u01b0u (chia s\u1ebb m\u1ea1ng) c\u1ea7n \u0111\u01b0\u1ee3c c\u1ea5p ph\u00e1t \u0111\u1ec3 k\u00edch ho\u1ea1t s\u1ef1 tham gia. L\u01b0u \u00fd r\u1eb1ng c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn b\u1ecb t\u01b0\u1eddng l\u1eeda s\u1ebd b\u1ecb h\u1ea1n ch\u1ebf v\u1ec1 m\u1ee9c \u0111\u1ed9 \u0111\u00f3ng g\u00f3p v\u00e0o s\u1ef1 tham gia, v\u00e0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh l\u00e0 \u1ea8n s\u1ebd kh\u00f4ng tham gia tuy\u1ec7t \u0111\u1ed1i.";
