    t[6351] = "Thi\u1ebft l\u1eadp n\u00e0y x\u00e1c \u0111\u1ecbnh s\u1ed1 l\u01b0\u1ee3ng ng\u01b0\u1eddi c\u00f9ng kh\u00e1m ph\u00e1 song song khi c\u00f4ng vi\u1ec7c Kh\u00e1m ph\u00e1 \u0110\u1ed3ng ng\u0169 ch\u1ea1y [m\u1eb7c \u0111\u1ecbnh l\u00e0 1 ng\u01b0\u1eddi m\u1ed9t l\u01b0\u1ee3t khi bi\u1ebft h\u01a1n 3000 ng\u01b0\u1eddi]. L\u01b0u \u00fd l\u00e0 t\u0103ng gi\u00e1 tr\u1ecb n\u00e0y s\u1ebd t\u0103ng y\u00eau c\u1ea7u b\u0103ng th\u00f4ng cho qu\u00e1 tr\u00ecnh kh\u00e1m ph\u00e1, v\u00e0 \u0111\u1eb7t gi\u00e1 tr\u1ecb qu\u00e1 cao c\u00f3 th\u1ec3 g\u00e2y ra \u0111\u1ed9 tr\u1ec5 tin nh\u1eafn qu\u00e1 m\u1ee9c v\u00e0 can thi\u1ec7p v\u00e0o c\u00e1c d\u1ecbch v\u1ee5 kh\u00e1c, do \u0111\u00f3 h\u00e3y s\u1eed d\u1ee5ng c\u1ea9n th\u1eadn!";
