    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "L\u01b0u \u00fd: \u0110\u1ec3 t\u0103ng c\u01b0\u1eddng b\u1ea3o m\u1eadt khi duy\u1ec7t c\u00e1c trang .i2p, b\u1ea1n c\u00f3 th\u1ec3 c\u00e2n nh\u1eafc c\u00e0i \u0111\u1eb7t th\u00eam ti\u1ec7n \u00edch ng\u0103n ch\u1eb7n Javascript ch\u1ea1y trong tr\u00ecnh duy\u1ec7t nh\u01b0 <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, m\u1eb7c d\u00f9 \u0111\u01b0\u1ee3c khuy\u1ebfn c\u00e1o l\u00e0 cho ph\u00e9p danh s\u00e1ch tr\u1eafng \u0111\u1ecba ch\u1ec9 I2P+ \u0111ang ch\u1ea1y \u0111\u1ec3 b\u1eadt t\u00ednh n\u0103ng c\u1ea3i ti\u1ebfn b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn. Ngo\u00e0i ra, c\u0169ng \u0111\u01b0\u1ee3c khuy\u1ebfn c\u00e1o c\u00e0i th\u00eam ti\u1ec7n \u00edch ng\u0103n c\u00e1c y\u00eau c\u1ea7u t\u1edbi t\u00e0i nguy\u00ean ngo\u00e0i trang, v\u00ed d\u1ee5 nh\u01b0 <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
