    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ c\u00f3 th\u1ec3 t\u00edch h\u1ee3p v\u00e0o m\u1ea1ng ch\u1eadm trong l\u1ea7n \u0111\u1ea7u ti\u00ean b\u1ea1n ch\u1ea1y n\u00f3 v\u00ec n\u00f3 kh\u1edfi \u0111\u1ed9ng v\u00e0o m\u1ea1ng v\u00e0 t\u00ecm hi\u1ec3u c\u00e1c \u0111\u1ed3ng nghi\u1ec7p b\u1ed5 sung. B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P+ c\u1ee7a b\u1ea1n ch\u1ea1y c\u00e0ng l\u00e2u th\u00ec n\u00f3 s\u1ebd ho\u1ea1t \u0111\u1ed9ng c\u00e0ng t\u1ed1t, v\u00ec v\u1eady h\u00e3y th\u1eed v\u00e0 duy tr\u00ec b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n ho\u1ea1t \u0111\u1ed9ng l\u00e2u nh\u1ea5t c\u00f3 th\u1ec3, 24/7 n\u1ebfu c\u00f3 th\u1ec3! N\u1ebfu sau 30 ph\u00fat, s\u1ed1 l\u01b0\u1ee3ng <i>Ho\u1ea1t \u0111\u1ed9ng: [\u0111\u00e3 k\u1ebft n\u1ed1i/g\u1ea7n \u0111\u00e2y]</i> c\u1ee7a b\u1ea1n v\u1eabn c\u00f3 \u00edt h\u01a1n 10 ngang h\u00e0ng ho\u1eb7c t\u1ed5ng s\u1ed1 c\u00e1c ngang h\u00e0ng <i>T\u00edch h\u1ee3p</i> c\u1ee7a b\u1ea1n \u00edt h\u01a1n 5, th\u00ec c\u00f3 m\u1ed9t s\u1ed1 \u0111i\u1ec1u b\u1ea1n c\u00f3 th\u1ec3 l\u00e0m \u0111\u1ec3 ki\u1ec3m tra v\u1ea5n \u0111\u1ec1:";
