    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Vi\u1ec7c tri\u1ec3n khai Java c\u1ee7a m\u00e1y kh\u00e1ch TOR, c\u00f3 s\u1eb5n d\u01b0\u1edbi d\u1ea1ng plugin i2p. C\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng l\u00e0m m\u1eb7c \u0111\u1ecbnh <i> outproxy </i> n\u1ebfu \u0111\u01b0\u1ee3c \u0111\u1ecbnh c\u1ea5u h\u00ecnh trong c\u00e1c kh\u00f3a c\u00f3 li\u00ean quan ho\u1eb7c \u0111\u01b0\u1eddng h\u1ea7m m\u00e1y kh\u00e1ch HTTP trong tr\u00ecnh qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m <i> </i>. C\u00f3 s\u1eb5n t\u1eeb <a href=http://stats.i2p/i2p/plugins Class=Sitelink> http://stats.i2p/i2p/plugins </a>. M\u00e3 ngu\u1ed3n c\u00f3 s\u1eb5n tr\u00ean <a href=https://github.com/i2p/i2p.plugins.orchid class='Sitelink b\u00ean ngo\u00e0i' Target=_Blank rel=noreferrer> GitHub </a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "\u0110\u1ecba ch\u1ec9 IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Ph\u1ea7n n\u00e0y ch\u1ec9 ra b\u0103ng th\u00f4ng trung b\u00ecnh v\u00e0 t\u1ed5ng l\u01b0u l\u01b0\u1ee3ng s\u1eed d\u1ee5ng c\u1ee7a phi\u00ean hi\u1ec7n t\u1ea1i. T\u1ea5t c\u1ea3 c\u00e1c gi\u00e1 tr\u1ecb \u0111\u01b0\u1ee3c t\u00ednh b\u1eb1ng byte m\u1ed7i gi\u00e2y. B\u1ea1n c\u00f3 th\u1ec3 thay \u0111\u1ed5i gi\u1edbi h\u1ea1n b\u0103ng th\u00f4ng tr\u00ean trang <a href='/config'>C\u1ea5u h\u00ecnh B\u0103ng th\u00f4ng</a>. B\u1ea1n c\u00e0ng chia s\u1ebb nhi\u1ec1u b\u0103ng th\u00f4ng, b\u1ea1n c\u00e0ng gi\u00fap \u0111\u1ee1 m\u1ea1ng v\u00e0 c\u1ea3i thi\u1ec7n t\u00ednh \u1ea9n danh c\u1ee7a ch\u00ednh m\u00ecnh, v\u00ec v\u1eady h\u00e3y d\u00e0nh th\u1eddi gian \u0111\u1ec3 xem x\u00e9t l\u1ea1i c\u00e1c thi\u1ebft l\u1eadp. N\u1ebfu b\u1ea1n kh\u00f4ng ch\u1eafc v\u1ec1 t\u1ed1c \u0111\u1ed9 m\u1ea1ng, vi\u1ec7c s\u1eed d\u1ee5ng d\u1ecbch v\u1ee5 nh\u01b0 <a href='http://speedtest.net/'>SpeedTest</a> s\u1ebd cho b\u1ea1n c\u00e1i nh\u00ecn r\u00f5 h\u01a1n v\u1ec1 kh\u1ea3 n\u0103ng b\u0103ng th\u00f4ng. S\u1ed1 l\u01b0\u1ee3ng chia s\u1ebb l\u00ean m\u1ea1ng (KBps Out) c\u1ee7a b\u1ea1n s\u1ebd quy\u1ebft \u0111\u1ecbnh \u0111\u00f3ng g\u00f3p chung c\u1ee7a b\u1ea1n cho to\u00e0n m\u1ea1ng. B\u0103ng th\u00f4ng m\u1eb7c \u0111\u1ecbnh <a href='/graphs'>\u0111\u01b0\u1ee3c bi\u1ec3u \u0111\u1ed3 h\u00f3a</a>.";
