    t[7022] = "This setting (in milliseconds) allows you to manually configure the queue delay target value for the CoDel queue management system. Default is 50ms. [Restart required]";
    t[7023] = "C\u00e0i \u0111\u1eb7t n\u00e0y (t\u00ednh b\u1eb1ng mili gi\u00e2y) cho ph\u00e9p b\u1ea1n \u0111\u1ecbnh c\u1ea5u h\u00ecnh th\u1ee7 c\u00f4ng gi\u00e1 tr\u1ecb m\u1ee5c ti\u00eau c\u1ee7a h\u00e0ng \u0111\u1ee3i cho h\u1ec7 th\u1ed1ng qu\u1ea3n l\u00fd h\u00e0ng \u0111\u1ee3i codel. M\u1eb7c \u0111\u1ecbnh l\u00e0 50ms. [Kh\u1edfi \u0111\u1ed9ng l\u1ea1i y\u00eau c\u1ea7u]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "\u0110\u1ec3 duy tr\u00ec t\u00ednh \u1ea9n danh, n\u00ean c\u1eadp nh\u1eadt b\u1eb1ng c\u00e1ch s\u1eed d\u1ee5ng proxy I2P HTTP. N\u1ebfu b\u1ea3n c\u1eadp nh\u1eadt tin t\u1ee9c ho\u1eb7c I2P \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef tr\u00ean I2P, vi\u1ec7c s\u1eed d\u1ee5ng proxy s\u1ebd l\u00e0 c\u1ea7n thi\u1ebft.";
    t[7054] = "A threshold to apply to remote destinations listed in a file";
    t[7055] = "Ng\u01b0\u1ee1ng \u00e1p d\u1ee5ng cho c\u00e1c \u0111i\u1ec3m \u0111\u1ebfn t\u1eeb xa \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea trong m\u1ed9t t\u1ec7p";
    t[7062] = "The su3 format is preferred, as it will be verified as signed by a trusted source.";
    t[7063] = "\u0110\u1ecbnh d\u1ea1ng su3 \u0111\u01b0\u1ee3c \u01b0u ti\u00ean v\u00ec n\u00f3 s\u1ebd \u0111\u01b0\u1ee3c x\u00e1c minh l\u00e0 \u0111\u01b0\u1ee3c k\u00fd b\u1edfi m\u1ed9t ngu\u1ed3n \u0111\u00e1ng tin c\u1eady.";
    t[7064] = "Specify hostname or IP address";
    t[7065] = "Ch\u1ec9 \u0111\u1ecbnh t\u00ean m\u00e1y ch\u1ee7 ho\u1eb7c \u0111\u1ecba ch\u1ec9 IP";
    t[7072] = "Strict Countries";
    t[7073] = "C\u00e1c n\u01b0\u1edbc nghi\u00eam ng\u1eb7t";
    t[7076] = "However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels.";
    t[7077] = "Tuy nhi\u00ean, n\u1ebfu b\u1ea1n g\u1eb7p l\u1ed7i h\u1ea7m, t\u1ea5t c\u1ea3 c\u00e1c d\u1ecbch v\u1ee5 c\u1ee7a b\u1ea1n s\u1ebd ng\u1eebng ho\u1ea1t \u0111\u1ed9ng c\u00f9ng m\u1ed9t l\u00fac, do \u0111\u00f3 \u1edf m\u1ed9t s\u1ed1 t\u00ecnh hu\u1ed1ng b\u1ea1n c\u00f3 th\u1ec3 mu\u1ed1n c\u1ea5u h\u00ecnh c\u00e1c d\u1ecbch v\u1ee5 kh\u00e1ch s\u1eed d\u1ee5ng t\u1eadp ri\u00eang c\u1ee7a ch\u00fang cho c\u00e1c h\u1ea7m.";
