    t[7151] = "L\u1ed7i nghi\u00eam tr\u1ecdng";
    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P kh\u00f4ng ho\u1ea1t \u0111\u1ed9ng t\u1ed1t sau lo\u1ea1i t\u01b0\u1eddng l\u1eeda n\u00e0y. B\u1ea1n c\u00f3 th\u1ec3 s\u1ebd kh\u00f4ng th\u1ec3 ch\u1ea5p nh\u1eadn c\u00e1c k\u1ebft n\u1ed1i g\u1eedi \u0111\u1ebfn, \u0111i\u1ec1u n\u00e0y s\u1ebd h\u1ea1n ch\u1ebf s\u1ef1 tham gia c\u1ee7a b\u1ea1n v\u00e0o m\u1ea1ng.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Giao th\u1ee9c I2P Client (I2CP) cho ph\u00e9p c\u00e1c \u1ee9ng d\u1ee5ng b\u00ean ngo\u00e0i (clients) li\u00ean l\u1ea1c v\u1edbi I2P qua c\u1ed5ng TCP duy nh\u1ea5t, m\u1eb7c \u0111\u1ecbnh l\u00e0 s\u1eed d\u1ee5ng c\u1ed5ng 7654. \u0110\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin, xem <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>t\u00e0i li\u1ec7u tr\u1ef1c tuy\u1ebfn</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "T\u1ed5ng s\u1ed1 h\u00e0ng \u0111\u1ee3i";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "C\u00e0i \u0111\u1eb7t n\u00e0y x\u00e1c \u0111\u1ecbnh v\u1eadn chuy\u1ec3n n\u00e0o \u0111\u01b0\u1ee3c \u01b0u ti\u00ean khi giao ti\u1ebfp v\u1edbi c\u00e1c \u0111\u1ed3ng nghi\u1ec7p. Theo m\u1eb7c \u0111\u1ecbnh, NTCP \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng h\u01a1n UDP (SSU). B\u1eb1ng c\u00e1ch \u0111\u1eb7t gi\u00e1 tr\u1ecb th\u00e0nh TRUE, UDP s\u1ebd \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng tr\u1eeb khi k\u1ebft n\u1ed1i NTCP c\u00f3 s\u1eb5n; Khi \u0111\u01b0\u1ee3c \u0111\u1eb7t th\u00e0nh lu\u00f4n lu\u00f4n, UDP s\u1ebd lu\u00f4n \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng b\u1ea5t k\u1ec3 k\u1ebft n\u1ed1i NTCP tr\u01b0\u1edbc \u0111\u00f3. [M\u1eb7c \u0111\u1ecbnh l\u00e0 sai]";
