    t[7188] = "Tunnel Filters";
    t[7189] = "B\u1ed9 l\u1ecdc \u0111\u01b0\u1eddng h\u1ea7m";
    t[7194] = "You have not configured inbound TCP with a hostname and port on the Network Configuration page, however you have disabled UDP.";
    t[7195] = "B\u1ea1n ch\u01b0a \u0111\u1ecbnh c\u1ea5u h\u00ecnh TCP g\u1eedi \u0111\u1ebfn v\u1edbi t\u00ean m\u00e1y ch\u1ee7 v\u00e0 c\u1ed5ng tr\u00ean trang C\u1ea5u h\u00ecnh M\u1ea1ng, tuy nhi\u00ean b\u1ea1n \u0111\u00e3 t\u1eaft UDP.";
    t[7200] = "Certificates are used to authenticate encrypted services running on the network, provision optional SSL for hosted services and the router console, or provide proof of ownership of a router family.";
    t[7201] = "Gi\u1ea5y ch\u1ee9ng nh\u1eadn \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng \u0111\u1ec3 x\u00e1c th\u1ef1c c\u00e1c d\u1ecbch v\u1ee5 \u0111\u01b0\u1ee3c m\u00e3 h\u00f3a ch\u1ea1y tr\u00ean m\u1ea1ng, SSL t\u00f9y ch\u1ecdn cung c\u1ea5p cho c\u00e1c d\u1ecbch v\u1ee5 \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef v\u00e0 b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ho\u1eb7c cung c\u1ea5p b\u1eb1ng ch\u1ee9ng v\u1ec1 quy\u1ec1n s\u1edf h\u1eefu c\u1ee7a m\u1ed9t gia \u0111\u00ecnh b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn.";
