    t[7285] = "D\u1eef li\u1ec7u thu th\u1eadp \u0111\u01b0\u1ee3c l\u01b0\u1ee3ng t\u1eed h\u00f3a trong kho\u1ea3ng th\u1eddi gian 1 ph\u00fat, do \u0111\u00f3 ch\u1ec9 n\u00ean s\u1eed d\u1ee5ng l\u00e0m d\u1eef li\u1ec7u \u01b0\u1edbc t\u00ednh.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Khi \u0111\u01b0\u1ee3c \u0111\u1eb7t th\u00e0nh True, I2P ch\u1ea1y m\u00e0 kh\u00f4ng c\u00f3 k\u1ebft n\u1ed1i m\u1ea1ng, \u0111i\u1ec1u n\u00e0y r\u1ea5t h\u1eefu \u00edch n\u1ebfu b\u1ea1n li\u00ean t\u1ee5c kh\u1edfi \u0111\u1ed9ng l\u1ea1i b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u1ec3 ki\u1ec3m tra c\u1eadp nh\u1eadt m\u00e3 v\u00ec \u0111i\u1ec1u n\u00e0y ng\u0103n ch\u1eb7n s\u1ef1 gi\u00e1n \u0111o\u1ea1n m\u1ea1ng.";
    t[7302] = "Updating IP address";
    t[7303] = "C\u1eadp nh\u1eadt \u0111\u1ecba ch\u1ec9 IP";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 Only SSU, ng\u01b0\u1eddi gi\u1edbi thi\u1ec7u";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) l\u00e0 ph\u01b0\u01a1ng th\u1ee9c v\u1eadn chuy\u1ec3n m\u1ea1ng I2P cung c\u1ea5p k\u1ebft n\u1ed1i \u0111i\u1ec3m-\u0111i\u1ec3m \u0111\u1ecbnh h\u01b0\u1edbng v\u1edbi m\u00e3 h\u00f3a, b\u1ea3o m\u1eadt b\u00e1n \u0111\u00e1ng tin c\u1eady, ngo\u00e0i ra c\u00f2n cung c\u1ea5p d\u1ecbch v\u1ee5 ph\u00e1t hi\u1ec7n \u0111\u1ecba ch\u1ec9 IP v\u00e0 v\u01b0\u1ee3t NAT. Xem th\u00eam th\u00f4ng tin t\u1ea1i <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>t\u00e0i li\u1ec7u tr\u1ef1c tuy\u1ebfn</a>.";
    t[7314] = "Congestion window";
    t[7315] = "C\u1eeda s\u1ed5 t\u1eafc ngh\u1ebdn";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "S\u1eed d\u1ee5ng Proxy \u0111\u1ec3 gieo h\u1ea1t l\u1ea1i";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Cho \u0111\u1ebfn khi ra m\u1eaft t\u00edch h\u1ee3p I2P trong <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, tr\u01b0\u1edbc \u0111\u00e2y kh\u00f4ng th\u1ec3 t\u1ea3i xu\u1ed1ng torrent kh\u00f4ng \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef tr\u00ean m\u1ea1ng I2P. Tuy nhi\u00ean, b\u00e2y gi\u1edd Vuze (v\u00e0 sau n\u00e0y l\u00e0 <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'> Bigly</a>) cho ph\u00e9p ng\u01b0\u1eddi d\u00f9ng chia s\u1ebb torrent ngo\u00e0i I2P tr\u00ean I2P, ng\u01b0\u1eddi d\u00f9ng c\u00f3 th\u1ec3 t\u1ea3i xu\u1ed1ng torrent ngo\u00e0i I2P qua I2P n\u1ebfu ng\u01b0\u1eddi d\u00f9ng Vuze/Bigly ch\u1ecdn \u0111\u1ec3 l\u00e0m n\u1ed9i dung c\u00f3 s\u1eb5n cho m\u1ea1ng I2P. Torrent ph\u1ed5 bi\u1ebfn v\u1edbi s\u1ed1 l\u01b0\u1ee3ng \u0111\u1ed3ng x\u1eed l\u00fd l\u1edbn c\u00f3 kh\u1ea3 n\u0103ng truy c\u1eadp \u0111\u01b0\u1ee3c qua I2P nhi\u1ec1u h\u01a1n; \u0111\u1ec3 x\u00e1c \u0111\u1ecbnh n\u1ebfu n\u1ed9i dung c\u00f3 s\u1eb5n, h\u00e3y th\u00eam li\u00ean k\u1ebft torrent, magnet ho\u1eb7c infohash v\u00e0o kh\u00e1ch BitTorrent \u0111\u01b0\u1ee3c k\u00edch ho\u1ea1t I2P c\u1ee7a b\u1ea1n.";
