    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "C\u00e0i \u0111\u1eb7t n\u00e0y (t\u00ednh b\u1eb1ng gi\u1edd) x\u00e1c \u0111\u1ecbnh m\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn trong NETDB bao nhi\u00eau tu\u1ed5i (ng\u00e0y xu\u1ea5t b\u1ea3n cu\u1ed1i c\u00f9ng c\u1ee7a n\u00f3) tr\u01b0\u1edbc khi n\u00f3 \u0111\u01b0\u1ee3c ph\u00e2n lo\u1ea1i l\u00e0 c\u0169 v\u00e0 b\u1ecb x\u00f3a. [M\u1eb7c \u0111\u1ecbnh l\u00e0 28 gi\u1edd tr\u1eeb khi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn l\u00e0 l\u0169 l\u1ee5t, trong tr\u01b0\u1eddng h\u1ee3p \u0111\u00f3 m\u1eb7c \u0111\u1ecbnh l\u00e0 8 gi\u1edd]";
