    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "N\u1ebfu y\u00eau c\u1ea7u m\u1ed9t chu\u1ed7i <i>X\u00e1c th\u1ef1c \u0110\u0103ng k\u00fd</i>, b\u1ea1n c\u00f3 th\u1ec3 t\u00ecm th\u1ea5y n\u00f3 tr\u00ean trang <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>X\u00e1c th\u1ef1c \u0110\u0103ng k\u00fd</a> \u0111\u01b0\u1ee3c li\u00ean k\u1ebft t\u1eeb trang <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>C\u1ea5u h\u00ecnh Qu\u1ea3n l\u00fd \u0110\u01b0\u1eddng h\u1ea7m</a>. X\u00e1c th\u1ef1c \u0111\u0103ng k\u00fd \u0111\u1ea3m b\u1ea3o ch\u1ec9 ch\u1ee7 s\u1edf h\u1eefu m\u1edbi c\u00f3 th\u1ec3 \u0111\u0103ng k\u00fd ho\u1eb7c qu\u1ea3n l\u00fd t\u00ean mi\u1ec1n, v\u00e0 y\u00eau c\u1ea7u tr\u00ean stats.i2p v\u00e0 reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Tin t\u1ee9c v\u00e0 c\u1eadp nh\u1eadt";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] N\u1ebfu b\u1ea1n kh\u00f4ng th\u1ec3 kh\u1edfi \u0111\u1ed9ng b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn b\u1eb1ng <code>i2p/i2prouter start</code>, h\u00e3y th\u1eed t\u1eadp l\u1ec7nh <code>runplain.sh</code> trong c\u00f9ng th\u01b0 m\u1ee5c.";
