    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Th\u00f4ng tin x\u00e1c \u0111\u1ecbnh danh t\u00ednh duy nh\u1ea5t c\u1ee7a m\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn tr\u00ean m\u1ea1ng bao g\u1ed3m \u0111\u1ecba ch\u1ec9 IP c\u1ee7a n\u00f3 (ho\u1eb7c \u0111\u1ecba ch\u1ec9 IP c\u1ee7a c\u00e1c trung gian gi\u1edbi thi\u1ec7u li\u00ean k\u1ebft) c\u00f9ng c\u1ed5ng nghe, kh\u00f3a k\u00fd v\u00e0 m\u00e3 h\u00f3a c\u00f4ng khai. Danh t\u00ednh b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn t\u01b0\u01a1ng \u1ee9ng v\u1edbi c\u00e1c \u0111\u1ed3ng nghi\u1ec7p tr\u00ean C\u01a1 s\u1edf d\u1eef li\u1ec7u M\u1ea1ng. C\u0169ng \u0111\u01b0\u1ee3c g\u1ecdi l\u00e0 <i>Th\u00f4ng tin B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn</i>.";
