    t[7680] = "Installed plugin does not contain the required configuration file";
    t[7681] = "Ti\u1ec7n \u00edch \u0111\u00e3 t\u1ea3i v\u1ec1 kh\u00f4ng ch\u1ee9a t\u1eadp tin c\u1ea5u h\u00ecnh c\u1ea7n c\u00f3";
    t[7682] = "Destination";
    t[7683] = "\u0110\u00edch \u0111\u1ebfn";
    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "C\u01a1 s\u1edf d\u1eef li\u1ec7u ph\u00e2n t\u00e1n ch\u1ee9a th\u00f4ng tin li\u00ean h\u1ec7 c\u1ee7a b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn (RouterInfos) v\u00e0 th\u00f4ng tin li\u00ean h\u1ec7 \u0111\u00edch (LeaseSets). M\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn duy nh\u1ea5t duy tr\u00ec c\u01a1 s\u1edf d\u1eef li\u1ec7u (m\u1ed9t ph\u1ea7n) c\u1ee7a ri\u00eang n\u00f3 \u0111\u1ec3 li\u00ean l\u1ea1c v\u1edbi c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c tr\u00ean m\u1ea1ng; kh\u00f4ng c\u00f3 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn n\u00e0o duy tr\u00ec danh s\u00e1ch t\u1ea5t c\u1ea3 c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn. RouterInfos \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef tr\u00ean \u0111\u0129a v\u00e0 \u0111\u1ecdc v\u00e0o b\u1ed9 nh\u1edb khi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u1edfi \u0111\u1ed9ng ho\u1eb7c khi c\u00f3 \u0111\u01b0\u1ee3c RouterInfos m\u1edbi. C\u00f2n \u0111\u01b0\u1ee3c g\u1ecdi l\u00e0 <i>NetDb</i>. \u0110\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin, h\u00e3y xem <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>t\u00e0i li\u1ec7u tr\u1ef1c tuy\u1ebfn</a>.";
    t[7692] = "Address";
    t[7693] = "\u0110\u1ecba ch\u1ec9";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Ng\u01b0\u1ee1ng \u0111\u01b0\u1ee3c x\u00e1c \u0111\u1ecbnh b\u1edfi s\u1ed1 l\u1ea7n th\u1eed k\u1ebft n\u1ed1i m\u00e0 m\u1ed9t \u0111\u00edch t\u1eeb xa \u0111\u01b0\u1ee3c ph\u00e9p th\u1ef1c hi\u1ec7n trong m\u1ed9t s\u1ed1 gi\u00e2y \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh tr\u01b0\u1edbc khi x\u1ea3y ra \"vi ph\u1ea1m\".";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet th\u01b0\u1eddng \u0111\u1ec1 c\u1eadp \u0111\u1ebfn Internet c\u00f4ng khai c\u00f3 th\u1ec3 truy c\u1eadp \u0111\u01b0\u1ee3c, ng\u01b0\u1ee3c l\u1ea1i v\u1edbi darknet th\u01b0\u1eddng m\u00f4 t\u1ea3 c\u00e1c d\u1ecbch v\u1ee5 m\u00e3 h\u00f3a, \u1ea9n danh \u0111\u01b0\u1ee3c x\u00e2y d\u1ef1ng tr\u00ean I2P, Tor v.v. \u0110\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin, xem <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>b\u00e0i vi\u1ebft Wikipedia</a>.";
