    t[7808] = "UPnP may be enabled or disabled on the Network Configuration page, but a change requires a router restart to take effect.";
    t[7809] = "UPnP c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c b\u1eadt ho\u1eb7c v\u00f4 hi\u1ec7u h\u00f3a tr\u00ean trang c\u1ea5u h\u00ecnh m\u1ea1ng, nh\u01b0ng thay \u0111\u1ed5i y\u00eau c\u1ea7u kh\u1edfi \u0111\u1ed9ng l\u1ea1i b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u1ec3 c\u00f3 hi\u1ec7u l\u1ef1c.";
    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "X\u00e1c \u0111\u1ecbnh s\u1ed1 c\u00f4ng vi\u1ec7c <a href=/jobs>song song</a> t\u1ed1i \u0111a c\u00f3 th\u1ec3 ch\u1ea1y. Gi\u00e1 tr\u1ecb m\u1eb7c \u0111\u1ecbnh \u0111\u01b0\u1ee3c quy\u1ebft \u0111\u1ecbnh b\u1edfi l\u01b0\u1ee3ng b\u1ed9 nh\u1edb c\u1ea5p cho JVM qua <code>wrapper.config</code>, v\u00e0 \u0111\u01b0\u1ee3c \u0111\u1eb7t l\u00e0 3 cho d\u01b0\u1edbi 64MB, 4 cho d\u01b0\u1edbi 256M, ho\u1eb7c 5 cho tr\u00ean 256MB. L\u01b0u \u00fd: Vi\u1ec7c thay \u0111\u1ed5i c\u00e0i \u0111\u1eb7t n\u00e0y y\u00eau c\u1ea7u kh\u1edfi \u0111\u1ed9ng l\u1ea1i b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn.";
