    t[7832] = "You may also try <a href=irc://127.0.0.1:6668/saltR class=chatlink>#saltR</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>#i2p</a> on I2P's IRC network.";
    t[7833] = "B\u1ea1n c\u0169ng c\u00f3 th\u1ec3 th\u1eed <a href=irc://127.0.0.1:6668/saltR class=chatlink>#saltR</a> ho\u1eb7c <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink> tr\u00ean m\u1ea1ng IRC c\u1ee7a I2P</a>.";
    t[7834] = "Binds to all interfaces. Can be changed with advanced config <code>i2np.upnp.SSDPPort=nnnn</code>. Can be disabled on the <a href=/configclients>Client Configuration page</a>.";
    t[7835] = "Li\u00ean k\u1ebft v\u1edbi t\u1ea5t c\u1ea3 c\u00e1c giao di\u1ec7n. C\u00f3 th\u1ec3 thay \u0111\u1ed5i v\u1edbi c\u1ea5u h\u00ecnh n\u00e2ng cao <code>i2np.upnp.SSDPPort=nnnn</code>. C\u00f3 th\u1ec3 v\u00f4 hi\u1ec7u h\u00f3a tr\u00ean trang <a href=/configclients>C\u1ea5u h\u00ecnh Kh\u00e1ch h\u00e0ng</a>.";
    t[7838] = "The skew (offset) of your computer's clock relative to the network-synced time.";
