    t[7926] = "For the best experience, it's recommended to configure your bandwidth settings to match the values provided by your ISP. If you are unsure of your bandwidth, you can run a test to determine your download and upload speeds.";
    t[7927] = "\u0110\u1ec3 c\u00f3 tr\u1ea3i nghi\u1ec7m t\u1ed1t nh\u1ea5t, b\u1ea1n n\u00ean \u0111\u1ecbnh c\u1ea5u h\u00ecnh c\u00e0i \u0111\u1eb7t b\u0103ng th\u00f4ng \u0111\u1ec3 kh\u1edbp v\u1edbi c\u00e1c gi\u00e1 tr\u1ecb do ISP cung c\u1ea5p. N\u1ebfu kh\u00f4ng ch\u1eafc ch\u1eafn v\u1ec1 b\u0103ng th\u00f4ng c\u1ee7a m\u00ecnh, b\u1ea1n c\u00f3 th\u1ec3 ch\u1ea1y th\u1eed nghi\u1ec7m \u0111\u1ec3 x\u00e1c \u0111\u1ecbnh t\u1ed1c \u0111\u1ed9 t\u1ea3i xu\u1ed1ng v\u00e0 t\u1ea3i l\u00ean.";
