    t[7984] = "Remote encrypted destinations";
    t[7985] = "\u0110i\u1ec3m \u0111\u1ebfn \u0111\u01b0\u1ee3c m\u00e3 h\u00f3a t\u1eeb xa";
    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "M\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn tr\u00ean m\u1ea1ng \u0111\u01b0\u1ee3c giao nhi\u1ec7m v\u1ee5 cung c\u1ea5p v\u00e0 nh\u1eadn th\u00f4ng tin v\u1ec1 c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn v\u00e0 d\u1ecbch v\u1ee5 kh\u00e1c tr\u00ean m\u1ea1ng. B\u0103ng th\u00f4ng chia s\u1ebb t\u1ed1i thi\u1ec3u hi\u1ec7n t\u1ea1i cho m\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u01b0\u1ee3c coi l\u00e0 c\u00f3 kh\u1ea3 n\u0103ng th\u1ef1c hi\u1ec7n nhi\u1ec7m v\u1ee5 floodfill l\u00e0 128 KBytes/gi\u00e2y, m\u1eb7c d\u00f9 c\u00f3 th\u1ec3 ghi \u0111\u00e8 y\u00eau c\u1ea7u n\u00e0y v\u00e0 bu\u1ed9c m\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn l\u00e0 floodfill tr\u00ean trang <a href=/configadvanced>C\u1ea5u h\u00ecnh n\u00e2ng cao</a>. \u0110\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin, xem <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>t\u00e0i li\u1ec7u tr\u1ef1c tuy\u1ebfn</a>.";
