    t[8206] = "Started";
    t[8207] = "\u0110\u00e3 b\u1eaft \u0111\u1ea7u";
    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "B\u1ea5t c\u1ee9 khi n\u00e0o c\u00f3 th\u1ec3, n\u1ed9i dung \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng nhi\u1ec1u l\u1ea7n tr\u00ean trang web c\u1ee7a b\u1ea1n ph\u1ea3i \u0111\u01b0\u1ee3c t\u1ea3i t\u1eeb t\u1ec7p b\u00ean ngo\u00e0i ch\u1ee9 kh\u00f4ng ph\u1ea3i n\u1ed9i tuy\u1ebfn. N\u1ebfu b\u1ea1n \u0111ang s\u1eed d\u1ee5ng c\u00f9ng m\u1ed9t CSS tr\u00ean nhi\u1ec1u trang, h\u00e3y t\u1ea1o m\u1ed9t t\u1ec7p css ri\u00eang v\u00e0 t\u1ea3i t\u1ec7p \u0111\u00f3 v\u00e0o ph\u1ea7n <code>&lt;head&gt;</code> c\u1ee7a c\u00e1c trang c\u1ee7a b\u1ea1n. \u0110i\u1ec1u n\u00e0y s\u1ebd gi\u00fap qu\u1ea3n l\u00fd c\u00e1c c\u1eadp nh\u1eadt ki\u1ec3u d\u00e1ng cho trang web c\u1ee7a b\u1ea1n d\u1ec5 d\u00e0ng h\u01a1n v\u00e0 c\u0169ng s\u1ebd cho ph\u00e9p t\u1ec7p \u0111\u01b0\u1ee3c l\u01b0u v\u00e0o b\u1ed9 nh\u1edb \u0111\u1ec7m trong tr\u00ecnh duy\u1ec7t c\u1ee7a kh\u00e1ch truy c\u1eadp, d\u1eabn \u0111\u1ebfn nhu c\u1ea7u b\u0103ng th\u00f4ng tr\u00ean m\u00e1y ch\u1ee7 web c\u1ee7a b\u1ea1n \u00edt h\u01a1n v\u00e0 t\u1ea3i trang nhanh h\u01a1n cho kh\u00e1ch truy c\u1eadp.";
