    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "C\u1ea5u h\u00ecnh I2P+: \u1ea1ng, Firefox, Qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "N\u1ebfu b\u1ea1n cho r\u1eb1ng m\u00ecnh \u0111\u00e3 m\u1edf t\u01b0\u1eddng l\u1eeda v\u00e0 I2P v\u1eabn cho r\u1eb1ng b\u1ea1n \u0111\u00e3 \u0111\u01b0\u1ee3c t\u01b0\u1eddng l\u1eeda, h\u00e3y nh\u1edb r\u1eb1ng b\u1ea1n c\u00f3 th\u1ec3 c\u00f3 nhi\u1ec1u t\u01b0\u1eddng l\u1eeda, ch\u1eb3ng h\u1ea1n nh\u01b0 c\u1ea3 g\u00f3i ph\u1ea7n m\u1ec1m v\u00e0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ph\u1ea7n c\u1ee9ng b\u00ean ngo\u00e0i.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "T\u1eeb kh\u00f3a <i class=example>t\u1eeb ch\u1ed1i</i>.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "Ghi l\u1ea1i ng\u01b0\u1eddi gh\u00e9 th\u0103m th\u1ef1c hi\u1ec7n 90 ho\u1eb7c nhi\u1ec1u h\u01a1n k\u1ebft n\u1ed1i m\u1ed9t ph\u00fat";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "B\u1ea1n \u0111\u00e3 \u0111\u1ecbnh c\u1ea5u h\u00ecnh TCP g\u1eedi \u0111\u1ebfn, tuy nhi\u00ean c\u1ed5ng UDP c\u1ee7a b\u1ea1n \u0111\u01b0\u1ee3c t\u01b0\u1eddng l\u1eeda v\u00e0 do \u0111\u00f3 c\u00f3 kh\u1ea3 n\u0103ng c\u1ed5ng TCP c\u1ee7a b\u1ea1n c\u0169ng \u0111\u01b0\u1ee3c t\u01b0\u1eddng l\u1eeda.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "\u0110\u00e2y l\u00e0 s\u1ed1 l\u01b0\u1ee3ng \u0111\u1ed3ng nghi\u1ec7p m\u00e0 b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n s\u1ebd s\u1eed d\u1ee5ng \u0111\u1ec3 truy v\u1ea5n c\u01a1 s\u1edf d\u1eef li\u1ec7u m\u1ea1ng. Th\u00f4ng th\u01b0\u1eddng \u0111\u00e2y l\u00e0 c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn <i>l\u0169 l\u1ee5t</i> ch\u1ecbu tr\u00e1ch nhi\u1ec7m duy tr\u00ec to\u00e0n v\u1eb9n m\u1ea1ng. C\u00e1c \u0111\u1ed3ng nghi\u1ec7p t\u1ed1t c\u1ee7a b\u1ea1n \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb \u1edf ph\u1ea7n cu\u1ed1i trang <a href='/profiles'>Trang H\u1ed3 s\u01a1</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Qu\u1ea3n l\u00fd \u1ee9ng d\u1ee5ng web c\u1ee7a B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "G\u00f3i TCP \u0111i t\u1eeb c\u1ed5ng cao ng\u1eabu nhi\u00ean \u0111\u1ebfn c\u00e1c c\u1ed5ng TCP t\u00f9y \u00fd \u1edf xa.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Khi b\u1ea1n b\u1eaft \u0111\u1ea7u I2P, c\u00f3 th\u1ec3 m\u1ea5t v\u00e0i ph\u00fat \u0111\u1ec3 bootstrap (t\u00edch h\u1ee3p) b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n v\u00e0o m\u1ea1ng v\u00e0 t\u00ecm th\u00eam c\u00e1c \u0111\u1ed3ng nghi\u1ec7p, v\u00ec v\u1eady h\u00e3y ki\u00ean nh\u1eabn.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "Kh\u00f4ng c\u00f3 t\u1ec7p \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh. Vui l\u00f2ng ch\u1ecdn t\u1ec7p .zip ho\u1eb7c .su3 h\u1ee3p l\u1ec7 \u0111\u1ec3 Reseed t\u1eeb.";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
    t[8321] = "B\u1eadt t\u00ednh n\u0103ng C\u1eafm v\u00e0 Ch\u1ea1y \u0110a n\u0103ng (UPnP)";
    t[8322] = "Unknown Wizard page";
    t[8323] = "Trang Wizard kh\u00f4ng x\u00e1c \u0111\u1ecbnh";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "IPv6 Ch\u1ec9 NTCP, SSU, ng\u01b0\u1eddi gi\u1edbi thi\u1ec7u";
    t[8332] = "Messages sent to peer";
    t[8333] = "Tin nh\u1eafn \u0111\u01b0\u1ee3c g\u1eedi \u0111\u1ebfn \u0111\u1ed3ng nghi\u1ec7p";
    t[8334] = "Function";
    t[8335] = "Ch\u1ee9c n\u0103ng";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Tr\u00ean m\u1ea1ng I2P, c\u00e1c d\u1ecbch v\u1ee5 \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef t\u1eeb xa c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c truy c\u1eadp b\u1eb1ng c\u00e1ch s\u1eed d\u1ee5ng \u0111u\u00f4i \u0111\u1ecba ch\u1ec9 <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> trong \".b32.i2p\", m\u1ed9t <i>\u0111\u00edch</i> \u0111\u01b0\u1ee3c bi\u1ec3u th\u1ecb d\u01b0\u1edbi d\u1ea1ng <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> d\u00e0i chu\u1ed7i ho\u1eb7c th\u01b0\u1eddng xuy\u00ean h\u01a1n b\u1eb1ng c\u00e1ch s\u1eed d\u1ee5ng mi\u1ec1n .i2p. \u0110\u00edch I2P t\u01b0\u01a1ng \u0111\u01b0\u01a1ng v\u1edbi \u0111\u1ecba ch\u1ec9 IP v\u00e0 \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb tr\u00ean <a href='/i2ptunnel/edit?tunnel=3'>trang C\u1ea5u h\u00ecnh Tr\u00ecnh qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m</a>. B\u1ea1n c\u00f3 th\u1ec3 chia s\u1ebb \u0111\u1ecba ch\u1ec9 b32.i2p c\u1ee7a m\u00ecnh \u0111\u1ec3 cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c truy c\u1eadp v\u00e0o trang web c\u1ee7a b\u1ea1n cho \u0111\u1ebfn khi b\u1ea1n \u0111\u0103ng k\u00fd t\u00ean mi\u1ec1n .i2p c\u1ee7a ri\u00eang m\u00ecnh.";
