    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "\u0110\u1ec3 t\u1eaft danh s\u00e1ch th\u01b0 m\u1ee5c, h\u00e3y t\u00ecm m\u1ee5c nh\u1eadp cho <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> trong t\u1ec7p <code>base-context.xml</code>, n\u1eb1m trong <code>eepsite /contexts</code> (ngay ph\u00eda tr\u00ean th\u01b0 m\u1ee5c docroot) v\u00e0 thay \u0111\u1ed5i 'true' th\u00e0nh 'false' ngay b\u00ean d\u01b0\u1edbi. \u0110\u1ec3 \u00e1p d\u1ee5ng thay \u0111\u1ed5i ngay l\u1eadp t\u1ee9c, h\u00e3y d\u1eebng v\u00e0 kh\u1edfi \u0111\u1ed9ng l\u1ea1i \u1ee9ng d\u1ee5ng kh\u00e1ch <i>I2P Webserver</i> tr\u00ean <a href=/configclients>trang C\u1ea5u h\u00ecnh \u1ee9ng d\u1ee5ng kh\u00e1ch</a>. B\u1ea1n c\u0169ng c\u00f3 th\u1ec3 th\u1ea3 t\u1ec7p <code>index.html</code> tr\u1ed1ng v\u00e0o b\u1ea5t k\u1ef3 th\u01b0 m\u1ee5c n\u00e0o \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb \u0111\u1ec3 ch\u1eb7n danh s\u00e1ch th\u01b0 m\u1ee5c cho v\u1ecb tr\u00ed \u0111\u00f3.";
