    t[8466] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[8467] = "C\u00f3 th\u1ec3 v\u00f4 hi\u1ec7u h\u00f3a trong t\u1eadp tin <code>clients.config</code>. C\u0169ng c\u00f3 th\u1ec3 c\u1ea5u h\u00ecnh li\u00ean k\u1ebft v\u1edbi giao di\u1ec7n c\u1ee5 th\u1ec3 ho\u1eb7c t\u1ea5t c\u1ea3 c\u00e1c giao di\u1ec7n. N\u1ebfu b\u1ea1n l\u00e0m cho B\u1ed9 \u0111i\u1ec1u khi\u1ec3n router c\u00f3 s\u1eb5n tr\u00ean m\u1ea1ng, b\u1ea1n c\u00f3 th\u1ec3 mu\u1ed1n <a href=/configui#passwordheading>\u00e1p d\u1ee5ng m\u1eadt kh\u1ea9u truy c\u1eadp</a> \u0111\u1ec3 ng\u0103n ch\u1eb7n truy c\u1eadp kh\u00f4ng \u0111\u01b0\u1ee3c ph\u00e9p.";
