    t[8490] = "A group of tunnel entry points (leases) for a <i>destination</i>. Note: A 0-hop server tunnel will only have one lease, regardless of the number of tunnels configured.";
    t[8491] = "M\u1ed9t nh\u00f3m c\u00e1c \u0111i\u1ec3m v\u00e0o \u0111\u01b0\u1eddng h\u1ea7m (cho thu\u00ea) cho m\u1ed9t <i>\u0111\u00edch</i>. L\u01b0u \u00fd: \u0110\u01b0\u1eddng h\u1ea7m m\u00e1y ch\u1ee7 0 hop s\u1ebd ch\u1ec9 c\u00f3 m\u1ed9t h\u1ee3p \u0111\u1ed3ng thu\u00ea, b\u1ea5t k\u1ec3 s\u1ed1 l\u01b0\u1ee3ng \u0111\u01b0\u1eddng h\u1ea7m \u0111\u01b0\u1ee3c \u0111\u1ecbnh c\u1ea5u h\u00ecnh.";
