    t[8516] = "Configure the status of the I2P service at system startup. If disabled, the service can be launched manually.";
    t[8517] = "\u0110\u1ecbnh c\u1ea5u h\u00ecnh tr\u1ea1ng th\u00e1i c\u1ee7a d\u1ecbch v\u1ee5 I2P khi kh\u1edfi \u0111\u1ed9ng h\u1ec7 th\u1ed1ng. N\u1ebfu b\u1ecb t\u1eaft, d\u1ecbch v\u1ee5 c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c kh\u1edfi ch\u1ea1y theo c\u00e1ch th\u1ee7 c\u00f4ng.";
    t[8524] = "torrents";
    t[8525] = "torrent";
    t[8536] = "Job Queue";
    t[8537] = "H\u00e0ng \u0111\u1ee3i c\u00f4ng vi\u1ec7c";
    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "N\u1ebfu b\u1ea1n kh\u00f4ng s\u1eed d\u1ee5ng IE, c\u00f3 kh\u1ea3 n\u0103ng tr\u00ecnh duy\u1ec7t c\u1ee7a b\u1ea1n \u0111ang gi\u1ea3 d\u1ea1ng l\u00e0 IE; vui l\u00f2ng c\u1ea5u h\u00ecnh tr\u00ecnh duy\u1ec7t (ho\u1eb7c proxy) s\u1eed d\u1ee5ng chu\u1ed7i User Agent kh\u00e1c n\u1ebfu b\u1ea1n mu\u1ed1n truy c\u1eadp giao di\u1ec7n b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "C\u00f4ng c\u1ee5 t\u00ecm ki\u1ebfm Clearnet t\u1eadp trung v\u00e0o quy\u1ec1n ri\u00eang t\u01b0";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Nh\u1eadt k\u00fd</a> c\u00f3 th\u1ec3 gi\u00fap gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "C\u00e1c plugin \u0111\u01b0\u1ee3c k\u00fd v\u1edbi kh\u00f3a m\u1eadt m\u00e3 c\u1ee7a nh\u00e0 ph\u00e1t tri\u1ec3n l\u00e0 \u0111\u1ecbnh d\u1ea1ng \u0111\u01b0\u1ee3c \u0111\u1ec1 xu\u1ea5t, nh\u01b0ng n\u1ebfu b\u1ea1n mu\u1ed1n c\u00e0i \u0111\u1eb7t c\u00e1c plugin kh\u00f4ng d\u1ea5u (.zip), b\u1ea1n c\u00f3 th\u1ec3 \u0111\u1eb7t \u0111i\u1ec1u n\u00e0y th\u00e0nh TRUE. L\u01b0u \u00fd r\u1eb1ng b\u1ea1n v\u1eabn c\u00f3 th\u1ec3 g\u1eb7p s\u1ef1 c\u1ed1 \u0111ang c\u1ed1 g\u1eafng c\u00e0i \u0111\u1eb7t m\u1ed9t plugin kh\u00f4ng d\u1ea5u n\u1ebfu nh\u00e0 ph\u00e1t tri\u1ec3n \u0111\u00e3 bao g\u1ed3m c\u00e1c ki\u1ec3m tra b\u1ed5 sung trong quy tr\u00ecnh x\u00e2y d\u1ef1ng plugin.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "N\u1ebfu b\u1ea1n \u0111ang ch\u1ea1y c\u1ee5c b\u1ed9 m\u1ed9t phi\u00ean b\u1ea3n Tor \u0111\u1ed9c l\u1eadp, b\u1ea1n c\u00f3 th\u1ec3 s\u1eed d\u1ee5ng n\u00f3 b\u1eb1ng c\u00e1ch \u0111\u1ecbnh c\u1ea5u h\u00ecnh I2P \u0111\u1ec3 s\u1eed d\u1ee5ng: <i>Lo\u1ea1i proxy:</i> <code>SOCKS 5</code> <i>M\u00e1y ch\u1ee7:</i> <code >127.0.0.1</code> <i>C\u1ed5ng:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Ch\u1ecdn ng\u00f4n ng\u1eef s\u1ebd \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng cho b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn v\u00e0 c\u00e1c \u1ee9ng d\u1ee5ng web (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a >, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>ng\u01b0\u1eddi qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m</a>, v.v.). N\u1ebfu b\u1ea1n mu\u1ed1n thay \u0111\u1ed5i ng\u00f4n ng\u1eef trong t\u01b0\u01a1ng lai, thay \u0111\u1ed5i ch\u1ee7 \u0111\u1ec1 b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ho\u1eb7c \u0111\u1ecbnh c\u1ea5u h\u00ecnh m\u1eadt kh\u1ea9u \u0111\u1ec3 truy c\u1eadp b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n, b\u1ea1n c\u00f3 th\u1ec3 th\u1ef1c hi\u1ec7n vi\u1ec7c \u0111\u00f3 tr\u00ean <a href=/configui target=_blank rel=noreferrer>trang c\u1ea5u h\u00ecnh Giao di\u1ec7n ng\u01b0\u1eddi d\u00f9ng</ a>.";
