    t[9051] = "\u0111\u00e3 k\u1ebft th\u00fac {0} tr\u01b0\u1edbc";
    t[9052] = "Ready";
    t[9053] = "S\u1eb5n s\u00e0ng";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "\u0110\u00e2y l\u00e0 c\u00e1c d\u1ecbch v\u1ee5 \u0111\u1ecba ph\u01b0\u01a1ng do b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n cung c\u1ea5p. Ch\u00fang c\u00f3 th\u1ec3 l\u00e0 c\u00e1c kh\u00e1ch h\u00e0ng \u0111\u01b0\u1ee3c b\u1eaft \u0111\u1ea7u qua <a href='/i2ptunnelmgr'>Qu\u1ea3n l\u00fd \u0110\u01b0\u1eddng h\u1ea7m</a> ho\u1eb7c c\u00e1c ch\u01b0\u01a1ng tr\u00ecnh b\u00ean ngo\u00e0i k\u1ebft n\u1ed1i th\u00f4ng qua SAM, BOB ho\u1eb7c tr\u1ef1c ti\u1ebfp v\u1edbi I2CP. M\u1eb7c \u0111\u1ecbnh, h\u1ea7u h\u1ebft c\u00e1c d\u1ecbch v\u1ee5 kh\u00e1ch h\u00e0ng c\u1ee7a b\u1ea1n (th\u01b0 \u0111i\u1ec7n t\u1eed, proxy http, IRC) s\u1ebd chia s\u1ebb c\u00f9ng t\u1eadp \u0111\u01b0\u1eddng h\u1ea7m v\u00e0 \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea d\u01b0\u1edbi d\u1ea1ng <i>Kh\u00e1ch h\u00e0ng chia s\u1ebb</i> v\u00e0 <i>Kh\u00e1ch h\u00e0ng chia s\u1ebb(DSA)</i>, \u0111i\u1ec1u n\u00e0y t\u0103ng c\u01b0\u1eddng \u1ea9n danh b\u1eb1ng c\u00e1ch tr\u1ed9n l\u1eabn l\u01b0u l\u01b0\u1ee3ng t\u1eeb t\u1ea5t c\u1ea3 c\u00e1c d\u1ecbch v\u1ee5 chia s\u1ebb, v\u00e0 gi\u1ea3m thi\u1ec3u chi ph\u00ed c\u1ea7n thi\u1ebft \u0111\u1ec3 x\u00e2y d\u1ef1ng v\u00e0 duy tr\u00ec c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m. Tuy nhi\u00ean, n\u1ebfu b\u1ea1n g\u1eb7p s\u1ef1 c\u1ed1 \u0111\u01b0\u1eddng h\u1ea7m, t\u1ea5t c\u1ea3 c\u00e1c d\u1ecbch v\u1ee5 c\u1ee7a b\u1ea1n s\u1ebd ngh\u1ec9 ho\u1ea1t \u0111\u1ed9ng c\u00f9ng m\u1ed9t l\u00fac, do \u0111\u00f3 trong m\u1ed9t s\u1ed1 t\u00ecnh hu\u1ed1ng b\u1ea1n c\u00f3 th\u1ec3 mu\u1ed1n c\u1ea5u h\u00ecnh c\u00e1c d\u1ecbch v\u1ee5 kh\u00e1ch h\u00e0ng s\u1eed d\u1ee5ng ri\u00eang t\u1eadp \u0111\u01b0\u1eddng h\u1ea7m c\u1ee7a ch\u00fang. \u0110i\u1ec1u n\u00e0y c\u00f3 th\u1ec3 th\u1ef1c hi\u1ec7n b\u1eb1ng c\u00e1ch b\u1ecf ch\u1ecdn t\u00f9y ch\u1ecdn <i>Chia s\u1ebb \u0111\u01b0\u1eddng h\u1ea7m v\u1edbi c\u00e1c kh\u00e1ch h\u00e0ng kh\u00e1c\u2026</i> li\u1ec7t k\u00ea d\u01b0\u1edbi m\u1ee5c <i>Kh\u00e1ch h\u00e0ng chia s\u1ebb</i> tr\u00ean trang c\u1ea5u h\u00ecnh d\u1ecbch v\u1ee5 kh\u00e1ch h\u00e0ng li\u00ean quan trong Qu\u1ea3n l\u00fd \u0110\u01b0\u1eddng h\u1ea7m, sau \u0111\u00f3 b\u1ea1n c\u1ea7n kh\u1edfi \u0111\u1ed9ng l\u1ea1i d\u1ecbch v\u1ee5 kh\u00e1ch h\u00e0ng t\u1eeb trang <a href='/i2ptunnelmgr'>ch\u00ednh Qu\u1ea3n l\u00fd \u0110\u01b0\u1eddng h\u1ea7m</a>.";
