    t[9139] = "N\u1ebfu b\u1ea1n mu\u1ed1n b\u00e1o c\u00e1o m\u1ed9t l\u1ed7i, vui l\u00f2ng \u0111\u0103ng k\u00fd v\u00e9 tr\u00ean <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. \u0110\u1ed1i v\u1edbi c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn li\u00ean quan \u0111\u1ebfn l\u1eadp tr\u00ecnh vi\u00ean, vui l\u00f2ng truy c\u1eadp <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>di\u1ec5n \u0111\u00e0n ph\u00e1t tri\u1ec3n c\u1ee7a zzz</a> ho\u1eb7c gh\u00e9 th\u0103m <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>k\u00eanh ph\u00e1t tri\u1ec3n</a> tr\u00ean m\u1ea1ng IRC c\u1ee7a I2P.";
