    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "M\u1ed9t \u1ee9ng d\u1ee5ng CGI \u0111\u01a1n gi\u1ea3n nh\u1eadn t\u00ean mi\u1ec1n l\u00e0m tham s\u1ed1 v\u00e0 tr\u1ea3 v\u1ec1 301 ph\u00e2n lu\u1ed3ng \u0111\u1ebfn URL ch\u00ednh x\u00e1c v\u1edbi x\u00e2u <code>?i2paddresshelper=key</code> \u0111\u00ednh k\u00e8m. Proxy HTTP s\u1ebd di\u1ec5n gi\u1ea3i x\u00e2u \u0111\u00ednh k\u00e8m v\u00e0 s\u1eed d\u1ee5ng kh\u00f3a l\u00e0m \u0111\u00edch th\u1ef1c t\u1ebf. Th\u00eam v\u00e0o \u0111\u00f3, proxy s\u1ebd l\u01b0u tr\u1eef kh\u00f3a \u0111\u1ec3 tr\u1ee3 gi\u00fap \u0111\u1ecba ch\u1ec9 kh\u00f4ng c\u1ea7n thi\u1ebft cho \u0111\u1ebfn khi kh\u1edfi \u0111\u1ed9ng l\u1ea1i, v\u00e0 cung c\u1ea5p t\u00f9y ch\u1ecdn \u0111\u1ec3 th\u00eam \u0111\u1ecba ch\u1ec9 gi\u1ea3i quy\u1ebft v\u00e0o danh b\u1ea1.";
