    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "C\u1ed5ng ngo\u00e0i c\u1ee7a b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn cho ph\u00e9p giao ti\u1ebfp v\u1edbi c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c. B\u1ea1n n\u00ean \u0111\u1ecbnh c\u1ea5u h\u00ecnh t\u01b0\u1eddng l\u1eeda \u0111\u1ec3 cho ph\u00e9p l\u01b0u l\u01b0\u1ee3ng truy c\u1eadp v\u00e0o v\u00e0 ra tr\u00ean c\u1ed5ng n\u00e0y nh\u1eb1m t\u1ed1i \u01b0u h\u00f3a hi\u1ec7u su\u1ea5t c\u1ee7a b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn tr\u00ean m\u1ea1ng.";
    t[9328] = "Bulk Thresholds";
    t[9329] = "Ng\u01b0\u1ee1ng H\u00e0ng lo\u1ea1t";
