    t[9350] = "Good Lookups";
    t[9351] = "Tra c\u1ee9u t\u1ed1t";
    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Reseeding l\u00e0 quy tr\u00ecnh bootstrapping \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng \u0111\u1ec3 t\u00ecm c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c khi b\u1ea1n c\u00e0i \u0111\u1eb7t I2P l\u1ea7n \u0111\u1ea7u ti\u00ean ho\u1eb7c khi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n c\u00f3 qu\u00e1 \u00edt t\u00e0i li\u1ec7u tham kh\u1ea3o b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u00f2n l\u1ea1i. C\u00e1c c\u00e0i \u0111\u1eb7t m\u1eb7c \u0111\u1ecbnh s\u1ebd ho\u1ea1t \u0111\u1ed9ng cho h\u1ea7u h\u1ebft m\u1ecdi ng\u01b0\u1eddi. Ch\u1ec9 thay \u0111\u1ed5i nh\u1eefng \u0111i\u1ec1u n\u00e0y n\u1ebfu HTTPS b\u1ecb ch\u1eb7n b\u1edfi t\u01b0\u1eddng l\u1eeda h\u1ea1n ch\u1ebf v\u00e0 Reseed \u0111\u00e3 th\u1ea5t b\u1ea1i.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Thi\u1ebft l\u1eadp n\u00e0y, khi \u0111\u01b0\u1ee3c b\u1eadt, s\u1ebd s\u1eeda \u0111\u1ed5i \u0111\u1ed9 tr\u1ec5 ph\u1ea3n h\u1ed3i ng\u1eabu nhi\u00ean t\u1ed1i \u0111a \u0111\u01b0\u1ee3c gi\u1edbi thi\u1ec7u cho c\u00e1c m\u00e1y ch\u1ee7 cho ph\u00e9p ping, n\u1ebfu <code>i2p.streaming.enablePongDelay</code> c\u0169ng \u0111\u01b0\u1ee3c b\u1eadt. Tr\u1eeb khi r\u00f5 r\u00e0ng \u0111\u1eb7t, gi\u00e1 tr\u1ecb m\u1eb7c \u0111\u1ecbnh l\u00e0 50ms s\u1ebd \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng.";
