    t[9467] = "\u0110\u00e2y c\u00f3 th\u1ec3 l\u00e0 l\u1ed7i t\u1ea1m th\u1eddi n\u1ebfu ch\u01b0\u01a1ng tr\u00ecnh kh\u00e1c kh\u00f4ng c\u00f2n s\u1eed d\u1ee5ng c\u1ed5ng n\u00e0y n\u1eefa.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Theo m\u1eb7c \u0111\u1ecbnh, b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P+ c\u1ee7a b\u1ea1n s\u1ebd \u0111\u00f3ng g\u00f3p v\u00e0o m\u1ea1ng b\u1eb1ng c\u00e1ch \u0111\u1ecbnh tuy\u1ebfn l\u01b0u l\u01b0\u1ee3ng truy c\u1eadp n\u1ed9i b\u1ed9 \u0111\u01b0\u1ee3c m\u00e3 h\u00f3a hai \u0111\u1ea7u cho c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c, \u0111\u01b0\u1ee3c g\u1ecdi l\u00e0 <i>s\u1ef1 tham gia</i>. Vi\u1ec7c tham gia b\u0103ng th\u00f4ng s\u1ebd c\u1ea3i thi\u1ec7n m\u1ee9c \u0111\u1ed9 \u1ea9n danh c\u1ee7a t\u1ea5t c\u1ea3 ng\u01b0\u1eddi d\u00f9ng tr\u00ean m\u1ea1ng v\u00e0 t\u1ed1i \u0111a h\u00f3a t\u1ed1c \u0111\u1ed9 t\u1ea3i xu\u1ed1ng c\u1ee7a b\u1ea1n.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "C\u00e0i \u0111\u1eb7t n\u00e0y cho ph\u00e9p c\u1ea5u h\u00ecnh c\u1ee7a c\u00e1c m\u00e1y ch\u1ee7 NTP thay th\u1ebf c\u1ea7n thi\u1ebft \u0111\u1ec3 \u0111\u1ea3m b\u1ea3o r\u1eb1ng b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n duy tr\u00ec th\u1eddi gian \u0111\u1ed3ng h\u1ed3 ch\u00ednh x\u00e1c. [M\u1eb7c \u0111\u1ecbnh l\u00e0 0.pool.ntp.org, 1.pool.ntp.org, 2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "T\u1ed1i \u01b0u h\u00f3a h\u00ecnh \u1ea3nh c\u1ee7a b\u1ea1n";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "L\u01b0u \u00fd r\u1eb1ng ng\u01b0\u1eddi l\u1eadp h\u1ed3 s\u01a1 d\u1ef1a v\u00e0o vi\u1ec7c s\u1eed d\u1ee5ng \u0111\u01b0\u1eddng h\u1ea7m m\u00e1y kh\u00e1ch b\u1ec1n v\u1eefng \u0111\u1ec3 l\u1eadp h\u1ed3 s\u01a1 ch\u00ednh x\u00e1c cho c\u00e1c \u0111\u1ed3ng nghi\u1ec7p.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "N\u1ebfu b\u1ea1n v\u1ed9i v\u00e0ng kh\u00f4ng th\u1ec3 \u0111\u1ee3i v\u00e0i gi\u1edd, b\u1ea1n c\u00f3 th\u1ec3 b\u1ea3o m\u1ecdi ng\u01b0\u1eddi s\u1eed d\u1ee5ng d\u1ecbch v\u1ee5 \u0111\u1ecbnh h\u01b0\u1edbng l\u1ea1i \u0111\u1ecba ch\u1ec9 tr\u1ee3 gi\u00fap \"nh\u1ea3y\". Th\u01b0\u1eddng d\u1ecbch v\u1ee5 n\u00e0y s\u1ebd ho\u1ea1t \u0111\u1ed9ng trong v\u00e0i ph\u00fat k\u1ec3 t\u1eeb khi b\u1ea1n \u0111\u0103ng k\u00fd t\u00ean mi\u1ec1n c\u1ee7a m\u00ecnh tr\u00ean c\u00f9ng m\u1ed9t trang. H\u00e3y ki\u1ec3m tra tr\u01b0\u1edbc b\u1eb1ng c\u00e1ch nh\u1eadp <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> v\u00e0o tr\u00ecnh duy\u1ec7t c\u1ee7a b\u1ea1n. Khi \u0111\u00e3 ho\u1ea1t \u0111\u1ed9ng, b\u1ea1n c\u00f3 th\u1ec3 b\u1ea3o m\u1ecdi ng\u01b0\u1eddi s\u1eed d\u1ee5ng d\u1ecbch v\u1ee5 n\u00e0y.";
