    t[9621] = "C\u00e1c m\u1ea1ng ngang h\u00e0ng k\u1ebft n\u1ed1i nhanh \u0111\u00e3 bi\u1ebft";
    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "C\u00e1c \u0111\u01b0\u1eddng h\u1ea7m \u0111\u01b0\u1ee3c x\u00e2y d\u1ef1ng b\u1edfi c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u00e1c qua b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n. S\u1ed1 l\u01b0\u1ee3ng n\u00e0y c\u00f3 th\u1ec3 thay \u0111\u1ed5i r\u1ea5t nhi\u1ec1u t\u00f9y thu\u1ed9c v\u00e0o nhu c\u1ea7u m\u1ea1ng, b\u0103ng th\u00f4ng chia s\u1ebb c\u1ee7a b\u1ea1n v\u00e0 l\u01b0u l\u01b0\u1ee3ng \u0111\u1ecba ph\u01b0\u01a1ng. Ph\u01b0\u01a1ng ph\u00e1p \u0111\u01b0\u1ee3c \u0111\u1ec1 xu\u1ea5t \u0111\u1ec3 h\u1ea1n ch\u1ebf \u0111\u01b0\u1eddng h\u1ea7m tham gia l\u00e0 thay \u0111\u1ed5i ph\u1ea7n tr\u0103m chia s\u1ebb tr\u00ean trang <a href='/config'>C\u1ea5u h\u00ecnh B\u0103ng th\u00f4ng</a>. B\u1ea1n c\u00f3 th\u1ec3 gi\u1edbi h\u1ea1n s\u1ed1 l\u01b0\u1ee3ng t\u1ed5ng th\u1ec3 b\u1eb1ng c\u00e1ch \u0111\u1eb7t <code> router.maxParticipatingTunnels=nnn </code> tr\u00ean trang <a href='/configadvanced'>C\u1ea5u h\u00ecnh N\u00e2ng cao</a>. <a href='/configstats#tunnel.participatingTunnels'>[K\u00edch ho\u1ea1t bi\u1ec3u \u0111\u1ed3]</a>.";
