    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "\u0110\u1ec3 \u0111\u1ecbnh c\u1ea5u h\u00ecnh m\u00e1y ch\u1ee7 web thay th\u1ebf \u0111\u1ec3 s\u1eed d\u1ee5ng tr\u00ean I2P, b\u1ea1n c\u00f3 th\u1ec3 s\u1eed d\u1ee5ng \u0111\u01b0\u1eddng h\u1ea7m m\u00e1y ch\u1ee7 web hi\u1ec7n c\u00f3 v\u00e0 <a href=/configclients>t\u1eaft m\u00e1y ch\u1ee7 web m\u1eb7c \u0111\u1ecbnh</a> ch\u1ea1y ho\u1eb7c t\u1ea1o \u0111\u01b0\u1eddng h\u1ea7m M\u00e1y ch\u1ee7 HTTP m\u1edbi trong <a href= /i2ptunnelmgr>Tr\u00ecnh qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m</a>. \u0110\u1ea3m b\u1ea3o r\u1eb1ng <i>c\u1ed5ng nghe</i> c\u1ee7a m\u00e1y ch\u1ee7 web c\u0169ng \u0111\u01b0\u1ee3c \u0111\u1ecbnh c\u1ea5u h\u00ecnh trong c\u00e0i \u0111\u1eb7t Tr\u00ecnh qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m. V\u00ed d\u1ee5: n\u1ebfu m\u00e1y ch\u1ee7 web c\u1ee7a b\u1ea1n \u0111ang nghe theo m\u1eb7c \u0111\u1ecbnh tr\u00ean \u0111\u1ecba ch\u1ec9 127.0.0.1 c\u1ed5ng 80, b\u1ea1n c\u0169ng c\u1ea7n \u0111\u1ea3m b\u1ea3o r\u1eb1ng <i>C\u1ed5ng \u0111\u00edch</i> trong trang c\u00e0i \u0111\u1eb7t Tr\u00ecnh qu\u1ea3n l\u00fd \u0111\u01b0\u1eddng h\u1ea7m cho d\u1ecbch v\u1ee5 c\u0169ng \u0111\u01b0\u1ee3c \u0111\u1ecbnh c\u1ea5u h\u00ecnh th\u00e0nh c\u1ed5ng 80.";
