    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "M\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P th\u01b0\u1eddng ch\u1ec9 c\u1ea7n \u0111\u01b0\u1ee3c gieo h\u1ea1t m\u1ed9t l\u1ea7n \u0111\u1ec3 tham gia m\u1ea1ng l\u1ea7n \u0111\u1ea7u ti\u00ean. Tuy nhi\u00ean, n\u1ebfu b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ch\u1ea1y trong m\u1ed9t th\u1eddi gian d\u00e0i m\u00e0 kh\u00f4ng c\u00f3 k\u1ebft n\u1ed1i m\u1ea1ng th\u00ec c\u0169ng c\u00f3 th\u1ec3 c\u1ea7n ph\u1ea3i c\u00e0i \u0111\u1eb7t l\u1ea1i. Vi\u1ec7c gieo h\u1ea1t l\u1ea1i li\u00ean quan \u0111\u1ebfn vi\u1ec7c t\u00ecm n\u1ea1p nhi\u1ec1u t\u1ec7p \"RouterInfo\" (\u0111\u01b0\u1ee3c g\u00f3i th\u00e0nh t\u1ec7p zip \u0111\u00e3 k\u00fd) t\u1eeb \u00edt nh\u1ea5t hai URL m\u00e1y ch\u1ee7 \u0111\u01b0\u1ee3c x\u00e1c \u0111\u1ecbnh tr\u01b0\u1edbc \u0111\u01b0\u1ee3c ch\u1ecdn t\u1eeb m\u1ed9t nh\u00f3m m\u00e1y ch\u1ee7 HTTPS Clearnet do t\u00ecnh nguy\u1ec7n vi\u00ean \u0111i\u1ec1u h\u00e0nh.";
