    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Danh s\u00e1ch c\u00e1c n\u01b0\u1edbc c\u00f3 d\u1ef1a tr\u00ean <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>B\u00e1o c\u00e1o T\u1ef1 do Th\u1ebf gi\u1edbi</a> v\u1edbi uy t\u00edn k\u00e9m v\u1ec1 t\u1ef1 do d\u00e2n s\u1ef1. Danh s\u00e1ch n\u00e0y \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng \u0111\u1ec3 \u0111\u1eb7t c\u00e1c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ho\u1ea1t \u0111\u1ed9ng t\u1ea1i c\u00e1c n\u01b0\u1edbc \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh v\u00e0o ch\u1ebf \u0111\u1ed9 <i>\u1ea8n</i> nh\u1eb1m t\u0103ng c\u01b0\u1eddng b\u1ea3o m\u1eadt cho ng\u01b0\u1eddi d\u00f9ng. C\u00e1c n\u01b0\u1edbc \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh nghi\u00eam ng\u1eb7t bao g\u1ed3m: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, C\u1ed9ng h\u00f2a Trung Phi, Chad, Trung Qu\u1ed1c, Cuba, C\u1ed9ng h\u00f2a D\u00e2n ch\u1ee7 Congo, Ai C\u1eadp, Guinea X\u00edch \u0110\u1ea1o, Eritrea, Ethiopia, Iran, Kazakhstan, L\u00e0o, Libya, Myanmar, B\u1eafc Tri\u1ec1u Ti\u00ean, L\u00e3nh th\u1ed5 Palestine, Rwanda, \u1ea2 R\u1eadp X\u00ea \u00dat, Somalia, Nam Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Th\u00e1i Lan, Th\u1ed5 Nh\u0129 K\u1ef3, Turkmenistan, Venezuela, C\u00e1c Ti\u1ec3u v\u01b0\u01a1ng qu\u1ed1c \u1ea2 R\u1eadp Th\u1ed1ng nh\u1ea5t, Uzbekistan, Sahara T\u00e2y, Yemen.";
