    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "C\u00e1c d\u1ecbch v\u1ee5 c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef tr\u00ean nhi\u1ec1u b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn, b\u1eb1ng c\u00e1ch chia s\u1ebb c\u00f9ng m\u1ed9t kh\u00f3a ri\u00eang cho \u0111\u00edch. Multihoming c\u00f3 th\u1ec3 t\u0103ng c\u01b0\u1eddng h\u01a1n n\u1eefa b\u1ea3o m\u1eadt v\u00e0 t\u00ednh \u1ed5n \u0111\u1ecbnh c\u1ee7a m\u00e1y ch\u1ee7 b\u1eb1ng c\u00e1ch cung c\u1ea5p d\u1ef1 ph\u00f2ng; N\u1ebfu m\u1ed9t m\u00e1y ch\u1ee7 \u0111\u01b0\u1ee3c \u0111a d\u1ea1ng, khi m\u1ed9t m\u00e1y ch\u1ee7 trong nh\u00f3m \u0111i ngo\u1ea1i tuy\u1ebfn, d\u1ecbch v\u1ee5 \u0111\u01b0\u1ee3c cung c\u1ea5p s\u1ebd v\u1eabn c\u00f3 s\u1eb5n, khi\u1ebfn vi\u1ec7c t\u01b0\u01a1ng quan th\u1eddi gian ng\u1eebng ho\u1ea1t \u0111\u1ed9ng c\u1ee7a m\u00e1y ch\u1ee7 v\u1edbi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn s\u1ebd tr\u1edf n\u00ean kh\u00f3 kh\u0103n h\u01a1n.";
