    t[11007] = "\u0110\u1eb7t m\u1eadt kh\u1ea9u c\u1ea7n thi\u1ebft \u0111\u1ec3 truy c\u1eadp d\u1ecbch v\u1ee5 n\u00e0y";
    t[11008] = "Numeric definition of the number of connection attempts in the period specified (in seconds) e.g. <i class=example>15/5</i>, <i class=example>60/60</i> etc.";
    t[11009] = "\u0110\u1ecbnh ngh\u0129a b\u1eb1ng s\u1ed1 v\u1ec1 s\u1ed1 l\u1ea7n th\u1eed k\u1ebft n\u1ed1i trong kho\u1ea3ng th\u1eddi gian \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh (t\u00ednh b\u1eb1ng gi\u00e2y), v\u00ed d\u1ee5: <i class=example>15/5</i>, <i class=example>60/60</i>, v.v.";
    t[11018] = "32bit host OS running with less than 4 detected cores";
    t[11019] = "H\u1ec7 \u0111i\u1ec1u h\u00e0nh m\u00e1y ch\u1ee7 32 bit ch\u1ea1y v\u1edbi \u00edt h\u01a1n 4 l\u00f5i \u0111\u01b0\u1ee3c ph\u00e1t hi\u1ec7n";
    t[11020] = "Cannot copy plugin to directory {0}";
    t[11021] = "Kh\u00f4ng th\u1ec3 sao ch\u00e9p plugin v\u00e0o th\u01b0 m\u1ee5c {0}";
    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "M\u1eb7c \u0111\u1ecbnh, I2P s\u1ebd s\u1eed d\u1ee5ng tr\u00ecnh duy\u1ec7t m\u1eb7c \u0111\u1ecbnh c\u1ee7a h\u1ec7 th\u1ed1ng \u0111\u1ec3 kh\u1edfi ch\u1ea1y khi kh\u1edfi \u0111\u1ed9ng. N\u1ebfu b\u1ea1n mu\u1ed1n ch\u1ec9 \u0111\u1ecbnh tr\u00ecnh duy\u1ec7t thay th\u1ebf, b\u1ea1n c\u1ea7n ch\u1ec9nh s\u1eeda t\u1ec7p router.config c\u1ee7a b\u1ea1n (ho\u1eb7c trang <a href=/configadvanced>C\u1ea5u h\u00ecnh N\u00e2ng cao</a> n\u1ebfu b\u1ea1n \u0111\u00e3 k\u00edch ho\u1ea1t ch\u1ebf \u0111\u1ed9 b\u1ea3ng \u0111i\u1ec1u khi\u1ec3n n\u00e2ng cao) v\u00e0 th\u00eam d\u00f2ng c\u1ea5u h\u00ecnh m\u1edbi <code>routerconsole.browser=/\u0111\u01b0\u1eddng d\u1eabn/t\u1edbi/tr\u00ecnh duy\u1ec7t</code> ho\u1eb7c <code>routerconsole.browser=\\\u0111\u01b0\u1eddng d\u1eabn\\t\u1edbi\\tr\u00ecnh duy\u1ec7t.exe</code> n\u1ebfu s\u1eed d\u1ee5ng Windows, thay th\u1ebf <code>\\\u0111\u01b0\u1eddng d\u1eabn\\t\u1edbi\\tr\u00ecnh duy\u1ec7t</code> b\u1eb1ng v\u1ecb tr\u00ed c\u1ee7a tr\u00ecnh duy\u1ec7t b\u1ea1n mu\u1ed1n s\u1eed d\u1ee5ng. L\u01b0u \u00fd: N\u1ebfu \u0111\u01b0\u1eddng d\u1eabn t\u1edbi tr\u00ecnh duy\u1ec7t b\u1ea1n ch\u1ecdn ch\u1ee9a kho\u1ea3ng tr\u1eafng, b\u1ea1n c\u00f3 th\u1ec3 c\u1ea7n bao trong d\u1ea5u ngo\u1eb7c k\u00e9p nh\u01b0 <code>routerconsole.browser=\"C:\\Ch\u01b0\u01a1ng tr\u00ecnh t\u1ec7p\\Mozilla\\Firefox.exe\"</code>";
