    t[11092] = "Retransmitted packets";
    t[11093] = "G\u00f3i \u0111\u01b0\u1ee3c truy\u1ec1n l\u1ea1i";
    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "C\u00e0i \u0111\u1eb7t n\u00e0y (t\u00ednh b\u1eb1ng gi\u1edd) cho ph\u00e9p b\u1ea1n \u0111\u1ecbnh c\u1ea5u h\u00ecnh th\u1ee7 c\u00f4ng m\u1ed9t b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn gi\u1edbi h\u1ea1n theo th\u1ee9 t\u1ef1 \u0111\u1ec3 n\u00f3 \u0111\u01b0\u1ee3c ki\u1ec3m tra b\u1edfi c\u00f4ng vi\u1ec7c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn l\u00e0m m\u1edbi. Theo m\u1eb7c \u0111\u1ecbnh, tu\u1ed5i c\u1ee7a RouterInfo tr\u01b0\u1edbc khi l\u00e0m m\u1edbi quy m\u00f4 theo k\u00edch th\u01b0\u1edbc c\u1ee7a NetDb, t\u0103ng khi NetDb t\u0103ng k\u00edch th\u01b0\u1edbc. Gi\u00e1 tr\u1ecb 0 s\u1ebd bu\u1ed9c c\u00f4ng vi\u1ec7c l\u00e0m m\u1edbi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn ph\u1ea3i ki\u1ec3m tra m\u1ecdi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn trong NetDb, b\u1ea5t k\u1ec3 tu\u1ed5i t\u00e1c.";
    t[11112] = "Show all members of the {0} family in NetDb";
    t[11113] = "Hi\u1ec3n th\u1ecb t\u1ea5t c\u1ea3 c\u00e1c th\u00e0nh vi\u00ean c\u1ee7a h\u1ecd {0} trong NetDb";
    t[11120] = "Failed to install plugin in {0}";
    t[11121] = "Kh\u00f4ng c\u00e0i \u0111\u1eb7t \u0111\u01b0\u1ee3c plugin trong {0}";
    t[11124] = "Install from file failed";
    t[11125] = "C\u00e0i \u0111\u1eb7t t\u1eeb t\u1ec7p kh\u00f4ng th\u00e0nh c\u00f4ng";
    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "M\u1ed9t \u1ee9ng d\u1ee5ng web I2P qu\u1ea3n l\u00fd \u0111\u00edch d\u1ecbch v\u1ee5 cho m\u1ea1ng, \u00e1nh x\u1ea1 b\u0103m B64 th\u00e0nh c\u00e1c t\u00ean d\u1ec5 \u0111\u1ecdc. \u0110\u00edch c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c th\u00eam th\u1ee7 c\u00f4ng ho\u1eb7c qua \u0111\u0103ng k\u00fd t\u1ec7p hosts.txt. C\u0169ng \u0111\u01b0\u1ee3c g\u1ecdi l\u00e0 SusiDNS. \u0110\u1ec3 bi\u1ebft th\u00eam th\u00f4ng tin, h\u00e3y xem <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>t\u00e0i li\u1ec7u tr\u1ef1c tuy\u1ebfn</a>.";
    t[11130] = "Events per period";
    t[11131] = "S\u1ef1 ki\u1ec7n m\u1ed7i k\u1ef3";
    t[11134] = "How long before peer gives up resending lost packet";
    t[11135] = "Bao l\u00e2u tr\u01b0\u1edbc khi peer t\u1eeb b\u1ecf vi\u1ec7c g\u1eedi l\u1ea1i g\u00f3i b\u1ecb m\u1ea5t";
    t[11140] = "Advanced configuration settings";
    t[11141] = "C\u00e0i \u0111\u1eb7t n\u00e2ng cao";
    t[11142] = "Banning will prevent the participation of this peer in tunnels you create.";
    t[11143] = "Vi\u1ec7c c\u1ea5m s\u1ebd ng\u0103n ch\u1eb7n s\u1ef1 tham gia c\u1ee7a ng\u01b0\u1eddi ngang h\u00e0ng n\u00e0y v\u00e0o c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m m\u00e0 b\u1ea1n t\u1ea1o.";
    t[11148] = "UDP Port In Use";
    t[11149] = "C\u1ed5ng UDP \u0111ang \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng";
    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "M\u1ed9t h\u1ea7m \u0111\u1ebfn m\u1ea1ng IRC server ch\u00ednh b\u00ean trong I2P, Irc2P, s\u1ebd \u0111\u01b0\u1ee3c t\u1ea1o khi c\u00e0i \u0111\u1eb7t I2P (xem <a href=/i2ptunnelmgr>Tr\u00ecnh qu\u1ea3n l\u00fd H\u1ea7m</a>), v\u00e0 s\u1ebd t\u1ef1 \u0111\u1ed9ng kh\u1edfi ch\u1ea1y khi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn I2P kh\u1edfi \u0111\u1ed9ng. \u0110\u1ec3 k\u1ebft n\u1ed1i \u0111\u1ebfn n\u00f3, b\u1ea3o kh\u00e1ch h\u1ed9 IRC c\u1ee7a b\u1ea1n k\u1ebft n\u1ed1i \u0111\u1ebfn m\u00e1y ch\u1ee7: <code>127.0.0.1</code> c\u1ed5ng: <code>6668</code>.";
