    t[11197] = "\u0110\u00edch y\u00eau c\u1ea7u tra c\u1ee9u m\u1eadt kh\u1ea9u";
    t[11200] = "Please configure a TCP host and port on the Network Configuration page or enable UDP.";
    t[11201] = "Vui l\u00f2ng \u0111\u1ecbnh c\u1ea5u h\u00ecnh m\u00e1y ch\u1ee7 v\u00e0 c\u1ed5ng TCP tr\u00ean trang C\u1ea5u h\u00ecnh m\u1ea1ng ho\u1eb7c b\u1eadt UDP.";
    t[11212] = "Outbound Endpoint";
