    t[11217] = "Ch\u1ec9 t\u1ea3i xu\u1ed1ng v\u00e0 x\u00e1c minh";
    t[11218] = "Manual Reseed";
    t[11219] = "Reseed th\u1ee7 c\u00f4ng";
    t[11226] = "peers";
    t[11227] = "\u0111\u1ed3ng nghi\u1ec7p";
    t[11230] = "Can be enabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If both http and https are enabled, automatic redirection to https is enabled by default. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[11231] = "C\u00f3 th\u1ec3 k\u00edch ho\u1ea1t trong t\u1eadp tin <code>clients.config</code>. C\u0169ng c\u00f3 th\u1ec3 c\u1ea5u h\u00ecnh li\u00ean k\u1ebft v\u1edbi giao di\u1ec7n c\u1ee5 th\u1ec3 ho\u1eb7c t\u1ea5t c\u1ea3 c\u00e1c giao di\u1ec7n. N\u1ebfu k\u00edch ho\u1ea1t c\u1ea3 http v\u00e0 https, chuy\u1ec3n h\u01b0\u1edbng t\u1ef1 \u0111\u1ed9ng sang https s\u1ebd \u0111\u01b0\u1ee3c k\u00edch ho\u1ea1t m\u1eb7c \u0111\u1ecbnh. N\u1ebfu l\u00e0m cho B\u1ed9 \u0111i\u1ec1u khi\u1ec3n router c\u00f3 s\u1eb5n tr\u00ean m\u1ea1ng, b\u1ea1n c\u00f3 th\u1ec3 mu\u1ed1n <a href=/configui#passwordheading>\u00e1nh m\u1eadt kh\u1ea9u truy c\u1eadp</a> \u0111\u1ec3 ng\u0103n ch\u1eb7n truy c\u1eadp kh\u00f4ng \u0111\u01b0\u1ee3c ph\u00e9p.";
    t[11236] = "Tunnel identity";
    t[11237] = "Nh\u1eadn d\u1ea1ng \u0111\u01b0\u1eddng h\u1ea7m";
    t[11242] = "Most of the options on the Network Configuration page are for special situations, for example where UPnP does not work correctly, or a firewall not under your control is doing harm.";
    t[11243] = "H\u1ea7u h\u1ebft c\u00e1c t\u00f9y ch\u1ecdn tr\u00ean trang C\u1ea5u h\u00ecnh M\u1ea1ng d\u00e0nh cho c\u00e1c tr\u01b0\u1eddng h\u1ee3p \u0111\u1eb7c bi\u1ec7t, v\u00ed d\u1ee5 nh\u01b0 UPnP kh\u00f4ng ho\u1ea1t \u0111\u1ed9ng ch\u00ednh x\u00e1c, ho\u1eb7c m\u1ed9t b\u1ee9c t\u01b0\u1eddng l\u1eeda kh\u00f4ng n\u1eb1m d\u01b0\u1edbi s\u1ef1 ki\u1ec3m so\u00e1t c\u1ee7a b\u1ea1n g\u00e2y h\u1ea1i.";
