    t[12026] = "I2P FAQ";
    t[12027] = "C\u00e2u h\u1ecfi th\u01b0\u1eddng g\u1eb7p v\u1ec1 I2P";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "N\u1ebfu di chu\u1ed9t qua ti\u00eau \u0111\u1ec1 <i>Th\u00f4ng tin B\u1ed9 \u0111\u1ecbnh tuy\u1ebfn</i>, danh t\u00ednh b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn b\u1ecb c\u1eaft ng\u1eafn c\u1ee7a b\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb (b\u1ed1n k\u00fd t\u1ef1 \u0111\u1ea7u ti\u00ean (24 bit) c\u1ee7a hash b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn Base64 c\u00f3 44 k\u00fd t\u1ef1 (256 bit)). To\u00e0n b\u1ed9 hash \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb tr\u00ean <a href='netdb?r=.'>b\u1ea3n ghi C\u01a1 s\u1edf d\u1eef li\u1ec7u M\u1ea1ng</a> c\u1ee7a b\u1ea1n. Kh\u00f4ng bao gi\u1edd ti\u1ebft l\u1ed9 th\u00f4ng tin n\u00e0y cho b\u1ea5t c\u1ee9 ai, v\u00ec danh t\u00ednh b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn c\u1ee7a b\u1ea1n l\u00e0 duy nh\u1ea5t li\u00ean k\u1ebft v\u1edbi \u0111\u1ecba ch\u1ec9 IP c\u1ee7a b\u1ea1n trong c\u01a1 s\u1edf d\u1eef li\u1ec7u m\u1ea1ng.";
