    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "C\u00e0i \u0111\u1eb7t n\u00e0y x\u00e1c \u0111\u1ecbnh s\u1ed1 l\u01b0\u1ee3ng th\u00f9ng NETDB DHT C\u00f4ng vi\u1ec7c kh\u00e1m ph\u00e1 ngang h\u00e0ng s\u1ebd tham chi\u1ebfu khi ch\u1ea1y. Theo m\u1eb7c \u0111\u1ecbnh, s\u1ed1 l\u01b0\u1ee3ng th\u00f9ng \u0111\u1ec3 kh\u00e1m ph\u00e1 s\u1ebd thay \u0111\u1ed5i t\u00f9y thu\u1ed9c v\u00e0o vi\u1ec7c b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u00e3 ch\u1ea1y trong h\u01a1n m\u1ed9t gi\u1edd, n\u1ebfu b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn b\u1ecb \u1ea9n hay trong t\u1ea7ng b\u0103ng th\u00f4ng 'K' v\u00e0 s\u1ed1 l\u01b0\u1ee3ng b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn \u0111\u00e3 bi\u1ebft.";
    t[12186] = "threat points";
    t[12187] = "\u0111i\u1ec3m \u0111e d\u1ecda";
    t[12194] = "Failed to stop systray";
    t[12195] = "Kh\u00f4ng d\u1eebng \u0111\u01b0\u1ee3c h\u1ec7 th\u1ed1ng";
    t[12196] = "Update failed";
    t[12197] = "C\u1eadp nh\u1eadt kh\u00f4ng th\u00e0nh c\u00f4ng";
    t[12198] = "Hostname Registration";
    t[12199] = "\u0110\u0103ng k\u00fd t\u00ean m\u00e1y ch\u1ee7";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "N\u1ebfu s\u1ed1 l\u01b0\u1ee3ng \u0111\u1ed3ng nghi\u1ec7p \u0111\u00e3 bi\u1ebft gi\u1ea3m xu\u1ed1ng d\u01b0\u1edbi 50, I2P s\u1ebd c\u1ed1 g\u1eafng t\u1ef1 \u0111\u1ed9ng kh\u1edfi \u0111\u1ed9ng l\u1ea1i. N\u1ebfu n\u1ed7 l\u1ef1c gieo l\u1ea1i kh\u00f4ng th\u00e0nh c\u00f4ng, m\u1ed9t th\u00f4ng b\u00e1o s\u1ebd xu\u1ea5t hi\u1ec7n trong thanh b\u00ean v\u1edbi t\u00f9y ch\u1ecdn gieo h\u1ea1t l\u1ea1i theo c\u00e1ch th\u1ee7 c\u00f4ng. N\u1ed7 l\u1ef1c gieo l\u1ea1i kh\u00f4ng th\u00e0nh c\u00f4ng c\u00f3 th\u1ec3 x\u1ea3y ra n\u1ebfu t\u01b0\u1eddng l\u1eeda c\u1ee5c b\u1ed9 c\u1ee7a b\u1ea1n gi\u1edbi h\u1ea1n l\u01b0u l\u01b0\u1ee3ng truy c\u1eadp \u0111i, b\u1ea1n \u0111ang g\u1eb7p s\u1ef1 c\u1ed1 k\u1ebft n\u1ed1i m\u1ea1ng ho\u1eb7c n\u1ebfu y\u00eau c\u1ea7u gieo l\u1ea1i b\u1ecb ch\u1eb7n ho\u00e0n to\u00e0n.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Giao di\u1ec7n ng\u01b0\u1eddi d\u00f9ng thay th\u1ebf t\u1eadp trung v\u00e0o quy\u1ec1n ri\u00eang t\u01b0 d\u00e0nh cho Reddit";
    t[12224] = "Toggle Tunnels";
    t[12225] = "B\u1eadt/T\u1eaft \u0110\u01b0\u1eddng \u0111\u00e0o";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "C\u00f3 th\u1ec3 v\u00f4 hi\u1ec7u h\u00f3a trong t\u1eadp tin <code>clients.config</code>. C\u0169ng c\u00f3 th\u1ec3 c\u1ea5u h\u00ecnh li\u00ean k\u1ebft v\u1edbi giao di\u1ec7n c\u1ee5 th\u1ec3 ho\u1eb7c t\u1ea5t c\u1ea3 c\u00e1c giao di\u1ec7n trong t\u1eadp tin <code>jetty.xml</code>.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "B\u1ea1n c\u00f3 th\u1ec3 x\u00e1c \u0111\u1ecbnh d\u1ecbch v\u1ee5 n\u00e0o t\u1ef1 \u0111\u1ed9ng b\u1eaft \u0111\u1ea7u khi b\u1ed9 \u0111\u1ecbnh tuy\u1ebfn kh\u1edfi \u0111\u1ed9ng, qu\u1ea3n l\u00fd ph\u00e2n b\u1ed5 \u0111\u01b0\u1eddng h\u1ea7m \u0111\u1ec3 t\u1ed1i \u01b0u h\u00f3a c\u00e1c d\u1ecbch v\u1ee5 s\u1eed d\u1ee5ng cao ho\u1eb7c \u0111\u1ec3 gi\u1ea3m thi\u1ec3u CPU v\u00e0 chi ph\u00ed b\u1ed9 nh\u1edb, th\u00eam c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m m\u00e1y ch\u1ee7 v\u00e0 m\u00e1y kh\u00e1ch v\u00e0o c\u00e1c d\u1ecbch v\u1ee5 l\u01b0u tr\u1eef ho\u1eb7c truy c\u1eadp tr\u00ean m\u1ea1ng, \u0111\u1eb7t gi\u1edbi h\u1ea1n t\u1ed1c \u0111\u1ed9 ho\u1eb7c \u0111\u01b0\u1eddng h\u1ea7m L\u1ecdc cho c\u00e1c \u0111\u01b0\u1eddng h\u1ea7m m\u00e1y ch\u1ee7 c\u1ee7a b\u1ea1n v\u00e0 nhi\u1ec1u h\u01a1n n\u1eefa.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "Li\u00ean k\u1ebft v\u1edbi \u0111\u1ecba ch\u1ec9 LAN. C\u00f3 th\u1ec3 thay \u0111\u1ed5i v\u1edbi c\u1ea5u h\u00ecnh n\u00e2ng cao <code>i2np.upnp.HTTPPort=nnnn</code>. C\u00f3 th\u1ec3 v\u00f4 hi\u1ec7u h\u00f3a tr\u00ean trang <a href=/confignet>C\u1ea5u h\u00ecnh M\u1ea1ng</a>.";
    t[12234] = "Data transferred";
    t[12235] = "D\u1eef li\u1ec7u \u0111\u01b0\u1ee3c truy\u1ec1n";
    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "Trong h\u1ed9p c\u00f3 d\u00f2ng <i>Kh\u00f4ng s\u1eed d\u1ee5ng Proxy cho</i> th\u00eam d\u00f2ng <code>127.0.0.1,localhost</code> \u0111\u1ec3 \u0111\u1ea3m b\u1ea3o c\u1ed5ng \u0111i\u1ec1u khi\u1ec3n I2P v\u00e0 c\u00e1c trang web \u0111\u1ecba ph\u01b0\u01a1ng kh\u00e1c v\u1eabn c\u00f3 th\u1ec3 s\u1eed d\u1ee5ng.";
