    t[12279] = "Lu\u00f4n s\u1eed d\u1ee5ng \u0111\u1ecba ch\u1ec9 IP \u0111\u01b0\u1ee3c ph\u00e1t hi\u1ec7n t\u1ef1 \u0111\u1ed9ng (kh\u00f4ng \u0111\u01b0\u1ee3c t\u01b0\u1eddng l\u1eeda)";
    t[12282] = "where we will store our LS";
