    t[12307] = "Gi\u1edbi h\u1ea1n v\u1ec1 k\u1ebft n\u1ed1i truy\u1ec1n t\u1ea3i c\u1ee7a b\u1ea1n \u0111\u01b0\u1ee3c t\u1ef1 \u0111\u1ed9ng \u0111i\u1ec1u ch\u1ec9nh d\u1ef1a tr\u00ean ph\u1ea7n b\u0103ng th\u00f4ng m\u00e0 b\u1ea1n \u0111\u00e3 c\u1ea5u h\u00ecnh.";
